INSERT INTO `wp_job_pm` VALUES (12,0,69,'Hello, I wanted to inquire what is included in the $1,500/month - is that just base rent, or includes all utilities, etc.?','RE: Lab space in La Jolla on the Mesa',1,0,404,1408692348,0,43,0,1,1),(10,0,39,'Hi, I was referred to you by Julio regarding the need for a GC/MS, HPLC, DNA Sequencer, and others in San Diego.  Would like to connect with to you to discuss.  Please provide  the best number to reach you at.<br />\r\n<br />\r\nKind Regards,<br />\r\nKaye','Referred by Julio',1,0,224,1407232939,0,66,0,1,1),(8,0,54,'Hi, is the whole 1,600 sqft lab only $500/month?  Seems a bit on the low end.  Or is this for a bay/bench like QB3?','RE: Lab access and basic molecular biology lab - fully functional',0,0,349,1405356532,0,20,0,1,1),(11,0,39,'Hello Fatih,<br />\r\n<br />\r\nI am currently in the process of searching for lab space in an incubator lab for an analytical chemistry lab venture. We will be specializing in medical marijuana testing and have the proper licences and permits to possess, transport, and consume medical cannabis. Along with all the proper paperwork, we will work very discreetly with the product, making sure to never store any product in the lab if it is not being tested at the moment and using airtight containers to hold samples when they are in the lab.   <br />\r\n<br />\r\nI have spoken with Julio about your lab, and I believe he will be contacting you sometime this week. I wanted to get an idea about all of the charges that will come with renting space in your incubator. We will need to use an HPLC with a UV/Vis Detector and autosampler along with a GC that has an FID detector and headspace autosampler and a UV/Vis spec. I am not entirely sure exactly how often and how long we will need to use these machines, though I am predicting at least a couple of hours 4-5 times a week. It will depend on the volume of work that we have at the current time. We will also need to use the general lab equipment such as scales, centrifuges, etc. I look forward to hearing from you.  <br />\r\n<br />\r\nBest Regards, <br />\r\nHassan Khalil<br />\r\n','RE: $300/month Wet Lab Bench in San Diego',1,0,224,1407238356,0,67,0,1,1),(13,0,54,'Hi, we are spinning a company out of Stanford and I wanted to inquire about what is included in the $500/month rent - utilities, equipment (if so what type), and/or sample storage?<br />\r\n<br />\r\nIdeally, we need:<br />\r\n<br />\r\nMain lab (dedicated access preferred):<br />\r\n ~400 sqft. space (23 benches)<br />\r\n+desks space for 23 technicians (with potential room to expand in the future)<br />\r\n Chairs (desk and bench)<br />\r\n Designated PCR setup area (bench,hood,room)<br />\r\n Space for fridge(s) and freezer(s)<br />\r\n Oxygen/vacuum access<br />\r\n Internet/phone connections<br />\r\n<br />\r\nTC room (dedicated access preferred):<br />\r\n ~200 sqft. space<br />\r\n Atleast 1 TC Hood (Labgard Class II, Type A2, biological safety cabinet)<br />\r\n 2-3 Incubators (for example Thermo HERAcell 150i or BINDER CB 150UL)<br />\r\n Fluorescent scope (for example Nikon Eclipse Ti scope)<br />\r\n TC Centrifuge (Allegra X15R w/ SX4750A rotor or similar) with set of adapters and aerosole carnisters, 96well plate carrier<br />\r\n At least 1 Ultracentrifuge (in TC room or near by) (Beckman Coulter Optima XPN-80 or L-80 XP)<br />\r\n Ultra centrifuge rotors (SW32Ti, 70Ti, SW55ti and SW41) and matching buckets<br />\r\n<br />\r\nShared equipment access:<br />\r\n 96 and/or 384well QPCR machine<br />\r\n liquid nitrogen storage<br />\r\n NanoDrop<br />\r\n pH meter<br />\r\n Bacteria shaker/incubator<br />\r\n Agarose gel imaging system <br />\r\n -80C freezer<br />\r\n Plate reader (for ELISA and Luc)<br />\r\n Allegra 25R centrifuge w/ SX4750A rotor + 4 buckets<br />\r\n Access to cold-room<br />\r\n Access to FACS machine<br />\r\n Scale<br />\r\n Autoclave<br />\r\n Glass washing service<br />\r\n Biohazardous trash disposal services<br />\r\n<br />\r\nItems budgeted to purchase unless included with space:<br />\r\n PCR machine<br />\r\n Table-top centrifuges (for example Eppendorf 5415R centrifuge)<br />\r\n 4C fridge and -20C freezers<br />\r\n Water bath(s)<br />\r\n Stirring/hot plates<br />\r\n 2D/3D rocker/shaker<br />\r\n Refractometer (Model 334610)<br />\r\n Hybridization incubator-Robbins Scientific Model 1000<br />\r\n<br />\r\nMice facility preferences<br />\r\n It should be close to the main lab (preferentially same building or directly<br />\r\nconnected separate building, as mice may need to be carried to main lab)<br />\r\n It should allow housing immune-deficient mice<br />\r\n With time: it should allow housing of immune-deficient mice (BSL2)<br />\r\n Nice to have: surgical rooms for rent<br />\r\n Isoflurane anesthesia equipment (or similar)<br />\r\n Vet services','RE: Lab access and basic molecular biology lab - fully functional in Berkeley',0,0,349,1408692952,0,20,0,1,1),(14,0,44,'Hi, we are spinning a company out of Stanford and I wanted to inquire about whether BTnB also has space available or just the flow cytometer (I remember hearing about it a few years ago)?<br />\r\n<br />\r\nIdeally, we need:<br />\r\n<br />\r\nMain lab (dedicated access preferred):<br />\r\n ~400 sqft. space (23 benches)<br />\r\n+desks space for 23 technicians (with potential room to expand in the future)<br />\r\n Chairs (desk and bench)<br />\r\n Designated PCR setup area (bench,hood,room)<br />\r\n Space for fridge(s) and freezer(s)<br />\r\n Oxygen/vacuum access<br />\r\n Internet/phone connections<br />\r\n<br />\r\nTC room (dedicated access preferred):<br />\r\n ~200 sqft. space<br />\r\n Atleast 1 TC Hood (Labgard Class II, Type A2, biological safety cabinet)<br />\r\n 2-3 Incubators (for example Thermo HERAcell 150i or BINDER CB 150UL)<br />\r\n Fluorescent scope (for example Nikon Eclipse Ti scope)<br />\r\n TC Centrifuge (Allegra X15R w/ SX4750A rotor or similar) with set of adapters and aerosole carnisters, 96well plate carrier<br />\r\n At least 1 Ultracentrifuge (in TC room or near by) (Beckman Coulter Optima XPN-80 or L-80 XP)<br />\r\n Ultra centrifuge rotors (SW32Ti, 70Ti, SW55ti and SW41) and matching buckets<br />\r\n<br />\r\nShared equipment access:<br />\r\n 96 and/or 384well QPCR machine<br />\r\n liquid nitrogen storage<br />\r\n NanoDrop<br />\r\n pH meter<br />\r\n Bacteria shaker/incubator<br />\r\n Agarose gel imaging system <br />\r\n -80C freezer<br />\r\n Plate reader (for ELISA and Luc)<br />\r\n Allegra 25R centrifuge w/ SX4750A rotor + 4 buckets<br />\r\n Access to cold-room<br />\r\n Access to FACS machine<br />\r\n Scale<br />\r\n Autoclave<br />\r\n Glass washing service<br />\r\n Biohazardous trash disposal services<br />\r\n<br />\r\nItems budgeted to purchase unless included with space:<br />\r\n PCR machine<br />\r\n Table-top centrifuges (for example Eppendorf 5415R centrifuge)<br />\r\n 4C fridge and -20C freezers<br />\r\n Water bath(s)<br />\r\n Stirring/hot plates<br />\r\n 2D/3D rocker/shaker<br />\r\n Refractometer (Model 334610)<br />\r\n Hybridization incubator-Robbins Scientific Model 1000<br />\r\n<br />\r\nMice facility preferences<br />\r\n It should be close to the main lab (preferentially same building or directly<br />\r\nconnected separate building, as mice may need to be carried to main lab)<br />\r\n It should allow housing immune-deficient mice<br />\r\n With time: it should allow housing of immune-deficient mice (BSL2)<br />\r\n Nice to have: surgical rooms for rent<br />\r\n Isoflurane anesthesia equipment (or similar)<br />\r\n Vet services','Lab Space',1,0,340,1408694117,0,43,0,1,1),(15,0,69,'Hi, thought I would write back and include more details. We are spinning a company out of Stanford and I wanted to inquire about what is included in the $1,500/month rent - utilities, and/or sample storage?<br />\r\n<br />\r\nIdeally, we need:<br />\r\n<br />\r\nMain lab (dedicated access preferred):<br />\r\n ~400 sqft. space (23 benches)<br />\r\n+desks space for 23 technicians (with potential room to expand in the future)<br />\r\n Chairs (desk and bench)<br />\r\n Designated PCR setup area (bench,hood,room)<br />\r\n Space for fridge(s) and freezer(s)<br />\r\n Oxygen/vacuum access<br />\r\n Internet/phone connections<br />\r\n<br />\r\nTC room (dedicated access preferred):<br />\r\n ~200 sqft. space<br />\r\n Atleast 1 TC Hood (Labgard Class II, Type A2, biological safety cabinet)<br />\r\n 2-3 Incubators (for example Thermo HERAcell 150i or BINDER CB 150UL)<br />\r\n Fluorescent scope (for example Nikon Eclipse Ti scope)<br />\r\n TC Centrifuge (Allegra X15R w/ SX4750A rotor or similar) with set of adapters and aerosole carnisters, 96well plate carrier<br />\r\n At least 1 Ultracentrifuge (in TC room or near by) (Beckman Coulter Optima XPN-80 or L-80 XP)<br />\r\n Ultra centrifuge rotors (SW32Ti, 70Ti, SW55ti and SW41) and matching buckets<br />\r\n<br />\r\nShared equipment access:<br />\r\n 96 and/or 384well QPCR machine<br />\r\n liquid nitrogen storage<br />\r\n NanoDrop<br />\r\n pH meter<br />\r\n Bacteria shaker/incubator<br />\r\n Agarose gel imaging system <br />\r\n -80C freezer<br />\r\n Plate reader (for ELISA and Luc)<br />\r\n Allegra 25R centrifuge w/ SX4750A rotor + 4 buckets<br />\r\n Access to cold-room<br />\r\n Access to FACS machine<br />\r\n Scale<br />\r\n Autoclave<br />\r\n Glass washing service<br />\r\n Biohazardous trash disposal services<br />\r\n<br />\r\nItems budgeted to purchase unless included with space:<br />\r\n PCR machine<br />\r\n Table-top centrifuges (for example Eppendorf 5415R centrifuge)<br />\r\n 4C fridge and -20C freezers<br />\r\n Water bath(s)<br />\r\n Stirring/hot plates<br />\r\n 2D/3D rocker/shaker<br />\r\n Refractometer (Model 334610)<br />\r\n Hybridization incubator-Robbins Scientific Model 1000<br />\r\n<br />\r\nMice facility preferences (if you have one; or maybe can refer?)<br />\r\n It should be close to the main lab (preferentially same building or directly<br />\r\nconnected separate building, as mice may need to be carried to main lab)<br />\r\n It should allow housing immune-deficient mice<br />\r\n With time: it should allow housing of immune-deficient mice (BSL2)<br />\r\n Nice to have: surgical rooms for rent<br />\r\n Isoflurane anesthesia equipment (or similar)<br />\r\n Vet services','RE: Lab space in La Jolla on the Mesa',1,0,404,1408694233,0,43,0,1,1),(16,0,43,'Hi,<br />\r\nWe have many of the items that you are looking for.  The $1,500 per month rent is an estimate per knee hole or per person depending on your needs.  It includes utilities and certain services. May I suggest a site visit so that you have a chance to see the space. We can further discuss your needs and possible terms.<br />\r\n<br />\r\nPlease feel free to call me at 858-401-7900 x503 if you would like to discuss further.<br />\r\n<br />\r\nBest,<br />\r\nLeigh<br />\r\nLeigh Elkolli<br />\r\nDirector of Finance<br />\r\nAvidity NanoMedicines, LLC  ','RE: Lab space in La Jolla on the Mesa',1,0,404,1408703783,0,69,0,1,1),(17,0,69,'Thank you, Leigh.<br />\r\n<br />\r\nFirst, the key are two mouse facilities  one normal and one for immunocompromised mice (BSL2). we will be doing a lot of survival surgeries, so it is important to have surgical suite adjacent to the BSL2 mouse room. Do you have this available?  If so, what price?','RE: Lab space in La Jolla on the Mesa',1,0,404,1408721275,0,43,0,1,1),(18,0,43,'We do not have the mice facility on site.  We can provide a referral. We use Explora which is right around the corner from us.  In speaking with our biologists, they have all of the items that you noted under mice facility preferences as our requirements are quite similar. ','RE: Lab space in La Jolla on the Mesa',1,0,404,1408721452,0,69,0,1,1),(19,0,43,'Hi,<br />\r\nI wanted to follow up and see if you had any additional questions or would like to tour our space.  <br />\r\nIs the on-site vivarium a must have for you?  What is your timing for needing space.  <br />\r\n<br />\r\nHope all is well.<br />\r\n<br />\r\nBest,<br />\r\nLeigh ','RE: Lab space in La Jolla on the Mesa',0,0,404,1409653916,0,69,0,1,1),(20,0,39,'Hi,<br />\r\n<br />\r\nI might be interested. Please respond to mmatho at gmail. Also, I would like to know what are the user fees for equipment you have and a list of available equipment (FPLC? SPR or BLI? What centrifuges, etc). Thanks so much,<br />\r\nMichael Matho, PhD','RE: $300/month Wet Lab Bench in San Diego @ Versa',1,0,224,1412937423,0,81,0,1,1),(21,0,81,'Hi Michael.  <br />\r\n<br />\r\nWe run a major equipment surplus equipment company and are happy to offer most of whatever we have in inventory to tenants of our incubator on a short-term basis: conquerscientific.com<br />\r\n<br />\r\nWe bundle general lab equipment like microcentrifuge, hot plate, analytical balance for additional flat $200/mo extra.<br />\r\n<br />\r\nFor higher-end analytical equipment: We are really just getting the incubator up and started so I am negotiable based on the type of equipment you need, planned purpose of use, and usage frequency.  Ideally more than just one tenant will share time on analytical equipment. <br />\r\n<br />\r\nSince I operate a reputable equipment company, the equipment are kept up on calibration/maintenance by my engineers so in great working condition!<br />\r\n<br />\r\nWhy not come down to see the space and we can talk more about the equipment and be joined by Fatih who runs the incubator and Conquer Scientific - when works best for you?<br />\r\n<br />\r\n','RE: $300/month Wet Lab Bench in San Diego @ Versa',0,0,224,1413013217,0,39,0,1,1),(22,0,39,'LL Solutions, INC is a biotech start up in San Diego, we need a chemistry lab for our R&amp;D, which needs NMR, LC_MS, vacuum, chemistry hood. May I know if your lab space meets those basic requirement?','RE: $300/month Wet Lab Bench in San Diego @ Versa',1,0,224,1413212029,0,83,0,1,1),(23,0,83,'Hello Yun Oliver Long,<br />\r\nWe have all but the NMR.  We charge $300/month for access to a wet lab bench and chemical fume hood.<br />\r\n<br />\r\nDepending on your usage of the LC/MS we can provide that as well for an additional monthly cost.<br />\r\n<br />\r\nWe make sure the equipment is maintained and calibrated.<br />\r\n<br />\r\nI see you don\'t have a verified badge so I would be comfortable meeting to show you the incubator space.  But need you to work with Lab Fellows folks to get verified - it\'s required so they cover my insurance costs in case any accidents happen.<br />\r\n<br />\r\nLet me know when you are available and I\'m happy to give you a tour!','RE: $300/month Wet Lab Bench in San Diego @ Versa',1,0,224,1413217605,0,39,0,1,1),(24,0,81,'Meant to mention:<br />\r\n<br />\r\nI see you don\'t have a verified badge so I would be comfortable meeting to show you the incubator space. But need you to work with Lab Fellows folks to get verified before accepting any kind of reservations from you - it\'s required so they cover my insurance costs in case any accidents happen.<br />\r\n<br />\r\nLet me know when you are available and I\'m happy to give you a tour! ','RE: $300/month Wet Lab Bench in San Diego @ Versa',0,0,224,1413217893,0,39,0,1,1),(25,0,39,'Thanks for your response.<br />\r\n<br />\r\n1 Please let me know the address<br />\r\n<br />\r\n2 Please list the detailed price for the usage of NMR<br />\r\n<br />\r\nthanks','RE: $300/month Wet Lab Bench in San Diego @ Versa',1,0,224,1413390672,0,83,0,1,1),(26,0,83,'Hi,<br />\r\nWe have LC/MS, vacuum, and chemistry hood.  We do not have an NMR.','RE: $300/month Wet Lab Bench in San Diego @ Versa',1,0,224,1413446685,0,39,0,1,1),(27,0,83,'We are located at 6259 Progressive Avenue, Suite 300<br />\r\nSan Diego, CA 92154.','RE: $300/month Wet Lab Bench in San Diego @ Versa',1,0,224,1413454167,0,39,0,1,1);
