 project: ##project_name## has ended. You are the winner!','yes'),(280,'ProjectTheme_won_project_winner_email_message','Hello ##username##,\n\nThe project: <a href=\"##project_link##\"><b>##project_name##</b></a> has ended.\nYou just wont it. See won project details below:\n\nProject Link: ##project_link##\nWinner Bid Value: ##winner_bid_value##\n\nThank you,\n##your_site_name## Team','yes'),(281,'ProjectTheme_won_project_owner_email_subject','Your have selected a winner for your project: ##project_name##.','yes'),(282,'ProjectTheme_won_project_owner_email_message','Hello ##username##,\n\nYour project: <a href=\"##project_link##\"><b>##project_name##</b></a> \n																				has ended.\nYou just selected a winner for it. \n																				See won project details below:\n\nProject Link: ##project_link##\nWinner Bidder Username: ##winner_bid_username##\nWinner Bid Value: ##winner_bid_value##\n\nThank you,\n##your_site_name## Team','yes'),(283,'ProjectTheme_rated_user_email_subject','Your were just rated for the project: ##project_name##.','yes'),(284,'ProjectTheme_rated_user_email_message','Hello ##username##,\n\nYou have received a rating for the project: \n																				<a href=\"##project_link##\"><b>##project_name##</b></a>.\nSee rating details below:\n\nProject Link: ##project_link##\nRating: ##rating##\nComment: ##comment##\n\nThank you,\n##your_site_name## Team','yes'),(285,'ProjectTheme_priv_mess_received_email_subject','Your have received a private message from user: ##sender_username##.','yes'),(286,'ProjectTheme_priv_mess_received_email_message','Hello ##receiver_username##,\n\nYou have received a private message from <b>##sender_username##</b>\nTo read it, just login to your account: ##my_account_url##\n\nThank you,\n##your_site_name## Team','yes'),(287,'ProjectTheme_completed_project_owner_email_subject','Project marked as completed by provider: ##project_name##.','yes'),(288,'ProjectTheme_completed_project_owner_email_message','Hello ##username##,\n\nThe provider/winner of this project has marked it as completed <b>##project_name##</b> ( ##project_link## )\nTo check the project out and accept it go to your account area: ##my_account_url##\n\nThank you,\n##your_site_name## Team','yes'),(289,'ProjectTheme_completed_project_bidder_email_subject','You completed the project: ##project_name##.','yes'),(290,'ProjectTheme_completed_project_bidder_email_message','Hello ##username##,\n\nYou have just marked the following project as completed: <b>##project_name##</b> ( ##project_link## )\nYou will be notified when the project owner will accept your project.\n\nThank you,\n##your_site_name## Team','yes'),(291,'ProjectTheme_delivered_project_bidder_email_subject','Project marked delivered and accepted by the owner: ##project_name##.','yes'),(292,'ProjectTheme_delivered_project_bidder_email_message','Hello ##username##,\n\nThe owner of the project: <b>##project_name##</b> ( ##project_link## ) has accepted and marked it as delivered.\nYou will be notified when the owner pays the project fee.\n\nThank you,\n##your_site_name## Team','yes'),(293,'ProjectTheme_delivered_project_owner_email_subject','Your project accepted as delivered: ##project_name##.','yes'),(294,'ProjectTheme_delivered_project_owner_email_message','Hello ##username##,\n\nYou have just accepted as delivered your project: <b>##project_name##</b> ( ##project_link## ).\nYou need to login into your account area and pay the project fee.\nLogin here: ##my_account_url##\n\nThank you,\n##your_site_name## Team','yes'),(295,'ProjectTheme_new_emails_138','DonE','yes'),(296,'ProjectTheme_subscription_email_subject','Project matching your criteria: ##project_name##.','yes'),(297,'ProjectTheme_subscription_email_message','Hello ##username##,\n\nA new project that matches your criteria has been posted: <b>##project_name##</b> ( ##project_link## ).\n\nThank you,\n##your_site_name## Team','yes'),(298,'ProjectTheme_message_board_owner_email_subject','New message on project message board: ##project_name##.','yes'),(299,'ProjectTheme_message_board_owner_email_message','Hello ##username##,\n\nThe user ##message_owner_username## has posted a new message on the project message board.\nYou can check the message here: <b>##project_name##</b> ( ##project_link## )\n\nThank you,\n##your_site_name## Team','yes'),(300,'ProjectTheme_message_board_bidder_email_subject','New message on project message board: ##project_name##.','yes'),(301,'ProjectTheme_message_board_bidder_email_message','Hello ##username##,\n\nThe project owner (##project_username##) has posted a reply on the project message board.\nYou can check the answer out here: <b>##project_name##</b> ( ##project_link## )\n\nThank you,\n##your_site_name## Team','yes'),(302,'ProjectTheme_new_emails_139','DonE','yes'),(303,'ProjectTheme_payment_on_completed_project_subject','Your paid for the project: ##project_name##','yes'),(304,'ProjectTheme_payment_on_completed_project_message','Hello ##username##,\n\nYou have paid the winning bid for your project <a href=\"##project_link##\"><b>##project_name##</b></a>.\nSee your payment details below:\n\nBidder Username: ##bidder_username##\nBid Value: ##bid_value##\n\nThank you,\n##your_site_name## Team','yes'),(150885,'_transient_timeout_feed_867bd5c64f85878d03a060509cd2f92c','1413531794','no'),(150886,'_transient_feed_867bd5c64f85878d03a060509cd2f92c','a:4:{s:5:\"child\";a:1:{s:0:\"\";a:1:{s:3:\"rss\";a:1:{i:0;a:6:{s:4:\"data\";s:3:\"\n\n\n\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:7:\"version\";s:3:\"2.0\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:1:{s:7:\"channel\";a:1:{i:0;a:6:{s:4:\"data\";s:61:\"\n	\n	\n	\n	\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:16:\"WordPress Planet\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://planet.wordpress.org/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"language\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"en\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"WordPress Planet - http://planet.wordpress.org/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"item\";a:50:{i:0;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"WPTavern: WPWeekly Episode 166  Interview With The Project Lead For XWP, Frankie Jarrett\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://wptavern.com?p=32015&preview_id=32015\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:96:\"http://wptavern.com/wpweekly-episode-166-interview-with-the-project-lead-for-xwp-frankie-jarrett\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4393:\"<p>Back in September, <a title=\"http://wptavern.com/stream-morphs-from-a-plugin-into-a-service\" href=\"http://wptavern.com/stream-morphs-from-a-plugin-into-a-service\">Stream 2.0 was released</a> with some significant changes. The most notable change is the transition from a plugin into a service.</p>\n<p>In this episode of WordPress Weekly, <a title=\"http://marcuscouch.com/\" href=\"http://marcuscouch.com/\">Marcus Couch</a> and I are joined by the project lead For <a title=\"https://xwp.co/\" href=\"https://xwp.co/\">XWP</a>, <a title=\"http://frankiejarrett.com/\" href=\"http://frankiejarrett.com/\">Frankie Jarrett</a>. Jarrett goes in-depth on the decision to turn Stream into a service. He also explains why it needs to be connected to a WordPress.com ID, what the team is doing regarding the enterprise, and why record data is stored in the cloud. Near the end of the interview, we discuss the lessons learned from how the plugin was shipped and communicated to customers.</p>\n<h2>Stories Discussed:</h2>\n<p><a title=\"http://wptavern.com/webdesign-com-is-now-ithemes-training\" href=\"http://wptavern.com/webdesign-com-is-now-ithemes-training\">WebDesign.com Is Now iThemes Training</a><br />\n<a title=\"http://wptavern.com/troubleshooting-handbook-for-new-wordpress-support-forum-volunteers-is-live\" href=\"http://wptavern.com/troubleshooting-handbook-for-new-wordpress-support-forum-volunteers-is-live\">Troubleshooting Handbook For New WordPress Support Forum Volunteers Is Live</a><br />\n<a title=\"http://wptavern.com/how-to-obtain-the-total-download-count-for-plugins-attached-to-a-wordpress-org-username\" href=\"http://wptavern.com/how-to-obtain-the-total-download-count-for-plugins-attached-to-a-wordpress-org-username\">How to Obtain The Total Download Count For Plugins Attached to a WordPress.org Username</a><br />\n<a title=\"http://wptavern.com/rate-and-review-a-wordpress-plugin-day-set-for-october-17th\" href=\"http://wptavern.com/rate-and-review-a-wordpress-plugin-day-set-for-october-17th\">Rate and Review a WordPress Plugin Day Set For October 17th</a><br />\n<a title=\"http://wptavern.com/twenty-fifteen-officially-added-to-the-development-version-of-wordpress\" href=\"http://wptavern.com/twenty-fifteen-officially-added-to-the-development-version-of-wordpress\">Twenty Fifteen Officially Added to The Development Version of WordPress </a><br />\n<a title=\"http://wptavern.com/loopconf-a-conference-catered-to-wordpress-developers\" href=\"http://wptavern.com/loopconf-a-conference-catered-to-wordpress-developers\">LoopConf: A Conference Catered to WordPress Developers </a></p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a title=\"https://wordpress.org/plugins/wc-vendors/\" href=\"https://wordpress.org/plugins/wc-vendors/\">WC Vendors</a> is a WooCommerce extension that lets you create your own Etsy or Amazon style marketplace, allowing multiple vendors to sell their goods. This allows other users to sell tangible products, virtual products or downloads on your site. Vendors receive the commissions you set on products they sell from your store.</p>\n<p><a title=\"https://wordpress.org/plugins/wp-comment-fields/\" href=\"https://wordpress.org/plugins/wp-comment-fields/\">WordPress Comments Fields</a> is a plugin that allows admins to add custom fields to the comment area. These fields are saved as comment meta and are displayed under the comment. The plugin support four different field types: Drag and drop, text, radio, radio and select inputs.</p>\n<p><a title=\"https://wordpress.org/plugins/comic-sans-roulette/\" href=\"https://wordpress.org/plugins/comic-sans-roulette/\">Comic Sans Roulette</a> randomly changes all fonts on your site to Comic Sans. You have a 10% chance that all of the fonts will be Comic Sans!</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, October 22nd 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"http://www.wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #166:</strong><br />\n</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 16 Oct 2014 17:41:04 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"WPTavern: LoopConf: A Conference Catered to WordPress Developers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=32006\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://wptavern.com/loopconf-a-conference-catered-to-wordpress-developers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2653:\"<p>&nbsp;</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/LoopConfFeaturedImage.png\" rel=\"prettyphoto[32006]\"><img class=\"aligncenter size-full wp-image-32007\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/LoopConfFeaturedImage.png?resize=650%2C200\" alt=\"LoopConf Featured Image\" /></a>Scheduled to take place <strong>May 7-8th, 2015</strong> at Westin Lake in Las Vegas, NV, <a title=\"http://loopconf.io/\" href=\"http://loopconf.io/\">LoopConf</a> is a conference dedicated to WordPress developers. The two-day event has six speakers confirmed with more on the way. They include:</p>\n<ul>\n<li>Joost de Valk</li>\n<li>Jenn Schiffer</li>\n<li>John O&#8217; Nolan</li>\n<li>Helen Hou-Sand</li>\n<li>Andrew Nacin</li>\n<li>Syed Balkhi</li>\n</ul>\n<p>LoopConf is a single track conference where a bulk of the content will consist of 30 minute sessions and 60 minute developer work shops. It gives developers an opportunity to dive deep into advanced engineering and development topics in a relaxed atmosphere surrounded by like-minded individuals.</p>\n<p>If you&#8217;re interested in speaking at the event, LoopConf is <a title=\"http://loopconf.io/apply/\" href=\"http://loopconf.io/apply/\">calling for speakers</a>. The deadline to submit a speaker application is November 4th, 2014. If you&#8217;re interested in financially supporting the event, there&#8217;s a <a title=\"http://loopconf.io/sponsor/\" href=\"http://loopconf.io/sponsor/\">sponsor application available</a>.</p>\n<p>Like <a title=\"http://prestigeconf.com/\" href=\"http://prestigeconf.com/\">PrestigeConf</a>, LoopConf is not a WordCamp or associated with the WordPress foundation. Even though it&#8217;s an independent event, there is at least one trait similar to WordCamps. One of the rules to be a speaker is to embrace the open source spirit.</p>\n<blockquote><p>We want all of our speakers to show up with an attitude to givefreely. This isnt an opportunity to pitch your company, its the chance to share knowledge that youve picked up as youve perfected your craft.</p></blockquote>\n<p>Event organizer, Ryan Sullivan, says the plan is to &#8220;sell 600-700 tickets in two rounds&#8221;. He also told the Tavern, &#8220;we&#8217;ll have an exclusive deal with the hotel for attendees to take advantage of. For those who can&#8217;t make it or would like to attend virtually, the event will be <strong>streamed live for free</strong>.&#8221;</p>\n<p>Tickets have yet to go on sale as the organizing team works to complete the details. However, those who sign up to the LoopConf email list will be the first to know when tickets go on sale.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 15 Oct 2014 21:58:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"WPTavern: Twenty Fifteen Officially Added to The Development Version of WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31991\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"http://wptavern.com/twenty-fifteen-officially-added-to-the-development-version-of-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5572:\"<p>The default theme slated to ship with WordPress 4.1 dubbed &#8220;<a title=\"http://wptavern.com/first-look-at-designs-for-the-twenty-fifteen-default-wordpress-theme\" href=\"http://wptavern.com/first-look-at-designs-for-the-twenty-fifteen-default-wordpress-theme\">Twenty Fifteen</a>&#8221; has <a title=\"https://make.wordpress.org/core/2014/10/14/twenty-fifteen-is-here/\" href=\"https://make.wordpress.org/core/2014/10/14/twenty-fifteen-is-here/\">officially been added</a> to the development version of WordPress. In sharp contrast to <a title=\"https://wordpress.org/themes/twentyfourteen\" href=\"https://wordpress.org/themes/twentyfourteen\">Twenty Fourteen</a>, Twenty Fifteen is a simple, two column, blog focused theme. The typography features Googles Noto Serif and Sans, a font family designed to be visually harmonious across many of the worlds languages.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/09/twenty-fifteen.png\" rel=\"prettyphoto[31991]\"><img class=\"aligncenter size-full wp-image-30226\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/09/twenty-fifteen.png?resize=1024%2C825\" alt=\"twenty-fifteen\" /></a></p>\n<p>Here&#8217;s what the Tavern looks like with Twenty Fifteen activated. In the screenshot, you&#8217;ll notice a scrollbar between the sidebar and content. Being able to scroll the sidebar separate from the content reminds me of the Visual Editor in WordPress 3.9. I&#8217;d like to see both columns be a cohesive unit for a better experience and to eliminate the <strong>ugly</strong> scrollbar. <em>This issue has already been <a title=\"https://core.trac.wordpress.org/ticket/29979\" href=\"https://core.trac.wordpress.org/ticket/29979\">reported</a>.</em></p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/10/TwentyFifteenTavernHomepage.png\" rel=\"prettyphoto[31991]\"><img class=\"size-full wp-image-31993\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/10/TwentyFifteenTavernHomepage.png?resize=1025%2C718\" alt=\"Twenty Fifteen Tavern Home Page\" /></a>Twenty Fifteen Tavern Home Page\n<p>In Twenty Fifteen, the comment reply link is aligned to the left. While not a deal breaker, I prefer the comment link to be aligned to the right.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/10/TwentyFifteenCommentReplyLink.png\" rel=\"prettyphoto[31991]\"><img class=\"size-full wp-image-31994\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/10/TwentyFifteenCommentReplyLink.png?resize=660%2C258\" alt=\"Comment Reply Link on The Left\" /></a>Comment Reply Link on The Left\n<p>On the Tavern, we routinely use the featured image as the first image in a post. This works well since the Tavern theme is configured to show only the excerpts and featured image on the homepage. The Twenty Fifteen homepage displays full posts which shows the same image twice, creating a <em>post title sandwich</em>. Keep this in mind if you use featured images and are thinking of switching to Twenty Fifteen in the future.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/TwentyFifteenSandwhich.png\" rel=\"prettyphoto[31991]\"><img class=\"size-full wp-image-31995\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/TwentyFifteenSandwhich.png?resize=750%2C887\" alt=\"A Featured Image Sandwich\" /></a>A Post Title Sandwich\n<p>&nbsp;</p>\n<p>Each post on the homepage is separated by blank space. Featured images that are not at least 826 pixels wide are padded by an equal amount of blank space on each side. Similar to Twenty Fourteen, images that span the entire width change the visual look and feel of the theme. Posts on the homepage look great when the image is more than 826 pixels wide, while smaller images don&#8217;t have the same visual pop.</p>\n<p>Since featured images touch the top of the content box, smaller images give me the impression that something is broken. For example, maybe there&#8217;s an alignment issue where the top of the image is being cut off. It&#8217;s not, but that&#8217;s what I&#8217;m thinking when I see it. This is all a moot point though if you use a full width featured image.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/10/TooSmallOfaFeaturedImage.png\" rel=\"prettyphoto[31991]\"><img class=\"size-full wp-image-31997\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/10/TooSmallOfaFeaturedImage.png?resize=789%2C905\" alt=\"Featured Image is Too Small\" /></a>Featured Image is Too Small\n<h2>It&#8217;s Still Early</h2>\n<p>There is a long way to go before Twenty Fifteen is ready for prime time. Initial feedback I&#8217;ve seen so far labels Twenty Fifteen as a breath of fresh air. Twenty Fifteen goes back to the blogging roots of WordPress, but it does so in a modern, elegant way. Once the bugs have been squashed and the theme polished, I think a lot of people will either switch to or use Twenty Fifteen when WordPress 4.1 is released. If you&#8217;d like to see Twenty Fifteen in the wild, check out <a title=\"http://www.brandonkraft.com/\" href=\"http://www.brandonkraft.com/\">Brandon Kraft&#8217;s personal site</a>.</p>\n<h2>How You Can Help Improve Twenty Fifteen</h2>\n<p>The Twenty Fifteen development team is holding meetings on IRC, every Tuesday at 15:30 UTC, in the #wordpress-dev channel. The meetings are opportunities to discuss all things Twenty Fifteen and to <a title=\"https://core.trac.wordpress.org/query?status=!closed&component=Bundled+Theme\" href=\"https://core.trac.wordpress.org/query?status=!closed&component=Bundled+Theme\">collaborate on tickets</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 15 Oct 2014 20:49:46 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:93:\"WordPress.tv Blog: The Future of WordPress: Great videos from Matt Mullenweg and Andrew Nacin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.wordpress.tv/?p=400\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:110:\"http://blog.wordpress.tv/2014/10/15/the-future-of-wordpress-great-videos-from-matt-mullenweg-and-andrew-nacin/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1936:\"<p>Here are some recent videos from <a href=\"http://wordpress.tv/event/wordcamp-europe-2014/\" target=\"_blank\">WordCamp Europe 2014</a> covering the past, present, and future of WordPress development.</p>\n<h2>Matt Mullenweg: Q&amp;A with Om Malik</h2>\n<div id=\"v-xBhclaAc-1\" class=\"video-player\">\n</div>\n<p>Matt Mullenweg, the founder of WordPress, in conversation with tech writer Om Malik on the WordPress past and present, as well as where we are going for the future.  </p>\n<p><a href=\"http://wordpress.tv/2014/10/03/matt-mullenweg-om-malik-qa/\" target=\"_blank\">View on WordPress.tv</a></p>\n<h2>Andrew Nacin: Post-Modern WordPress</h2>\n<div id=\"v-4Lx4dIRH-1\" class=\"video-player\">\n</div>\n<p>Andrew Nacin, lead developer for the WordPress open source project, discusses the philosophy of WordPress development, and the course it should and will take to keep growing.</p>\n<p><a href=\"http://wordpress.tv/2014/10/13/andrew-nacin-post-modern-wordpress/\" target=\"_blank\">View on WordPress.tv</a></p><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/wptvblog.wordpress.com/400/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wptvblog.wordpress.com/400/\" /></a> <img alt=\"\" border=\"0\" src=\"http://pixel.wp.com/b.gif?host=blog.wordpress.tv&blog=5310177&post=400&subd=wptvblog&ref=&feed=1\" width=\"1\" height=\"1\" /><div><a href=\"http://blog.wordpress.tv/2014/10/15/the-future-of-wordpress-great-videos-from-matt-mullenweg-and-andrew-nacin/\"><img alt=\"Matt Mullenweg & Om Malik: Q&A\" src=\"http://videos.videopress.com/xBhclaAc/video-b445f277f2_scruberthumbnail_1.jpg\" width=\"160\" height=\"120\" /></a></div><div><a href=\"http://blog.wordpress.tv/2014/10/15/the-future-of-wordpress-great-videos-from-matt-mullenweg-and-andrew-nacin/\"><img alt=\"Andrew Nacin: Post-Modern WordPress\" src=\"http://videos.videopress.com/4Lx4dIRH/video-ed23aaca26_scruberthumbnail_3.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 15 Oct 2014 19:29:52 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Jerry Bates\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:23:\"Matt: Listen Completely\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44245\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"http://ma.tt/2014/10/listen-completely/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:441:\"<blockquote><p>Listen now . When people talk listen completely. Dont be thinking what youre going to say. Most people never listen. Nor do they observe. You should be able to go into a room and when you come out know everything that you saw there and not only that. If that room gave you any feeling you should know exactly what it was that gave you that feeling. Try that for practice.</p></blockquote>\n<p>&#8212; Ernest Hemingway</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 15 Oct 2014 15:00:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:24:\"Matt: Among the Marchers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44254\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"http://ma.tt/2014/10/among-the-marchers/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:231:\"<p>Bill McKibben writes from <a href=\"http://www.newyorker.com/news/news-desk/among-marchers\">Among the Marchers of the climate change march</a> the other week. <cite>Hat tip: <a href=\"http://grist.org/\">Chip Giller</a>.</cite></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 14 Oct 2014 22:46:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"Post Status: LoopConf: A new WordPress conference thats only for developers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"http://www.poststat.us/?p=7188\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"http://www.poststat.us/loopconf-new-wordpress-conference-thats-developers/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3300:\"<p>&nbsp;</p>\n<p><img class=\"aligncenter size-large wp-image-7191\" src=\"http://www.poststat.us/wp-content/uploads/2014/10/loopconf1-752x295.png\" alt=\"loopconf\" width=\"627\" height=\"245\" /></p>\n<p>Early May 2015 will be the first ever <a href=\"http://loopconf.io/\">LoopConf</a>, a WordPress conference that&#8217;s geared solely toward developers. Ryan Sullivan, the owner of <a href=\"http://wpsitecare.com\">WP Site Care</a>, is hosting the conference that is to be held in Las Vegas.</p>\n<p>LoopConf describes itself like this:</p>\n<blockquote><p>LoopConf is the greatest conference ever created for WordPress developers. LoopConf came about as we heard technically-minded folks talk about wanting to get together and dive deep into advanced engineering and development topics. We&#8217;ve assembled an amazing group of speakers to get this inaugural event started off on the right foot, and we&#8217;re excited to share our excitement and passion for WordPress with all of you in an exciting two-day event. We hope that you join us to celebrate the software we love, enjoy each other&#8217;s company, and learn from one another.</p></blockquote>\n<p>There are already six speakers confirmed:</p>\n<ul>\n<li><a href=\"http://nacin.com\">Andrew Nacin</a>: WordPress lead developer, works at Audrey Capital</li>\n<li><a href=\"http://helenhousandi.com/\">HelenHou-Sand</a>: Lead developer of WordPress 4.0, works at 10up</li>\n<li><a href=\"http://ghost.org\">John O&#8217;Nolan</a>: Founder of Ghost and former WordPress contributor</li>\n<li><a href=\"http://www.balkhis.com/about/\">Syed Balkhi</a>: Owner of Awesome Motive, the parent company for WP Beginner, List 25, OptinMonster, and others</li>\n<li><a href=\"http://jennmoney.biz/\">Jenn Schiffer</a>: Open web engineer at Bocoup</li>\n<li><a href=\"http://yoast.com\">Joost de Valk</a>: owner of Yoast and maker of the WordPress SEO plugin, amongst others</li>\n</ul>\n<p>The initial speaker line-up is pretty fantastic. I&#8217;d love to learn more from each one of them.</p>\n<p>LoopConf is not a WordCamp or associated with the WordPress foundation. It&#8217;s an independent WordPress conference, and Ryan says it&#8217;s the first in-person developer only WordPress conference he knows of. Most WordCamps are very catered to a diverse audience.</p>\n<p>This could be a good way for people to have more developer centric conversations. I&#8217;m certainly interested to see how it goes, and would like to make it myself. They are seeking sponsors and speaker submissions now. I don&#8217;t know how much the tickets will be exactly, but Ryan tells me he hopes for LoopConf to have a prestige and quality similar to An Event Apart events, but for WordPress &#8212; so I imagine the tickets won&#8217;t be cheap.</p>\n<p>As the WordPress conference ecosystem continues to blossom, I&#8217;m sure this isn&#8217;t the only one we&#8217;ll see like this. Non-WordCamp, niche events like <a href=\"http://pressnomics.com\">PressNomics</a> helped lead the way for those that are happening now, and I think generally it&#8217;s been good to have a diverse array of options for people to attend and learn from one another.</p>\n<p>You can keep up with <a href=\"http://twitter.com/loopconf\">@LoopConf</a> on Twitter or <a href=\"http://loopconf.io\">via the website</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 14 Oct 2014 18:22:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"WPTavern: Rate and Review a WordPress Plugin Day Set For October 17th\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31977\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"http://wptavern.com/rate-and-review-a-wordpress-plugin-day-set-for-october-17th\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3065:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/RateReviewPluginDayFeaturedImage.png\" rel=\"prettyphoto[31977]\"><img class=\"aligncenter size-full wp-image-31979\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/RateReviewPluginDayFeaturedImage.png?resize=666%2C211\" alt=\"Rate Review Plugin Day Featured Image\" /></a></p>\n<p>Mark your calendars and schedule some free time on <strong>Friday, October 17th</strong> for the first &#8220;<strong>Rate and Review a WordPress Plugin Day</strong>&#8220;. On October 17th, visit the page of your favorite plugin in the <a title=\"https://wordpress.org/plugins/\" href=\"https://wordpress.org/plugins/\">WordPress.org plugin directory</a>, give it a star rating, and write a review.</p>\n<h2>Why The Special Day?</h2>\n<p>If you&#8217;re anything like me, you get caught up in the day-to-day activities without getting around to rating and reviewing the plugins you depend on. Some of the plugins I rely on have served me well for years, but I&#8217;ve yet to rate or review them. The only time I stop by a plugin&#8217;s page after installing it is to visit the support forum. Since disgruntled users are more vocal than those with positive experiences, this day is an excuse to share those positive experiences with the community and the plugin author.</p>\n<h2>Quick Tip</h2>\n<p>Since you can&#8217;t rate and review plugins from the backend of WordPress, here is a quick tip. Login to your WordPress.org account and navigate to the installed plugins page in the backend of WordPress. Each plugin should have a view details link that will load the plugin details modal. On the details screen, open the link to the WordPress.org Plugin Page in a new browser tab. These steps save you the trouble of manually browsing to each plugin&#8217;s page on WordPress.org.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/10/WPPluginPageNewTab.png\" rel=\"prettyphoto[31977]\"><img class=\"size-full wp-image-31978\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/10/WPPluginPageNewTab.png?resize=761%2C576\" alt=\"Open The WordPress.org Plugin Page In A New Browser Tab\" /></a>Open The WordPress.org Plugin Page In A New Browser Tab\n<h2>An Easy Way to Contribute Back to WordPress</h2>\n<p>Start with your favorite plugin. Review it based on your experience and try to write more than one-five words. As an additional courtesy, browse to the bottom of the plugin&#8217;s description page and click on the <em>broken</em> or <em>works</em> box. This helps determine which versions of the plugin are compatible with WordPress. Your ratings, reviews, and compatibility checks are indirect contributions to WordPress. It&#8217;s actionable data that millions of people will use to determine whether or not to use a plugin.</p>\n<p>One thing to keep in mind is that ratings and reviews are not set in stone. If you&#8217;d like to change the content or star ratings, find your review and scroll to the bottom of the page. From there, you&#8217;ll be able to change the text and rating.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 14 Oct 2014 16:39:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"Alex King: WordPress vs. a Roll-Your-Own Blog Engine\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"http://pinboard-9c824ddfe7946cbde24dbe9eb552eb42\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"http://alexking.org/blog/2014/10/14/do-you-need-a-new-blog-engine\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6167:\"<p>Inspired by Brent&#8217;s <a href=\"http://inessential.com/2014/10/02/need_new_blog_engine\">consideration of an off-the-shelf blog engine</a>, Santiago Valdarrama has written a post outlining <a href=\"https://blog.svpino.com/2014/10/03/do-you-need-a-new-blog-engine\">the problems he has with off-the-shelf blog engines</a>. What was so interesting to me about this was that a self-hosted WordPress site addresses nearly every one of his concerns.</p>\n<blockquote><p>\n  1) You don&#8217;t have to deal with updates to the platform. Updates and new features are nice, unless they break all the custom code you&#8217;ve developed over time.\n</p></blockquote>\n<p>WordPress has well abstracted APIs that make it easy for your custom code to live alongside the WP core code. I can&#8217;t remember the last time I needed to make a change to code I&#8217;d written for this site because of a WP core update.</p>\n<blockquote><p>\n  2) You can&#8217;t control when bugs are fixed or new features released. If there&#8217;s something missing, the only thing you can do is file a request and wait.\n</p></blockquote>\n<p>Fiddlesticks. You can <a href=\"https://make.wordpress.org/core/handbook/\">submit a patch</a>, you can hack your local copy, and you can write plugins to add any features you feel are missing.</p>\n<blockquote><p>\n  3) There&#8217;s always a learning curve. Every platform is different, specially when you want to fine tune your layout and deviate from the provided templates.\n</p></blockquote>\n<p>This one strikes me as a bit silly. There is a learning curve when building your own system too &#8211; especially if you haven&#8217;t written your layout/templating system yet.</p>\n<blockquote><p>\n  4) Sometimes there&#8217;re things you can&#8217;t do. Period. (I wanted to use a specific format to display the date of my posts but Blogger doesn&#8217;t support it. I had to settle with something else.)\n</p></blockquote>\n<p>Using a hosted service and using an off-the-shelf blog engine are <em>not</em> the same thing. Self-hosting WordPress removes all of the hosted service restrictions.</p>\n<blockquote><p>\n  5) You have to deal with features you don&#8217;t need. Comments? Related posts? Search? Templating engine? Image carousel? I don&#8217;t need these, but I&#8217;d have to pay the price anyway.\n</p></blockquote>\n<p>Just as you can customize WordPress to add features, you can also customize it to hide features. Don&#8217;t use comments? An included setting and couple of lines of CSS will make it so you never know they were there. And WordPress doesn&#8217;t include bloated features out of the box; it wisely leaves that to plugins so that you add what you want instead of removing things you don&#8217;t.</p>\n<blockquote><p>\n  6) You can always export your content (sometimes you can&#8217;t), but even when the option is right there, the exported format is so messed up that you can&#8217;t use it again without a huge clean up. (One time I got my posts exported in a text file with no formatting.)\n</p></blockquote>\n<p>Again &#8211; this is only a problem with hosted solutions. With a self-hosted WordPress site you have full access to your MySQL database, as well as the built-in export features of WordPress.</p>\n<blockquote><p>\n  7) What&#8217;s true today might change tomorrow. What you like about the platform might go away some day. They won&#8217;t ask for your opinion.\n</p></blockquote>\n<p>WordPress is Open Source. Anyone can create a fork based on their own needs and preferences.</p>\n<blockquote><p>\n  8) It will never be as fast as you want it to be. If it&#8217;s hosted, your traffic will be shared. If you host it yourself, you might never be able to fine tune it to perfection.\n</p></blockquote>\n<p>WordPress powers around 20% of the internet &#8211; you don&#8217;t grow that big if you can&#8217;t handle scale. Dedicated WordPress hosts will solve these problems for you, and installing a few simple plugins (caching, CSS and JS concatenation and optimization, etc.) will do a ton to optimize a site on an server that isn&#8217;t tuned for WordPress.</p>\n<blockquote><p>\n  9) I will never be sure what my content is being used for. I know it&#8217;s public anyway, but it&#8217;s also in somebody else&#8217;s database I don&#8217;t control.\n</p></blockquote>\n<p>Another assumption of a hosted platform. NA for a self-hosted WordPress site.</p>\n<blockquote><p>\n  10) You&#8217;ll never get to experience the satisfaction of engaging in a conversation about how you developed your own platform from scratch.\n</p></blockquote>\n<p>As someone who has hacked on WordPress and related code for the last 12 years, I find this statement absurd. There are plenty of &#8220;from scratch&#8221; opportunities within the WordPress community, even now. And if what you want is engagement then joining a bountiful and vibrant community of developers is a much bigger opportunity than the potential for a conversation with another NIH hacker.</p>\n<p>I&#8217;m not saying that there is anything wrong with building your own X. Every time you do that it&#8217;s a great learning experience. I&#8217;m saying I don&#8217;t think it is necessary to get pride of ownership.</p>\n<blockquote><p>\n  There might be something out there that offsets all my concerns, I&#8217;m not sure (but I don&#8217;t believe so.) My blog is my hobby, and I think I&#8217;d never give control again. Every single bit you see here was a labor of love, and I&#8217;m not ready to stop thinking about it that way.\n</p></blockquote>\n<p>I think a self-hosted WordPress site is really close. And I feel exactly the same about my site &#8211; it&#8217;s mine and I am in control of it. Even though I&#8217;ve released much of the code for this site as Open Source, no one else has a site that&#8217;s exactly like mine. I&#8217;ve made the decisions about how to present my content, how to distribute it to Twitter and Facebook, how to integrate with the responses on those platforms, and how I represent myself online. And I do so while building on a robust base platform that allows me to concentrate on building just the features that are unique to my site.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 14 Oct 2014 15:10:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Alex\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"WPTavern: How to Obtain The Total Download Count For Plugins Attached to a WordPress.org Username\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31955\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:107:\"http://wptavern.com/how-to-obtain-the-total-download-count-for-plugins-attached-to-a-wordpress-org-username\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3818:\"<p>Over the weekend, the <a title=\"https://easydigitaldownloads.com/\" href=\"https://easydigitaldownloads.com/\">Easy Digital Downloads</a> team launched a new side project called <a title=\"http://wptally.com/\" href=\"http://wptally.com/\">WP Tally</a>. WP Tally is a tool that displays the total download count for plugins attached to a WordPress.org username. The project is the result of a conversation about the lack of an easy way to determine the total amount of plugin downloads a WordPress.org user has.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/10/WPTallyHomePage.png\" rel=\"prettyphoto[31955]\"><img class=\"size-full wp-image-31956\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/10/WPTallyHomePage.png?resize=736%2C568\" alt=\"WP Tally Home Page\" /></a>WP Tally Home Page\n<p><a title=\"http://ghost1227.com/\" href=\"http://ghost1227.com/\">Daniel Griffiths</a>, who worked on the backend of the project, tells the Tavern, &#8220;it only took 10 minutes to come up with a name.&#8221; <a title=\"http://seandavis.co/\" href=\"http://seandavis.co/\">Sean Davis</a>, a full-time support manager and theme developer for EDD, is credited with the name. The founder of Easy Digital Downloads, <a title=\"https://pippinsplugins.com/\" href=\"https://pippinsplugins.com/\">Pippin Williamson</a>, asked Griffiths if he was interested in creating a new plugin, &#8220;I&#8217;m always looking for a new pet project, so I happily agreed.&#8221; The first version of WP Tally took about an hour and a half of development time. Due to other things going on throughout the day, the estimated time to complete the project is half a day.</p>\n<h2>The WP Tally API</h2>\n<p>While the site didn&#8217;t have an <a title=\"http://wptally.com/api-docs/\" href=\"http://wptally.com/api-docs/\">API initially</a>, one was added after being suggested by Williamson. Griffiths says the API is public and passes the same data that is displayed on WP Tally. While the extent of what the API can do is small, the team is open to suggestions. &#8220;We&#8217;ve already had someone express interest in writing a widget to allow users to display their personal data on their own website.&#8221;</p>\n<h2>WP Tally in Action</h2>\n<p>Since Scott Reilly known as <a title=\"https://profiles.wordpress.org/coffee2code/\" href=\"https://profiles.wordpress.org/coffee2code/\">Coffee2Code</a> on WordPress.org, has 70 plugins attached to his account, I used his name as an example. According to WP Tally, he has <a title=\"http://wptally.com/?wpusername=Coffee2Code\" href=\"http://wptally.com/?wpusername=Coffee2Code\">911, 256 total downloads</a>. Meanwhile, <a title=\"https://profiles.wordpress.org/joostdevalk/\" href=\"https://profiles.wordpress.org/joostdevalk/\">Joost de Valk</a> has a total of <a title=\"http://wptally.com/?wpusername=joostdevalk\" href=\"http://wptally.com/?wpusername=joostdevalk\">22.3 million downloads</a> from 29 different plugins. Results are displayed in a vertical list without a way to sort them.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/Coffer2CodeTotalPluginDownloads.png\" rel=\"prettyphoto[31955]\"><img class=\"size-full wp-image-31958\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/Coffer2CodeTotalPluginDownloads.png?resize=723%2C405\" alt=\"Coffee2Code Total Download Count\" /></a>Coffee2Code Total Download Count\n<p>It would be nice to be able to sort through the list by the most downloads, most popular based on ratings, and alphabetical order. I&#8217;d also like to see the total number of plugins displayed in the same area as the total download count. As an added bonus, it would be neat if the information could be embedded into a text widget as a badge.</p>\n<p>What do you think of the site and is there anything else you&#8217;d like to see it tally?</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 14 Oct 2014 01:21:04 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:10;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"Lorelle on WP: Youre Invited: Vancouver WordPress Social Meetup October 19\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"http://lorelle.wordpress.com/?p=11966\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"http://lorelle.wordpress.com/2014/10/13/youre-invited-vancouver-wordpress-social-meetup-october-19/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:504:\"The last WordPress Social Meetup in Vancouver, Washington, was such a success, we&#8217;re going forward with these monthly meetings. Vancouver, Washington, is just a few minutes from downtown Portland, and our next meeting is this Sunday, October 19, from 4-7PM. Please arrive by 4:15PM to be allowed into the building. It is normally closed on [&#8230;]<img alt=\"\" border=\"0\" src=\"http://pixel.wp.com/b.gif?host=lorelle.wordpress.com&blog=72&post=11966&subd=lorelle&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 14 Oct 2014 00:30:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Lorelle VanFossen\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:11;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"WPTavern: Troubleshooting Handbook For New WordPress Support Forum Volunteers Is Live\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31953\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"http://wptavern.com/troubleshooting-handbook-for-new-wordpress-support-forum-volunteers-is-live\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5370:\"<p>Providing WordPress support is an important but often, thankless job. From <a title=\"https://wordpress.org/support/\" href=\"https://wordpress.org/support/\">support forums</a> to <a title=\"https://make.wordpress.org/support/handbook/other-support-locations/introduction-to-irc/\" href=\"https://make.wordpress.org/support/handbook/other-support-locations/introduction-to-irc/\">IRC</a>, there&#8217;s no shortage of people who need help with WordPress. However, participating in the various support channels is one of the easiest ways to contribute back to WordPress. In particular, if you&#8217;re interested in becoming a volunteer on the support forums, there&#8217;s a new guide available that walks you through the process.</p>\n<p>It&#8217;s called the <a title=\"https://make.wordpress.org/support/trouble/\" href=\"https://make.wordpress.org/support/trouble/\">Troubleshooting Handbook</a>. It explains how the forum works and teaches volunteers how to troubleshoot common WordPress issues they&#8217;re likely to see in the forum. In the second section of the handbook, there are several items known as <a title=\"https://make.wordpress.org/support/trouble/section-2-breakfix-lessons/\" href=\"https://make.wordpress.org/support/trouble/section-2-breakfix-lessons/\">Break/Fix lessons</a>. Break/Fix is meant to be a hands-on guide to troubleshooting broken WordPress sites. Each lesson represents a common problem you may come across when helping others in the WordPress.org support forums.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/TroubleShootingHandbookHomePage.png\" rel=\"prettyphoto[31953]\"><img class=\"size-full wp-image-31964\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/TroubleShootingHandbookHomePage.png?resize=753%2C578\" alt=\"Troubleshooting Handbook Home Page\" /></a>Troubleshooting Handbook Home Page\n<h2>How to Contribute</h2>\n<p>For the past several months, volunteers have been working hard to get the handbook in tip-top shape. On <a title=\"https://make.wordpress.org/support/2014/10/support-team-update-for-october-2nd/\" href=\"https://make.wordpress.org/support/2014/10/support-team-update-for-october-2nd/\">October 2nd</a>, the project reached a point where it was ready for public viewing. Since it&#8217;s still a work in progress, I asked <a title=\"http://macmanx.com/\" href=\"http://macmanx.com/\">James Huff</a>, a member of the support team, how others can contribute. &#8220;At the moment, contributing to the handbook is limited. If you see anything that needs to be changed, please leave a comment at the bottom of the page with the problem.&#8221;</p>\n<h2>The Potential Merge of Handbooks</h2>\n<p>The <a title=\"https://make.wordpress.org/support/handbook/\" href=\"https://make.wordpress.org/support/handbook/\">Support Handbook</a> is a secondary project used primarily by forum moderators. Since moderators make up a small portion of the people who provide support, the initial plan is to merge the Troubleshooting handbook into the Support Handbook. Then, replace or combine the sections that overlap and relegate the moderator-only resources to a small Moderators Only section. Much of the work is planned to happen at the <a title=\"http://2014.sf.wordcamp.org/schedule/contributor-team-meetups/\" href=\"http://2014.sf.wordcamp.org/schedule/contributor-team-meetups/\">WordPress Contributor Team Meetup</a> during <a title=\"http://2014.sf.wordcamp.org/\" href=\"http://2014.sf.wordcamp.org/\">WordCamp San Francisco 2014. </a></p>\n<p>&nbsp;</p>\n<h2>Solid Foundation For New Support Volunteers</h2>\n<p>The Troubleshooting Handbook is a welcome addition to both moderators and volunteers. While attending a WordCamp contributor day last year, I along with a few others sat in a group and plowed through several threads on the support forum. <a title=\"http://halfelf.org/\" href=\"http://halfelf.org/\">Mika Epstein</a>, who contributes a lot of her time to the WordPress support forums, guided us along the way. If it were not for her guidance, we may have ended up causing more problems than solving them.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/TroubleShootingHandbookFeaturedImage.png\" rel=\"prettyphoto[31953]\"><img class=\"size-full wp-image-31966\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/TroubleShootingHandbookFeaturedImage.png?resize=638%2C411\" alt=\"TroubleShootingHandbookFeaturedImage\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/pinkpurse/5282398538/\">pinkpurse</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nc-nd/2.0/\">cc</a>\n<p>Providing support on WordPress.org is an intimidating experience. It seems like new threads are created every second. I made a few mistakes by not having a set of canned responses or knowing how to handle certain question in the forums. By having this information in an easy to read format, new volunteers should have an easier time providing support without feeling like they&#8217;re doing something wrong.</p>\n<p>If you want to contribute back to WordPress by providing support, I encourage you to read through the <a title=\"https://make.wordpress.org/support/trouble/\" href=\"https://make.wordpress.org/support/trouble/\">Troubleshooting Handbook</a>. Not only is it information you can use, it&#8217;s also a helpful guide for employees who provide customer support through forums.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 14 Oct 2014 00:27:04 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:12;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"Matt: New Yorker on WP\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44251\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"http://ma.tt/2014/10/new-yorker-on-wp-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1029:\"<blockquote><p>With the relaunch, <a href=\"http://newyorker.com/\">NewYorker.com</a> runs on WordPress, a more robust, user-friendly CMS. &#8220;We&#8217;re looking at almost total upside there,&#8221; Thompson tells me. Because the tools are no longer getting in the way of producers doing their job, NewYorker.com is now able to publish a greater volume of stories every day. The site used to top out at 10 or 12 stories each day: now, it publishes around 20 per day. &#8220;It&#8217;s a lot easier to be productive now, and we can now make the site fresh a lot more quickly than we used to,&#8221; says Thompson.</p></blockquote>\n<p><a href=\"http://www.fastcodesign.com/3035381/how-the-new-yorker-finally-figured-out-the-internet-3-lessons-from-its-web-redesign\">How The New Yorker Finally Figured Out The Internetin Fast Company</a>. Still my favorite magazine in the world. Also the reason I started spending more time in New York.<cite>Hat tip: <a href=\"http://kellychoffman.wordpress.com/\">Kelly Hoffman</a>.</cite></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 13 Oct 2014 20:27:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:13;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"Matt: Beats Studio Wireless vs Samsung Level Over\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44275\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"http://ma.tt/2014/10/beats-studio-wireless-vs-samsung-level-over/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7474:\"<p>I listen to music pretty much constantly, and it&#8217;s not unusual to see me on the road with just a carry-on and still have 3 or 4 headphones on me that I&#8217;m testing.</p>\n<p>First off, Bluetooth changes everything. It&#8217;s so nice to not ever worry about cables, or even proximity for the most part, like having your phone charging by the laptop and still able to walk around the room. Audio quality is great now, only downside is having to charge something, but they&#8217;re all pretty good about battery now.</p>\n<p>I&#8217;ve been enjoying a category I&#8217;ll call: Bluetooth, over ear headphones that let people know not to bother you, that you feel kind of cool wearing, that are great for planes, and cost around $300-400. The pioneer in this category is Beats, and I bought a pair of their Studio Wireless (in <a href=\"http://www.beatsbydre.com/headphones/studio-wireless/titanium/900-00199-01.html\" title=\"Like a bosse.\">matte titanium</a>, natch) after <a href=\"http://techcrunch.com/2014/05/28/apple-buys-beats-electronics-for-3b/\" title=\"Apple has made a series of interesting buys and hires this year.\">Apple bought them</a>because I wanted to see what the fuss is about. More recently I got some horribly named but well-reviewed <a href=\"http://www.samsung.com/us/mobile/cell-phones-accessories/EO-AG900BWESTA\" title=\"Oh, Samsung.\">Samsung Level Overs</a>, so this is a comparison of those two. (Another contender in this category would bethe <a href=\"http://www.parrot.com/zik/usa/\" title=\"I wanted to love these.\">Parrot Zik ones</a>, but just skip those. Great idea, annoying in practice.)</p>\n<p><img class=\"alignleft wp-image-44276\" src=\"http://i0.wp.com/ma.tt/files/2014/10/overear-studio-wireless-titanium-standard-thrqrtleft-O.png?resize=256%2C298\" alt=\"Beats Studio Wireless\" />Let me start with how the Beats are better: they fold up, look cool, sound pretty decent on calls, and everything works nicely with the iPhone. For me they have two fatal flaws: comfort and noise. The earcups are kind of small, or my ears are kind of huge; whichever it is, sometimes after wearing them for a few hours my left ear starts to become quite sore. Second is they have active noise cancellation (ANC) that causes what can only be described as a constant hiss you can hear both while music is playing and while it&#8217;s off, it&#8217;s like like noise addition rather than noise cancellation. The fit and finish of the Beats are nice, as well as the accessories like cables, how it indicates how much power is left, et cetera.</p>\n<p><img class=\"alignright  wp-image-44277\" src=\"http://i1.wp.com/ma.tt/files/2014/10/71joq-txpaL._SL1500_.jpg?resize=272%2C360\" alt=\"Samsung LEVEL over\" />The <a href=\"http://www.amazon.com/dp/B00KGGK738/\" title=\"Reviews on Amazon are pretty good too.\">LEVEL overs</a> (wow that&#8217;s awkward to write) are big, and they don&#8217;t fold, but they float around in my backpack pretty much the same as the Beats, especially if you don&#8217;t usethe included case. The battery seems to go forever. The ANC can be turned on and off (battery goes longer with it off), and when it&#8217;s on it&#8217;s <em>good</em>, like miss-the-announcement-for-your-flight good. For me this is the deal-maker &#8212; I didn&#8217;t realize what I was missing with mediocre ANC before on the Beats, I&#8217;m now able to concentrate and relax much better on planes. I&#8217;ve flown every third day in the past month, so this is a big deal to me. They also feel like they&#8217;re better made &#8212; less plastic feeling than the Beats. The have a <a href=\"http://ecx.images-amazon.com/images/I/316Rt2g8EEL.jpg\" title=\"Pretty intuitive.\">touch gesture control</a> on the right cup like on theZik, but it actually works well. The cups fit completely over my ears and in general it feels more comfortable on my head, I can wear it for hours at a time and it&#8217;s totally comfortable. I don&#8217;t think they look as cool, but that&#8217;s probably because I haven&#8217;t been conditioned with pictures of my favorite musicians and athletes wearing them. (<a href=\"http://recode.net/2014/10/04/nfl-bans-beats-headphones-on-camera/\" title=\"Why is the NFL a non-profit, again?\">Though not in football anymore</a>.)</p>\n<p>Main downsides: the cable it comes with doesn&#8217;t &#8220;work&#8221; with an iPhone or Mac as a mic or control device, and is also clunky. (Bluetooth control works fine.) This is apparently because <a href=\"http://shaddack.twibright.com/projects/reveng_RemoteControlHeadphones/\">the remote control resistor on Apple-targeted cables</a> work <a href=\"http://www.androidcentral.com/head-headphones-samsung-level-over-vs-beats-studio-wireless\">differently from everyone else&#8217;s</a>, which I think we can all agree in 2014 is ridiculous for both sides. My fix for this was to use the cable from the Beats, which you <a href=\"http://www.amazon.com/dp/B00ILV7VGG/\" title=\"This one might be not-real, but look around.\">can also buy online</a>, which looks cooler, is smaller, and works great with my Mac for G+ Hangouts and Skype calls. Perhaps related to this is when the Beats or many other Bluetooth headsets I&#8217;ve used are connected to the iPhone there&#8217;s a battery indicator and the Samsung doesn&#8217;t support this, but since the battery life is so good I don&#8217;t worry about this too much.</p>\n<p><strong><img class=\" wp-image-44278 alignleft\" src=\"http://i0.wp.com/ma.tt/files/2014/10/720311395_5520467755400174836.jpg?resize=190%2C190\" alt=\"Matt with Samsungs\" />Too long; skipped to the end:</strong> The Samsung sounds better, ismore comfortable, and isbetter made. Try itout if you&#8217;re considering buying headphones in this category. I don&#8217;t expect this to be a long-term advantage because I&#8217;m fairly certain Apple will do amazing things with Beats in the future, even if that just means a lightning connector, but I&#8217;m guessing that&#8217;s a 2015 thing.</p>\n<p><strong>Extra credit:</strong> What headphones do I use inother categories? (An update to <a href=\"http://ma.tt/2009/07/headphone-recommendations/\" title=\"Oldie but goodie.\">my 2009 post</a>.) For in-ear wired I use <a href=\"http://pro.ultimateears.com/en-us/home/18-Pro\" title=\"Best sound, best comfort, but my ears get waxy when I wear them too much.\">Ultimate Ears 18 Pro Custom</a> molded to my ears, but I also recommend <a href=\"http://www.amazon.com/dp/B003WV391Q/\" title=\"This is the one with the remote mic, the newer 80s don\'t, for no good reason.\">Sennheiser IE 8i</a> for friends who don&#8217;t want to go to audiologist, for running/exercise or when being discreet like on a subway I use the<a href=\"http://www.amazon.com/dp/B00DIOAM4Y/\" title=\"Been putting a lot of miles on these.\">Plantronics BackBeat GO 2 with charging case</a>, at home I like <a href=\"http://www.audeze.com/products/headphones/lcd-3\" title=\"Indefensible.\">the Auduze LCD3</a>usually with a <a href=\"http://redwineaudio.com/\" title=\"Cavier on the kobe.\">Red Wine Audio</a> amp. I agree with many of the assessments in <a href=\"http://www.marco.org/headphones-closed-portable\" title=\"I love how obsessed Marco gets.\">Marco Arment&#8217;s mega-review</a>, and I got turned on to the Samsung&#8217;s by <a href=\"http://thewirecutter.com/reviews/best-noise-cancelling-headphones/\" title=\"For the record, I was an OG Wirecutter supporter.\">Wirecutter&#8217;s noise cancelling review</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 12 Oct 2014 17:15:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:14;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Matt: Oculus\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44265\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://ma.tt/2014/10/oculus/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:767:\"<p><a href=\"http://i2.wp.com/ma.tt/files/2014/10/oculus.jpg\"><img class=\"alignright wp-image-44268\" src=\"http://i2.wp.com/ma.tt/files/2014/10/oculus.jpg?resize=206%2C238\" alt=\"\" /></a> I got a chance to try the <a href=\"http://www.oculus.com/dk2/\">Oculus Rift Development Kit 2 (DK2)</a> the other day, specifically <a href=\"http://www.roadtovr.com/sightline-the-chair-oculus-rift-dk2-vr-reference-demo/\">Sightline: The Chair</a>. I&#8217;m not sure what to say except it was magical. I don&#8217;t think it replaces screens, but Oculus-style VR is definitely the future of entertainment. Thanks to (the <a href=\"http://www.ea.com/news/a-goodbye-to-john-vechey\">newly retired</a>) <a href=\"http://johnvechey.wordpress.com/\">John Vechey</a> for sharing it with me.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 11 Oct 2014 21:02:01 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:15;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"Jen Mylo: Site Setup Journal: Act II\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"http://jenmylo.com/?p=4587\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"http://jenmylo.com/2014/10/11/site-setup-journal-act-ii/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:17922:\"<h2>Act II:Setting Up WordPress</h2>\n<p><em>Previously in Site Setup Journal: <a href=\"http://jenmylo.com/2014/10/05/site-setup-journal-prologue/\">Prologue</a>and<a href=\"http://jenmylo.com/2014/10/11/site-setup-journal-act-i/%20\">Act I: Domains and Hosting</a>.</em></p>\n<h3>One-Click Install Attempts</h3>\n<p>1-click installs are totally the way to go, right? I mean, 1-click sounds faster and easier than <em>the famous 5-minute install</em> that you get if you do it manually over FTP (according to the Codex). I immediately gointo the Dreamhost control panel and went for a 1-click.</p>\n<p><img class=\"aligncenter size-full wp-image-4584\" src=\"https://jenmylo.files.wordpress.com/2014/10/screen-shot-2014-10-05-at-6-36-55-am.png?w=520&h=132\" alt=\"Screen shot 2014-10-05 at 6.36.55 AM\" width=\"520\" height=\"132\" /></p>\n<p>Okay, so 1-click, but 10 minutes. That doesn&#8217;t seem right, that it should take twice as long for the automated 1-click install as for a manual one. Well, too late now, right? Guess I&#8217;ll go feed the cats while I wait.</p>\n<p>I have to kill a little more time than just feeding the cats, but eventually I get an email from Dreamhost telling me my WordPress install is ready for me, and linking me to install.php to set up an admin user and get going. I click the link and get a white screen. Hm. Try again. Hm. Open up FTP to see if the files are there, and they are. Start wondering if maybe 1-clicks can&#8217;t handle being in a subdirectory (where I&#8217;d put it), so think I&#8217;ll try another one in the root. Same thing, the 10-minute notice.Set up web email for the domain and send a test email so I can see if it&#8217;s just the website, or if it&#8217;s everything on the domain. Webmail is also whitescreened. Hm. Status on Dreamhost says my server is going to be getting some software updates and will be offline during this maintenance, but it doesn&#8217;t look like I&#8217;m in that time window. I get a 2nd automated email saying the 2nd 1-click has failed. I head into the support section.</p>\n<p>The Live Chat support option shows as available, but when I click it it says that due to heavy activity there willbe a 5-hour wait. Come on, just take down the Live Chat option when it&#8217;s 4am and you don&#8217;t have people on staff. I send an email, then another (first one re white screen, 2nd re install failure). In the meantime I startscrubbing through the Dreamhost support wiki.</p>\n<p>I find the answer to the 2nd install failure before support gets back to me. Apparently, 1-clicks don&#8217;t work if there is anything in there already. So since I already have a subfolder in the root domain (from the 1st 1-click), trying to do a 1-click into the root won&#8217;t work. I have to empty it out first. That doesn&#8217;t make sense to me, but whatever. I wind up deleting everything via FTP and doing a manual install instead. Two, actually.</p>\n<h3>Manual Install</h3>\n<p>Well, then, back to the WordPress.org!</p>\n<p><img class=\"aligncenter size-full wp-image-4589\" src=\"https://jenmylo.files.wordpress.com/2014/10/screen-shot-2014-10-11-at-8-04-50-am.png?w=520&h=185\" alt=\"Screen shot 2014-10-11 at 8.04.50 AM\" width=\"520\" height=\"185\" /></p>\n<p>The &#8220;handy guide&#8221; is the Codex&#8217;s installation instructions page. Let&#8217;s take a look.</p>\n<h4>Before You Start</h4>\n<p><img class=\"aligncenter size-full wp-image-4591\" src=\"https://jenmylo.files.wordpress.com/2014/10/screen-shot-2014-10-11-at-8-22-15-am.png?w=520&h=212\" alt=\"Screen shot 2014-10-11 at 8.22.15 AM\" width=\"520\" height=\"212\" /></p>\n<p><strong>1. Minimum server requirements</strong>. As it happens, I had checked the php versionstuff when I re-upped the hosting account for this domain, and had upped the version of PHP. Someone setting things up without my account gymnastics wouldn&#8217;t have encountered that, though, so I set out to find my hosting versions as specified in the ask-for-it text on the requirements page on wordpress.org:</p>\n<ul>\n<li>PHP 5.2.4 or greater</li>\n<li>MySQL 5.0 or greater</li>\n<li>The mod_rewrite Apache module</li>\n</ul>\n<p>I log into the Dreamhost control panel. I look for a navigation label that says something like hosting environment, version information, about, etc. Don&#8217;t see anything. Click into <em>Manage Account</em>, nothing. Click into <em>Manage Domains</em>. Oh ho!</p>\n<p><img class=\"aligncenter size-full wp-image-4592\" src=\"https://jenmylo.files.wordpress.com/2014/10/screen-shot-2014-10-11-at-8-28-41-am.png?w=520\" alt=\"Screen shot 2014-10-11 at 8.28.41 AM\" /></p>\n<p>Clearly I&#8217;d only upped the version on the one domain, not both on that account, but even so, I can see that the php versions are both above the minimum requirement to run WordPress.</p>\n<p>Next up, MySQL version. Clicking the <em>MySQL Databases</em> navigation item seems the most likely, so I do. Nope. No information shown here about MySQL versions. You&#8217;d really think you would see that on the page labeled MySQL Databases, wouldn&#8217;t you? There is a link on that screen to <em>phpMyAdmin</em>, so maybe I can find it there. Wait &#8212; Authentication Required!</p>\n<p><img class=\"aligncenter size-full wp-image-4593\" src=\"https://jenmylo.files.wordpress.com/2014/10/screen-shot-2014-10-11-at-8-39-09-am.png?w=520\" alt=\"Screen shot 2014-10-11 at 8.39.09 AM\" /></p>\n<p>Bah, which username and password combination does it want? The hosting account (server?) or a database user? A note here saying which password is needed would be helpful. I can&#8217;t get in with the ones I know off the top of my head so I close out of that and goback to the main Dreamhost control panel (the phpMyAdmin attempt had bumped me into a new tab). In the search box at the top, I type &#8220;MySQL version&#8221; and hit enter. The page refreshes, but I&#8217;m still on the MySQL Databases page where there is no version info displayed. I thinkmaybe there&#8217;s somedocumentation with version info, so I look for support.</p>\n<p>Now, having been around a long time, I know that Wiki, a small link in the upper rightcorner, means documentation. But a lot of people don&#8217;t (I doubt my mom &#8212; the most recent person to ask me to set up a site &#8212; would), so for the sake of the experiment I golooking for a Help or Docs or Support link. I find it (Support) in the bottom left navigation after scrolling down (below the fold), because for some reason the &#8220;Goodies&#8221; navigation section is open. Why? Because apparently that&#8217;s where the MySQL Databases page actually lives, despite being in the navigation up above as a top-level item. Come on, Dreamhost, who&#8217;s your information architect, and what are they doing?</p>\n<p>Anyway, I click on Support. It drops a layer with 3 options. Contact, History, and Data Centers. Why not have a link here for Wiki (or better, Documentation, which is less jargony)? Hmph. If you do click on Contact Support, it takes you into a form. There&#8217;s a live chat button, but no links here to documentation either. Hm, what&#8217;s this &#8220;Help is Off&#8221; button?</p>\n<p><img class=\"aligncenter size-full wp-image-4594\" src=\"https://jenmylo.files.wordpress.com/2014/10/screen-shot-2014-10-11-at-8-48-09-am.png?w=520&h=167\" alt=\"Screen shot 2014-10-11 at 8.48.09 AM\" width=\"520\" height=\"167\" /></p>\n<p>I decide to click it. Then I see this:</p>\n<p><img class=\"aligncenter size-full wp-image-4595\" src=\"https://jenmylo.files.wordpress.com/2014/10/screen-shot-2014-10-11-at-8-48-47-am.png?w=520&h=169\" alt=\"Screen shot 2014-10-11 at 8.48.47 AM\" width=\"520\" height=\"169\" /></p>\n<p>Oh, how handy, a link to documentation and forums. Why it&#8217;s even optional to hide that textis ridiculous. Anyway, to the wiki!</p>\n<p>On the Wiki Home there is a nice little menu, and MySQL is listed there, so I click it. I come to another list of topics. None of them say Version, so I start clicking them in the order that makes the most sense. <em>MySQL and</em> PHP does not have version info. Neither does<em>phpMyAdmin</em>, but it does tell me that the authentication password request was for the database user password. <em>Upgrading from MySQL 4.1 to 5.0</em>tells me that, &#8220;DreamHost is currently slowly upgrading your MySQL servers from version 4.1 to 5.0. You can also email support and request they upgrade your databases. There are some incompatibilities between versions 4.1 and 5.0, particularly with JOINs. This upgrade could cause some breakage of your application(s).&#8221; It does not say how to tell which version you are currently on. At this point, some people might email support, but I think a lot would just shrug and decide to take a chance and hope they were already on 5.0. So I do that. Because let&#8217;s face it, any host that is listed on wordpress.org/hosting had better be running the minimum requirements, right?</p>\n<p>Mod_rewrite! Since I&#8217;m already in the wiki, I do a search for &#8220;mod_rewrite Apache module,&#8221; the last item in the &#8216;email your host&#8221; list. The 4 search results are not helpful in any way. I remove &#8220;Apache module&#8221; from the search term and try again. Lots of results, none of them helpful. I decide again to shrug and assume, because this documentation is for the birds when it comes to confirming minimum requirements, and who has time to wait for support emails? Not me!</p>\n<p>Around now I get an email from support about my earlier white screen issue. They say that it&#8217;s because the DNS hasn&#8217;t finished replicating. I might add that there&#8217;s a &#8220;works for me&#8221; comment in there that makes me purse my lips. But I stop to think about DNS. Yes, in the past I&#8217;ve had to set up a temp site on a dreamhosters subdomain if I wanted to work on a site before DNS caught up. Pain in the ass, yeah? Having to then do a move once the real domain is showing up? I hadn&#8217;t thought about that this time because the GoDaddy registration of the domain had been pointing at Dreamhost servers all along. I guess the hosting being down and then up created aDNS interruption. It was not explained to me satisfactorily, but I move on. Specifically, to step 2 of preparing for the install.</p>\n<p><strong>Step 2. Download the latest release of WP.</strong>Easy. Go to wordpress.org, click the big Download button. Oh, okay. That wasn&#8217;t really a download button, that was a navigation link to a download page. Okay. I skim the content in the middle and go to click on the&#8230; oh, that button at the bottom of the content area is to find a mobile app, and goes to a site at get.wp.com. That&#8217;s not right. Oh, there&#8217;s the real download button up in the sidebar. It seems like those should have been switched, but whatever. Click! Download! 6.3MB, it takes7seconds.</p>\n<p><strong>Step 3. Unzip the file.</strong>Also easy. Do <em>Show in Finder</em> from the download bar on the bottom of my browser, double click the file, see the <em>wordpress</em> folder appear. 3 seconds.</p>\n<p><strong>Step 4. Secure password for secret key. </strong>Click on the link to read about it. Get distracted by the big-ass blue-i information icon alert at the top that says, &#8220;Interested in functions, hooks, classes, or methods? Check out the new <a class=\"external text\" title=\"http://developer.wordpress.org/reference\" href=\"http://developer.wordpress.org/reference\">WordPress Code Reference</a>!&#8221; Why is that following me around on every page of the Codex? For someone installing WordPress for the first time, that is not helpful. At all. Further, there&#8217;s no<em>x</em> to dismiss the box, so if I&#8217;m not interested, I still have to scrollpast it every time, and it pushes the content farther down on the page, not to mention making me feel like I&#8217;m probably not in the right place because they obviously think I am way technical. (Tangent: People keep saying that the fold is dead, but I think they are wrong.) Anyway, I&#8217;m already confused. I clicked on a link that said <em>Secure password for secret key,</em>but I don&#8217;t see that language on this page. It doesn&#8217;t anchor link me to the specific section I needed, so I guess I have to read this whole page? With multiple mentions of passwords but no headlines that say secret key? I command+f to do a search for text on the page, which shows that &#8220;secret key&#8221; is mentioned in the section titled <em>Security Keys</em>. Hmph. Would a little consistency here be so much to ask?</p>\n<p>Read the section. Questions that should be answered in this section<strong>before</strong> jumping into the history of adding stuff.</p>\n<ul>\n<li>What is a key?</li>\n<li>What is a salt?</li>\n</ul>\n<p>Then it shows what secret keys look like from the online generator. Cool, I like online generators. But the wording all over is inconsistent and confusing &#8212; is it one secret key, or four, or eight?Andwhere do I set a secure password for the key (or keys)? I don&#8217;t understand this! So! Many! Words! Used! Indiscriminately!</p>\n<p>I cheat and use the fact that I know what all that confusing language means, and what it wants, which is simply the block of generated keys and salts, not a password for them.</p>\n<p><strong>Step 5. Print this page.</strong>So I have it handy during installation? I&#8217;m thinking this list was written in the days before browser tabs, because why would I print it when I can just keep a tab open? Silly directions. But! On to the actual install!</p>\n<h4>Famous 5-Minute Install</h4>\n<p>That sure was a lot to do before doing the install, but I&#8217;m ready now!</p>\n<p><img class=\"aligncenter size-full wp-image-4590\" src=\"https://jenmylo.files.wordpress.com/2014/10/screen-shot-2014-10-11-at-8-06-30-am.png?w=520&h=381\" alt=\"Screen shot 2014-10-11 at 8.06.30 AM\" width=\"520\" height=\"381\" /></p>\n<p><strong>Download and unzip &#8212; check.</strong> This step, which was 2 of the steps in the <em>Before You Install</em> list,took under a minute total, about 20% of a 5-minute install.</p>\n<p><strong>Create a database and a MySQL user &#8212; check.</strong> This takes a couple of minutes. I have to log in to the hosting panel, locate <em>MySQL Databases</em> in the menu, and scan the resulting page to orient myself. The first thing on the page is creating a new hostname, and the WP instructions didn&#8217;t say anything about creating a new hostname. Below that is create a database, which has fields to create the first user at the same time. There&#8217;s no instruction on the difference between a database user, an ftp user, and an account user. I goahead and made new host, db, and user (and while I&#8217;m in there I delete the databases left from the aborted 1-clicks), but I think it would intimidate someone who hadn&#8217;t done it before and didn&#8217;t really know what a database was in relation to a hosting account or a website. This takes me aminute or two, but would probably take someone who&#8217;d never done something like this a little longer, maybe up to 5 while they tried to grok the setup page on the host panel.</p>\n<p><strong>Edit wp-config.php &#8212; check. </strong>This step is labeled optional, but I&#8217;m not sure why. If you click the <em>Editing wp-config.php</em> link, it says WP will create the config file for you from info you enter, and that turningwp-config-sample.php into a real wp-config.php file is for advanced users. If it works fine to have it be auto-generated, then why have this step in there at all? If it&#8217;s really better to do it manually, then why have the auto-create version? In any case, I&#8217;m used to editing the config file at this step, so I do it. Takes a couple of minutes because I had to go back and forth between tabs and copy/paste stuff. I happen to have Coda installed so the file opened in that program, but normally I&#8217;d have used textedit.</p>\n<p>At this point I&#8217;ve passed 5 minutes.</p>\n<p><strong>Upload files via FTP &#8212; check. </strong>I open Transmit and start the transfer. It takes<strong>twelve</strong> minutes. Why? My first guess is that it is shipping with 3 default themes now, all with retina-ready images. But I don&#8217;t know, I could be wrong. I know I don&#8217;t need all those themes, so I delete Twenty Fourteen and Twenty Thirteen while I&#8217;m in FTP, and plan to start out with Twenty Twelve.</p>\n<blockquote><p>Tangent: Why do I want to start with Twenty Twelve? I think Twenty Thirteen is really aimed at bloggers and it has an overwhelming brand/design to it. The site I&#8217;m making is for a class, and needs to be chill. Twenty Fourteen I just personally don&#8217;t like, for the same reasons I don&#8217;t like the general mp6 coloring/style, which I&#8217;ve posted about elsewhere before.</p></blockquote>\n<p><strong>Run the script at the URL where you installed &#8212; screeech!</strong>Screech to a halt here, because I wind up on another white screen. Side note: the wordpress.org instructions say to go right to the root URL, not to install.php directly (like the 1-click email tells you). Are they two different locations? Does install.php automatically load at root? Bah.</p>\n<p>I goahead and do a second manual install, so now I have one in root and one in a subdirectory. White screens on both.So it seems that the DNS stuff is really going to hold things up. I decide to go to school and finish it off when I get home that night.</p>\n<h4>INTERMISSION</h4>\n<p>Stay tuned for the exciting conclusion in Act III, which will cover finishing the WP install, installing BuddyPress and other plugins, and setting up BuddyPress.</p>\n<p>&nbsp;</p><img alt=\"\" border=\"0\" src=\"http://pixel.wp.com/b.gif?host=jenmylo.com&blog=45389656&post=4587&subd=jenmylo&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 11 Oct 2014 20:04:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Jen Mylo\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:16;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"WPTavern: HostingReviews.io  Webhosting Reviews Without The Affiliate Links\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31873\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"http://wptavern.com/hostingreviews-io-webhosting-reviews-without-the-affliate-links\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3738:\"<p>How many times have you found reviews of webhosting companies only to discover they&#8217;re filled with affiliate links? The presence of an affiliate link leaves the validity of content in question. <a title=\"http://hostingreviews.io/\" href=\"http://hostingreviews.io/\">HostingReviews.io</a> by Steven Gliebe, hopes to solve this problem by documenting micro reviews without any affiliate links attached.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/FarAboveAverage.png\" rel=\"prettyphoto[31873]\"><img class=\"size-full wp-image-31926\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/FarAboveAverage.png?resize=778%2C397\" alt=\"The Far Above Average Hosts Per Customer Reviews\" /></a>The Far Above Average Hosts Per Customer Reviews\n<p>HostingReviews.io works by documenting what people say about their webhosting provider on social media sites such as Twitter. These micro reviews are stored in a queue that Gliebe and his helpers process. Tweets that clearly express happiness or dissatisfaction are marked as such.</p>\n<h2>The Technical Details</h2>\n<p>Gliebe collects tweets matching certain keywords into a database using Twitter&#8217;s stream API. There are keywords setup to cover each host as best as possible. For example, Site Ground, SiteGround, and @siteground. This process means there is nothing special people have to do other than mention their host.</p>\n<p>It is not really a submissions site where someone can say &#8220;I want what I say to be there&#8221; which can be abused. Gliebe describes the process being similar to a researcher taking a sample large enough to draw conclusions from. &#8220;I want to cover a lot of hosts eventually and that would be expensive to human-process so again that means not everything will be included, but whatever is excluded, will always be done so across the board at random as not to unfairly affect scoring.&#8221;</p>\n<p>&#8220;Some people have asked me to add specific tweets. I decided not to do that because it will skew results (ie. someone submits only good or only bad ones for specific hosts). I&#8217;m sticking with the data Twitter themselves automatically roll in 24/7.&#8221;</p>\n<p>If the user&#8217;s statement is in regard to a specific aspect of hosting (support, uptime, etc.), that is noted too. The micro-reviews and the data derived from them are presented on the site. Since users are more likely to Tweet dissatisfaction with their webhost, the overall scores are low. Gliebe notes that comparison is key.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/10/FlyWheelHostingReviews.png\" rel=\"prettyphoto[31873]\"><img class=\"size-full wp-image-31927\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/10/FlyWheelHostingReviews.png?resize=1025%2C635\" alt=\"FlyWheel Reviews With Pretty Charts\" /></a>FlyWheel Reviews With Pretty Charts\n<p>The site is relatively new so there isn&#8217;t a lot of data to work with but what I&#8217;ve seen so far matches what I&#8217;ve noticed in my Twitter feed. Flywheel leading the pack doesn&#8217;t surprise me as I&#8217;m consistently reading tweets raving about their service and support.</p>\n<p>In the past few months, there&#8217;s been more positive tweets about Pagely than I can remember. So being the number two webhosting company on HostingReviews matches what I&#8217;ve seen.</p>\n<p>The site is a great resource as long as it keeps its promise of not using affiliate links. While 140 character tweets leave out a lot of context, I still think they have value. If you&#8217;re looking for webhosting reviews without an agenda, consider browsing <a title=\"http://hostingreviews.io/\" href=\"http://hostingreviews.io/\">HostingReviews.io</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 10 Oct 2014 20:59:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:17;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"WPTavern: WebDesign.com Is Now iThemes Training\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31920\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"http://wptavern.com/webdesign-com-is-now-ithemes-training\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1569:\"<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/10/iThemesTrainingImage.png\" rel=\"prettyphoto[31920]\"><img class=\"aligncenter size-full wp-image-31921\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/10/iThemesTrainingImage.png?resize=598%2C148\" alt=\"iThemes Training Image\" /></a>iThemes <a title=\"https://ithemes.com/webdesign-has-moved/\" href=\"https://ithemes.com/webdesign-has-moved/\">has announced</a> that WebDesign.com is now called <a title=\"http://training.ithemes.com\" href=\"http://training.ithemes.com\">iThemes Training.</a> According to the announcement, this change will lessen confusion and place everything under the iThemes umbrella.</p>\n<blockquote><p>We&#8217;re making this transition in order to bring everything we do at iThemes under one roof (themes, plugins &amp; training) and eliminate confusion caused by having multiple domain names and two separate brands.</p></blockquote>\n<p>If you&#8217;re a member of WebDesign.com, not much changes. You&#8217;ll be able to use the same credentials to login to iThemes Training and access the same content as before.</p>\n<p>If you have any questions concerning the move, iThemes is <a title=\"https://www2.gotomeeting.com/register/392183786\" href=\"https://www2.gotomeeting.com/register/392183786\">hosting a webinar</a> on Monday, October 13th at 1PM CDT. You can also stop by the iThemes Training <a title=\"https://ithemes.com/forum/topic/64915-ithemes-training-webdesigncom/\" href=\"https://ithemes.com/forum/topic/64915-ithemes-training-webdesigncom/\">member forum</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 10 Oct 2014 19:37:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:18;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"WPTavern: First PodsCamp Is a Success\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31900\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"http://wptavern.com/first-podscamp-is-a-success\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3614:\"<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/PodsDevTeamFeaturedImage.png\" rel=\"prettyphoto[31900]\"><img class=\"size-full wp-image-31901\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/PodsDevTeamFeaturedImage.png?resize=663%2C300\" alt=\"PodsCamp Dev Team Featured Image\" /></a>Image Courtesy of <a title=\"http://podscamp.org/\" href=\"http://podscamp.org/\">PodsCamp</a>\n<p>October 3rd, 2014 will live in the history books as the day when the <a title=\"http://podscamp.org/\" href=\"http://podscamp.org/\">first conference</a> devoted to <a title=\"http://pods.io/\" href=\"http://pods.io/\">Pods</a> took place. Organized by Scott Kingsley Clark, <a title=\"http://podscamp.org/\" href=\"http://podscamp.org/\">PodsCamp</a> not only focused on the Pods plugin, but it was also the first time the development team was in the same physical location. In the following interview, Clark tells me how he thinks it went and whether it will become an annual event.</p>\n<p><strong>Overall, what is your impression for how the first ever PodsCamp went?</strong></p>\n<p>It was awesome! It could have only been made better by perhaps more tickets being available for WCDFW which was a barrier for folks coming from out-of-town. When tickets ran out for WCDFW, people couldn&#8217;t justify just coming out for PodsCamp, but could justify it if they were able to go to WCDFW that weekend too. Almost all (if not every single one) of our attendees went to WCDFW the next day.</p>\n<p><strong>What was accomplished by having the entire Pods development team under the same roof?</strong></p>\n<p>This was the first time we were together and it gave us an opportunity to have face to face conversations. We talked about all sorts of things like where we&#8217;ve been, where we&#8217;re going, and ideas on what we want to improve upon. One killer idea that came out of the weekend was from Joshua Pollock. We&#8217;re nailing down the specifics right now and should have an announcement post published as soon as we get things in place.</p>\n<p><strong>Do you have any initial feedback concerning the event?</strong></p>\n<p>We didn&#8217;t make enough from sponsors, Tilt, or ticket sales to cover the cost of the event. Our highest expense was bringing in four people from out-of-town and covering their accommodations. I hope in the future we can secure enough to at least break even.</p>\n<p><strong>Is PodsCamp something you&#8217;ll try to turn into an annual event?</strong></p>\n<p>Yes, we&#8217;re going to do this again next year just before WCDFW and will go over new topics now that we have established a baseline. We&#8217;re also considering 1-3 smaller meetup-based events near where our team members are located. One of which may be a mini-PodsCamp type of event in Austin, TX. I think that PodsCamp DFW will be our flagship one, which we would bring the whole crew out for, but the smaller ones could be more workshop and less camp.</p>\n<p>I just want to again thank everyone who made this possible, especially Chris Lema, Jake Goldman, Tom McFarlin, WPEngine, and SiteGround. Im so stoked we could pull this off!</p>\n<h2>Let Us Know if You Attended PodsCamp</h2>\n<p>If you attended PodsCamp, let us know about your experience in the comments! Slides from each presentation can <a title=\"http://www.slideshare.net/podsframework/\" href=\"http://www.slideshare.net/podsframework/\">be found here</a>. Sessions recorded at the event will be added to the Pods Framework <a title=\"https://www.youtube.com/user/podsframework\" href=\"https://www.youtube.com/user/podsframework\">YouTube channel</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 10 Oct 2014 18:32:04 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:19;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"Matt: Chicago FAA Fire\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44243\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"http://ma.tt/2014/10/chicago-faa-fire/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:430:\"<p><a href=\"http://www.bloomberg.com/news/2014-10-02/contact-lost-with-planes-one-by-one-as-faa-center-fire-spread.html\">This story about how a man sabotaged a FAA facility is terrifying and inspiring in how people worked together to overcome it</a>, and also includes this unintentionally funny line, &#8220;He had worked at the Chicago Center for eight years, according to an FBI affidavit. The company has fired him.&#8221;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 10 Oct 2014 15:33:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:20;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"WPTavern: WPWeekly Episode 165  Contributions Galore\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://wptavern.com?p=31903&preview_id=31903\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"http://wptavern.com/wpweekly-episode-165-contributions-galore\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3083:\"<p>Since there is no guest this week, <a href=\"http://marcuscouch.com/\" title=\"http://marcuscouch.com/\">Marcus Couch</a> and I used this opportunity to spend more time than usual with the news. We spend a considerable amount of time discussing WordPress contributions and I provide insight into my distinction between<strong> direct</strong> and <strong>indirect</strong> contributions. I share my experience of attending the first WordCamp event for Ann Arbor, MI. Last but not least, we end the show with a shout-out to <a href=\"http://hostingreviews.io/\" title=\"http://hostingreviews.io/\">HostingReviews.io</a>, a resource filled with webhosting reviews from current or past customers without affiliate links.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"http://wptavern.com/my-experience-at-wordcamp-ann-arbor-2014\" title=\"http://wptavern.com/my-experience-at-wordcamp-ann-arbor-2014\">My Experience at WordCamp Ann Arbor 2014</a><br />\n<a href=\"http://wptavern.com/contributing-back-to-wordpress\" title=\"http://wptavern.com/contributing-back-to-wordpress\">Contributing Back to WordPress</a><br />\n<a href=\"http://wptavern.com/webdevstudios-acquires-wordpress-support-services-company-maintainn\" title=\"http://wptavern.com/webdevstudios-acquires-wordpress-support-services-company-maintainn\">WebDevStudios Acquires WordPress Support Services Company, Maintainn</a><br />\n<a href=\"http://www.poststat.us/pagely-growth-wordpress-hosting/\" title=\"http://www.poststat.us/pagely-growth-wordpress-hosting/\">5 years into business, Pagely is growing faster than ever</a></p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href=\"https://wordpress.org/plugins/duplicate-title-validate/\" title=\"https://wordpress.org/plugins/duplicate-title-validate/\">Duplicate Title Validation</a> looks for posts and pages with the same name and prevents you from using the same title twice.</p>\n<p><a href=\"https://wordpress.org/plugins/flexible-widget-title/\" title=\"https://wordpress.org/plugins/flexible-widget-title/\">Flexible Widget Title</a> enables you to hide widget titles in the frontend of WordPress, while the widget title is still visible in the backend.</p>\n<p><a href=\"https://wordpress.org/plugins/wp-double-protection/\" title=\"https://wordpress.org/plugins/wp-double-protection/\">WP Double Protection</a> adds the ability to have a second password option. Instead of needing one password to login, you&#8217;ll need two.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, October 15th 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"http://www.wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #165:</strong><br />\n</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 10 Oct 2014 04:53:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:21;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"WPTavern: New WordPress Plugin Prevents Duplicate Titles From Being Published\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31892\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"http://wptavern.com/new-wordpress-plugin-prevents-duplicate-titles-from-being-published\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1686:\"<p>By default, if a post or page uses a title that&#8217;s already been used, WordPress appends a -2 to the end of the slug to prevent conflicts. Not only do duplicate titles cause conflicts, they&#8217;re not good for SEO. Developed by <a href=\"https://profiles.wordpress.org/wallfa_hm/\">wallfa_hm,</a> the <a title=\"https://wordpress.org/plugins/duplicate-title-validate/\" href=\"https://wordpress.org/plugins/duplicate-title-validate/\">Duplicate Title Validation</a> plugin checks the title and displays a notice if it&#8217;s considered a duplicate.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/10/DuplicateTitleDetected.png\" rel=\"prettyphoto[31892]\"><img class=\"size-full wp-image-31893\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/10/DuplicateTitleDetected.png?resize=941%2C358\" alt=\"Duplicate Title Detected\" /></a>Duplicate Title Detected\n<p>I tried to publish a post with a duplicate title but the plugin prevented it from being published and saved it as a draft instead. This is a nice touch and forces the writer to use a unique title.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/10/DuplicatePostSavedAsDraft.png\" rel=\"prettyphoto[31892]\"><img class=\"size-full wp-image-31895\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/10/DuplicatePostSavedAsDraft.png?resize=924%2C407\" alt=\"Duplicate Post Saved as a Draft\" /></a>Duplicate Post Saved as a Draft\n<p>It&#8217;s not difficult to determine what the plugin is doing but the notices could be improved so they&#8217;re easier to understand. If you publish a lot of content, this plugin is an easy way to make sure each post or page has a unique title.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 10 Oct 2014 03:23:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:22;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"WPTavern: A Simple Way to Hide Widget Titles From The Frontend of WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31876\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"http://wptavern.com/a-simple-way-to-hide-widget-titles-from-the-frontend-of-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1019:\"<p>Developed by <a title=\"https://profiles.wordpress.org/hyyan/\" href=\"https://profiles.wordpress.org/hyyan/\">Hyyan</a>, <a title=\"https://wordpress.org/plugins/flexible-widget-title/\" href=\"https://wordpress.org/plugins/flexible-widget-title/\">Flexible Widget Title</a> is a new plugin that enables users to hide widget titles from the frontend of WordPress. When activated, apply brackets to the titles you want to hide. For example,<strong> [A Text Widget Title].</strong></p>\n<a href=\"http://wptavern.com/a-simple-way-to-hide-widget-titles-from-the-frontend-of-wordpress#gallery-31876-1-slideshow\">Click to view slideshow.</a>\n<p>Although the same effect can be accomplished by leaving the title field blank, it makes administering several text widgets in the backend of WordPress more difficult. This plugin allows you to keep the titles in the backend for easier administration but still be able to hide them on the frontend.</p>\n<p>I tested the plugin on WordPress 4.0 and didn&#8217;t experience any issues.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 10 Oct 2014 01:27:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:23;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"Matt: Most Fascinating Newsletter\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"