ata\";s:37:\"http://ma.tt/2014/10/players-tribune/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:794:\"<blockquote><p>Introducing The Players Tribune, a new media platform that will present the unfiltered voices of professional athletes, bringing fans closer to the games they love than ever before. Founded by Derek Jeter, The Players Tribune aims to provide unique insight into the daily sports conversation and to publish first-person stories directly from athletes. From video to podcasts to player polls and written pieces, The Tribune will strive to be The Voice of the Game.</p></blockquote>\n<p><a href=\"http://www.theplayerstribune.com/\">The Players&#8217; Tribune, powered by WordPress</a>. <a href=\"http://www.theplayerstribune.com/introducing-derek-jeter/\">Here&#8217;s Jeter&#8217;s intro</a>. <cite>Hat tip: <a href=\"http://daringfireball.net/\">John Gruber</a>.</cite></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 09 Oct 2014 06:09:05 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:25;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Matt: Become a Longreads Member\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44247\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"http://ma.tt/2014/10/become-a-longreads-member/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:766:\"<blockquote><p>Our goal is to create a sustainable membership with a large enough base that it will fund reporting and writing at rates that are competitive with the best print magazines in the world.</p></blockquote>\n<p>You might not have heard of a <a href=\"http://longreads.com/member\">Longreads Membership</a> yet &#8212; you join for a monthly fee and 100% of that goes to independent publishers and writers. <a href=\"http://blog.longreads.com/2014/10/06/the-longreads-membership-is-now-twice-as-powerful/\">We&#8217;re announcing an update to the program to match every dollar in, so it doubles your contribution</a>. I just joined Longreads at $10/mo, about what I pay for Netflix, and I can&#8217;t wait to see what comes out from the editorial team next.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 08 Oct 2014 20:22:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"Post Status: 5 years into business, Pagely is growing faster than ever\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"http://www.poststat.us/?p=7174\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"http://www.poststat.us/pagely-growth-wordpress-hosting/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9862:\"<p><img class=\"aligncenter size-full wp-image-7177\" src=\"http://www.poststat.us/wp-content/uploads/2014/10/pagely.png\" alt=\"pagely\" width=\"640\" height=\"220\" /></p>\n<p><a href=\"http://pagely.com\">Pagely</a> is celebrating their fifth year of business right now. They have just launched their newly designed website (<em>note to early readers</em>: it&#8217;s in process of launching at this moment, so some links may not work until later today) to reflect some of the ways they&#8217;ve changed over the years. They are also growing, rapidly.</p>\n<p>The new website is a complete rebrand. They&#8217;ve tweaked their logo many times over the years, but they&#8217;ve completely changed it now. It&#8217;s much more modern and can be used in a variety of ways.</p>\n<p>The new website is flat, geometric, modern, and as sassy as ever (like with their <a href=\"https://pagely.com/about-us/investors/\">Investors page</a> they are quite proud of). In all, the redesign attempts to showcase happy customers and what makes them different.</p>\n<p><a href=\"http://www.poststat.us/pagely-growth-wordpress-hosting/pagely-new-homepage/\" rel=\"attachment wp-att-7181\"><img class=\"aligncenter size-large wp-image-7181\" src=\"http://www.poststat.us/wp-content/uploads/2014/10/pagely-new-homepage-752x547.png\" alt=\"pagely-new-homepage\" width=\"627\" height=\"456\" /></a></p>\n<p>They are introducing <a href=\"https://pagely.com/ambassadors/\">brand ambassadors</a> &#8212; a kind of super testimonial &#8212; that includes namesyou&#8217;ll surely recognize from the WordPress community.</p>\n<p>Additionally, they are giving other managed hosts a bit of a sting with what they call <a href=\"https://pagely.com/turnthepage/\">#turnthepage</a>, a dedicated page to highlight that they don&#8217;t charge for pageviews, something that most managed WordPress hosting companies do.<span id=\"more-7174\"></span></p>\n<p>Pagely has implemented the new branding and design elements across most of their platform, including their Support sub-site.</p>\n<p><img class=\"aligncenter size-large wp-image-7176\" src=\"http://www.poststat.us/wp-content/uploads/2014/10/support-pagely-752x491.png\" alt=\"support-pagely\" width=\"627\" height=\"409\" /></p>\n<p>In addition to branding and a web redesign, Pagely is attempting to showcase that they were first to market with managed WordPress hosting, but also that they are best in class. The strategy &#8212; and particularly their recent all-in <a title=\"Pagely has new plans, a new dashboard, and a new Amazon Web Services infrastructure\" href=\"http://www.poststat.us/pagely-wordpress-hosting-amazon/\">move to being an AWS-based service</a> &#8212; appear to be working.</p>\n<h3>Record growth</h3>\n<p>I discussed the Pagely redesign and their recent growth with Joshua Strebel, Pagely co-founder and CEO. He told me that they&#8217;ve seen an enormous amount of growth this year.</p>\n<p>Revenue is up 28% in the last month alone and between 40-45% quarter over quarter. This means that Pagely is on pace to more than double in size between this summer and next.</p>\n<p>To some this may seem a surprise, but it&#8217;s part of some slow and steady investments Pagely has made in recent years.</p>\n<p>They certainly did not scale at the pace of other players in the market &#8212; most notably <a href=\"http://wpengine.com\">WP Engine</a>. They also (as noted above with the Investors page) have bootstrapped their company from the beginning.</p>\n<p>Noone knows exactly how big Pagely is today, and that&#8217;s part of what you get with their owners. Though I&#8217;m told they are &#8220;more than 10 people but fewer than 50.&#8221;</p>\n<p><img class=\"aligncenter size-large wp-image-6550\" src=\"http://www.poststat.us/wp-content/uploads/2014/05/pagely-team-752x378.jpg\" alt=\"pagely-team\" width=\"627\" height=\"315\" /></p>\n<p>The Strebel&#8217;s (on the left of the picture above) own the company &#8212; only sharing equity with some key employees &#8212; and they are proud of their independence.</p>\n<p>It&#8217;s nearly impossible to be a Pagely customer without feeling the presence of Josh and Sally Strebel&#8217;s own personalities. And while Josh is an opinionated figure in the WordPress community, Pagely customers seem quite happy with that.</p>\n<h3>Managed host customer satisfaction</h3>\n<p>Steven Gliebe started a new project recently called <a href=\"http://hostingreviews.io/\">HostingReviews.io</a>, a website that attempts to collect non-biased reviews from social media about various hosting solutions. Pagely has a 94% happiness rating according to HostingReviews.io &#8212; matched only by <a href=\"http://getflywheel.com\">Flywheel&#8217;s</a> 95% rating.</p>\n<p>I like Steven&#8217;s project because he is not using affiliates at all with this project, an aspect that spoils most hosting review websites. Here&#8217;s a breakdown of some others:</p>\n<p><a href=\"http://www.poststat.us/pagely-growth-wordpress-hosting/hosting-reviews-io/\" rel=\"attachment wp-att-7175\"><img class=\"aligncenter size-large wp-image-7175\" src=\"http://www.poststat.us/wp-content/uploads/2014/10/hosting-reviews-io-752x757.png\" alt=\"hosting-reviews-io\" width=\"627\" height=\"631\" /></a></p>\n<p>&nbsp;</p>\n<h3>Changes in managed WordPress hosting markets</h3>\n<p>It&#8217;s been an interesting time to analyze the managed WordPress hosting market. For one, the term &#8220;managed WordPress hosting&#8221; is here to stay. Nearly every large player &#8212; including the likes of GoDaddy, Bluehost, Dreamhost, and more &#8212; offer a managed WordPress hosting product.</p>\n<p>The differences between these large company products and the original smaller players &#8212; players like Pagely, WP Engine, Pressable, and later entrants like Flywheel, Siteground, and Pantheon &#8212; are beyond the name of the product. You really have to dig into each service and business model to get a full grasp of how they are unique.</p>\n<p>And this is really hard.</p>\n<p>For one, you can find positive and negative things about every host in the world. But also, these companies are often targeting different audiences. For instance, GoDaddy and the other large hosts pretty clearly want the smaller website audience, but to upsell them with a more WordPress-specific package. And that&#8217;s fine; they can offer some great functionality for that.</p>\n<p>But Pagely, Pantheon, and some others are going after bigger fish; and they are marketing themselves appropriately.</p>\n<h3>Going after WordPress.com VIP</h3>\n<p><a href=\"http://vip.wordpress.com/\">WordPress.com VIP</a> is the king of the big-WordPress mountain. They have the promise of infinite scale and excellent reliability. It&#8217;s Automattic&#8217;s own product and an excellent business model for them.</p>\n<p>They are able to charge big companies big dollars (relative to other WordPress hosting, not compared to some enterprise software these companies are used to) to get the assurance that their website is hosted safely and reliably.</p>\n<p>WordPress.com <a href=\"http://vip.wordpress.com/stats/\">serves billions of pageviews every month</a>. It&#8217;s simply a massive platform and a comfortable place for companies to take their WordPress hosting needs.</p>\n<p>Pagely wants to be an alternative to WordPress.com VIP. They see themselves as a viable and attractive alternative. For one, they&#8217;ll tell you that you can run anything on Pagely; whereas WordPress VIP has a restricted ecosystem that involves approved-only plugins and stringentcode reviews for any custom code, that often requires one of their VIP service partners to perform the work.</p>\n<blockquote><p>VIP is a great service. However it is no longer the only service capable of serving clients at scale. We are winning more of those high-caliber clients that need the extra flexibility our stack offers.</p>\n<p>&#8211; Joshua Strebel, Pagely CEO</p></blockquote>\n<p>Pagely and others seeking the high end market are still relatively early on in their efforts; WordPress.com VIP is a behemoth in that market.</p>\n<h3>A changing tide</h3>\n<p>I&#8217;ve noticed &#8212; and I&#8217;m sure some of you have too &#8212; a change in tide of WordPress managed hosting. This year has no doubt been a very tough one for some managed hosts.</p>\n<p>It&#8217;s been painful to see customers that were once happy with their service &#8212; to the point of being huge brand ambassadors themselves &#8212; to quietly leaving and moving on to something else, now with warranted skepticism.</p>\n<p>Personally, I try to stay pretty host-agnostic. It is a very difficult market to say anything about, due to its incredibly competitive nature. However, I think it&#8217;s obvious that Pagely &#8212; accompanied by the likes of <a href=\"http://siteground.com\">SiteGround</a> and <a href=\"http://getpantheon.com\">Pantheon</a> &#8212; is on the rise while some of the other early entrants to WordPress managed hosting are struggling to consistently deliver on their promises.</p>\n<p>However, with new-found popularity and fast growth, Pagely too can be susceptible to some of the same growing pains of their competition. But they say they&#8217;reready for it.</p>\n<p>They&#8217;ve invested heavily in AWS and put all their technology chips in Amazon&#8217;s basket. And they assure me that they have been hiring some of the best support techs and engineers in the business. Additionally, they tell me that because they aren&#8217;t investing a ton of money into marketing, their customer influx is more natural and less likely to strain more linear growth levels.</p>\n<p>Time will tell if <a href=\"http://pagely.com\">Pagely</a> is ready to scale with players that have more money and resources than they do, but they&#8217;re definitely excited about the recent growth, the new brand and website, their brand ambassadors, and the challenges ahead.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 08 Oct 2014 19:41:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:27;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"WPTavern: My Experience at WordCamp Ann Arbor 2014\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31846\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"http://wptavern.com/my-experience-at-wordcamp-ann-arbor-2014\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9897:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/10/WordCampAnnArbor2014.png\" rel=\"prettyphoto[31846]\"><img class=\"aligncenter wp-image-31783 size-full\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/10/WordCampAnnArbor2014.png?resize=680%2C265\" alt=\"WordCamp Ann Arbor 2014 Header\" /></a></p>\n<p>After a <a title=\"http://wptavern.com/5-wordpress-conferences-taking-place-this-weekend\" href=\"http://wptavern.com/5-wordpress-conferences-taking-place-this-weekend\">busy weekend of WordPress conferences</a>, among those that took place is the first ever <a title=\"http://2014.annarbor.wordcamp.org/\" href=\"http://2014.annarbor.wordcamp.org/\">WordCamp Ann Arbor</a>. Situated on the University of Michigan campus at the <a title=\"http://uunions.umich.edu/league/\" href=\"http://uunions.umich.edu/league/\">Michigan League</a>, nearly 150 people from all walks of life gathered to learn about WordPress.</p>\n<h2>Beginner&#8217;s Guide to WordCamps</h2>\n<p>I started the day with a session by <a title=\"http://serverpress.com/\" href=\"http://serverpress.com/\">Marc Benzakein</a> entitled &#8220;<a title=\"http://2014.annarbor.wordcamp.org/session/how-to-rock-a-wordcamp-even-if-youre-a-total-noob/\" href=\"http://2014.annarbor.wordcamp.org/session/how-to-rock-a-wordcamp-even-if-youre-a-total-noob/\">How to Rock a WordCamp Even if Youre a Total n00b</a>.&#8221; When Benzakein asked how many in the room were attending their first WordCamp, the majority raised their hands. After attending more than a dozen WordCamps, Benzakein offers advice to first-time attendees and explains how to get the most out of the event.</p>\n<a href=\"http://wptavern.com/my-experience-at-wordcamp-ann-arbor-2014#gallery-31846-2-slideshow\">Click to view slideshow.</a>\n<p>&nbsp;</p>\n<p>I&#8217;d like to see more WordCamps incorporate the same or a similar session at the beginning of the event, especially if it&#8217;s the first one for the area. It breaks the ice and gives attendees a realistic expectation of what a WordCamp is all about. Those who attended the presentation had the opportunity to meet Benzakein&#8217;s son, Eli.</p>\n<p>His son contributed to the conversation and helped break the ice with his humorous questions and commentary. He contributed so much that if he <del>registers an account on WordPress.org</del>, I&#8217;d like to see the speakers badge added to <a title=\"https://profiles.wordpress.org/Elijahbenzak\" href=\"https://profiles.wordpress.org/Elijahbenzak\">his profile</a>. If you&#8217;d like more information on how to survive your first WordCamp, Carrie Dils has an excellent <a title=\"http://www.carriedils.com/wordcamp-tips/\" href=\"http://www.carriedils.com/wordcamp-tips/\">survival guide</a> available.</p>\n<h2>Child Themes and Theme Frameworks</h2>\n<p>Next up, I sat in on <a title=\"http://philhoyt.com/\" href=\"http://philhoyt.com/\">Phil Hoyt&#8217;s</a> presentation on using <a title=\"http://2014.annarbor.wordcamp.org/session/using-frameworks-and-child-themes/\" href=\"http://2014.annarbor.wordcamp.org/session/using-frameworks-and-child-themes/\">Frameworks and Child Themes</a>. He described the benefits of what a theme framework offers and the proper way of editing themes via child themes. His theme framework is called <a title=\"https://wordpress.org/themes/generic-framework\" href=\"https://wordpress.org/themes/generic-framework\">Generic</a> and is available for free on the WordPress Theme Directory.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/156.jpg\" rel=\"prettyphoto[31846]\"><img class=\"size-large wp-image-31860\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/156.jpg?resize=500%2C375\" alt=\"Child Themes and Theme Frameworks\" /></a>Learning about Child Themes and Theme Frameworks\n<h2>Be The Peacock</h2>\n<p>My favorite session of the day was &#8220;<a class=\"wcpt-session-title\" href=\"http://2014.annarbor.wordcamp.org/session/be-the-peacock-creating-and-loving-your-online-brand/\">Be the Peacock: Creating and Loving Your Online Brand</a>&#8221; by <a title=\"http://www.web-savvy-marketing.com/\" href=\"http://www.web-savvy-marketing.com/\">Rebecca Gill</a>. The idea behind her presentation is that a peacock has beautiful, vibrant colors, and is not afraid to strut them. Likewise, individuals need to stand out and make themselves and their brand distinguishable. In the presentation, she tells the story of how she was once a shy individual, afraid to strut her colors and diagnosed with <a title=\"http://wordpress.tv/2014/02/14/chris-lema-escaping-the-impostor-syndrome/\" href=\"http://wordpress.tv/2014/02/14/chris-lema-escaping-the-impostor-syndrome/\">Imposter Syndrome</a>. After receiving a pep talk from <a title=\"http://chrislema.com/\" href=\"http://chrislema.com/\">Chris Lema</a>, she embraced her inner peacock.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/10/157.jpg\" rel=\"prettyphoto[31846]\"><img class=\"size-large wp-image-31862\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/10/157.jpg?resize=500%2C375\" alt=\"Be The Peacock Not The Peahen\" /></a>Be The Peacock Not The Peahen\n<p>&nbsp;</p>\n<h2>Wise Words From a Mentor</h2>\n<p>When <a title=\"http://3.7designs.co/\" href=\"http://3.7designs.co/\">Ross Johnson</a> put the wheels in motion to organize WordCamp Ann Arbor, he didn&#8217;t have a reference level of interest. Although the Ann Arbor area has a <a title=\"http://www.meetup.com/WordPress-Ann-Arbor/\" href=\"http://www.meetup.com/WordPress-Ann-Arbor/\">monthly meetup group</a> with 40-50 rotating attendees, he didn&#8217;t know if people would feel compelled to travel from Detroit. Because of the uncertainty, attendance for the event was capped at 150 tickets. &#8220;We ended up selling out early and having nearly seventy people on the waiting list. We of course had made all of our accommodations based on 150 people,&#8221; Johnson told the Tavern.</p>\n<p>John Hawkins who organized WordCamp Las Vegas 2013 and is putting together <a title=\"http://2014.vegas.wordcamp.org/\" href=\"http://2014.vegas.wordcamp.org/\">the event for 2014</a> mentored Johnson along with a few other first-time organizers. Hawkins suggested to Johnson that he should release more tickets and that 10-15% of people wouldn&#8217;t show up. &#8220;As predicted, a large group of people didn&#8217;t show up and we were able to accommodate everyone without issue.&#8221;</p>\n<h2>Finding a Venue</h2>\n<p>Finding a venue can be one of the more challenging aspects of organizing a WordCamp. Most speakers appreciate being able to walk to the venue from their hotel room. After ruling out corporate venues due to cost, Johnson was left to choose between donated office space, public space, or the University of Michigan.</p>\n<p><a title=\"http://www.lyndsayjohnson.com/\" href=\"http://www.lyndsayjohnson.com/\">Lyndsay Johnson</a> who studied at the University recommended that he try contacting the <a title=\"http://uunions.umich.edu/league/\" href=\"http://uunions.umich.edu/league/\">Michigan League</a> event services department. &#8220;After touring the facilities we knew it was the spot we wanted to try. It was central to downtown and had an incredible classic vibe to it which brought an interesting contrast for a tech event.&#8221; Another benefit to using the League is the on site catering as well as a strong technology team to help keep technical hiccups to a minimum.</p>\n<h2>Lessons Learned From a First Timer</h2>\n<p>Johnson recommends that organizers start early. While WordCamp Ann Arbor took place on October 14th, he sent out the first email related to the event in early February. &#8220;On paper it doesn&#8217;t look like there is <i>that</i>match to do, but it&#8217;s more than it seems.&#8221; Second and third time organizers have the luxury of building off of previous experience. That&#8217;s a luxury first timers don&#8217;t have. &#8220;When starting from scratch you have to design a new website, new badges, new logo, etc.&#8221;</p>\n<p>One of the most important aspects of managing a large event such as a WordCamp is the team surrounding you. &#8220;Get a group of organizers that you can really trust and don&#8217;t be afraid to delegate to them.&#8221; In addition to Johnson, the organizing team includes: Justin Ferriman, Kloe Ferriman, Rebecca Gill, Lyndsay Johnson, Kyle Maurer, and Declan O&#8217;Neill. Despite having help, Johnson feels as though he took on too much work and will do a better job next year of asking for help.</p>\n<h2>Will There be a WordCamp Ann Arbor 2015?</h2>\n<p>Johnson tells me that they&#8217;ll likely have a second WordCamp in Ann Arbor next year and planning will begin sometime in February or earlier.</p>\n<h2>Can&#8217;t Wait For Round Two</h2>\n<p>For a first time event, WordCamp Ann Arbor didn&#8217;t experience many hiccups. The WiFi speeds at the League were fantastic with a consistent 20Mb up and down throughout the day. Attendees had to fend for themselves at lunch, but the setup offered an opportunity to exercise with a short walk to main street. Downtown Ann Arbor is filled with great places to eat but many of the locations are small, not being able to handle 10 or more people per table.</p>\n<p>With only 150 attendees, the atmosphere was relaxed and there was ample opportunity to meet each other. Attending WordCamp Ann Arbor reaffirms my feeling of enjoying smaller WordCamps versus those with 300 or more attendees. Last but not least, the University of Michigan is a beautiful campus, especially this time of year. If you live in or around the Ann Arbor area, keep tabs on the <a title=\"http://central.wordcamp.org/schedule/\" href=\"http://central.wordcamp.org/schedule/\">WordCamp Central schedule</a> and consider attending WordCamp in 2015.</p>\n<a href=\"http://wptavern.com/my-experience-at-wordcamp-ann-arbor-2014#gallery-31846-3-slideshow\">Click to view slideshow.</a>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 08 Oct 2014 19:32:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:28;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"Lorelle on WP: WordPress and Blogging Workshop in Forest Grove, Oregon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:37:\"http://lorelle.wordpress.com/?p=11958\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"http://lorelle.wordpress.com/2014/10/07/wordpress-and-blogging-workshop-in-forest-grove-oregon/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:458:\"On Friday, October 10, 2014, from 1-5PM I will be presenting a WordPress and Blogging Workshop in Forest Grove, Oregon, at the Forest Grove Senior and Community Center as a fundraiser for the center and part of the Writers in the Grove group. The price for this 4 hour event is $30 ($5 discount with [&#8230;]<img alt=\"\" border=\"0\" src=\"http://pixel.wp.com/b.gif?host=lorelle.wordpress.com&blog=72&post=11958&subd=lorelle&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 08 Oct 2014 05:06:31 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Lorelle VanFossen\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:29;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"WPTavern: WebDevStudios Acquires WordPress Support Services Company, Maintainn\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31827\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"http://wptavern.com/webdevstudios-acquires-wordpress-support-services-company-maintainn\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4189:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2009/02/webdevstudioslogo.png\" rel=\"prettyphoto[31827]\"><img class=\"aligncenter size-full wp-image-533\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2009/02/webdevstudioslogo.png?resize=405%2C81\" alt=\"webdevstudioslogo\" /></a></p>\n<p>WordPress development agency, <a title=\"http://webdevstudios.com/\" href=\"http://webdevstudios.com/\">WebDevStudios</a>, has acquired <a title=\"https://maintainn.com/\" href=\"https://maintainn.com/\">Maintainn</a> for an undisclosed amount. According to the <a title=\"http://webdevstudios.com/2014/10/07/webdevstudios-acquires-maintainn-to-bring-wordpress-support-and-maintenance-services-in-house/\" href=\"http://webdevstudios.com/2014/10/07/webdevstudios-acquires-maintainn-to-bring-wordpress-support-and-maintenance-services-in-house/\">announcement</a>, the acquisition enables WebDevStudios to provide better maintenance and support to clients. Founded in 2012 by <a title=\"https://maintainn.com/team/shayne-sanderson/\" href=\"https://maintainn.com/team/shayne-sanderson/\">Shayne Sanderson</a>, Maintainn provides maintenance services including 24/7 security monitoring, daily off-site backups, weekly updates to WordPress core, themes and plugins, a dedicated WordPress support desk and custom development.</p>\n<p>Sanderson, once an employee for WebDevStudios as a Technical Project Manager, <a title=\"http://shaynesanderson.com/2013/11/15/on-the-road-again/\" href=\"http://shaynesanderson.com/2013/11/15/on-the-road-again/\">left the company in late 2013</a> to work on Maintainn full-time. What started as an individual endeavor, turned into a five person company.</p>\n<h2>The Retainer Arm of WebDevStudios</h2>\n<p>On paper, the acquisition makes sense. WebDevStudios is able to focus on attracting new clients knowing they have a foundation in place to offer support and maintenance packages to new and existing clients. Maintainn is essentially the retainer arm of WebDevStudios. Retainers are defined as, &#8220;a fee paid in advance to someone, especially an attorney, in order to secure or keep their services when required.&#8221; When applying the definition to development agencies, it&#8217;s not hard to see why most have a retainer program in place.</p>\n<p>Brian Krogsgard, who works for WordPress design and development company <a title=\"http://ran.ge/\" href=\"http://ran.ge/\">Range</a>, explains why retainers can be an important part of an agency&#8217;s business model.</p>\n<blockquote><p>Retainers can be an excellent business tool for financing growth and forming long-term client relationships. Retainers offer consistent, reliable income that makes financing new hires less scary. They also allow the firm to really get to know the client and their needs over time, versus being limited to a single project scope. An existing retainer also puts the firm in great position to get lump sum projects from the client when those opportunities come up.</p></blockquote>\n<p>Not only do clients receive maintenance and support for WordPress, they also have access to a great team of developers. This gives WebDevStudios a competitive edge against companies such as <a title=\"http://www.wpsitecare.com/\" href=\"http://www.wpsitecare.com/\">WP Site Care</a>, <a title=\"http://wpcurve.com/\" href=\"http://wpcurve.com/\">WP Curve</a>, and <a title=\"http://wpmaintainer.com\" href=\"http://wpmaintainer.com\">WP Maintainer</a> that mostly focus mostly on maintenance and support.</p>\n<h2>MattReport Interview With Both Parties</h2>\n<p>I encourage you to read <a title=\"http://mattreport.com/webdevstudios-acquires-maintainn/\" href=\"http://mattreport.com/webdevstudios-acquires-maintainn/\">this interview</a> published on MattReport.com containing insight from both parties involved in the deal. Communication and keeping financial books in order are just two pieces of advice given within the interview. It also shines a light on the future of Maintainn and what its role will be within the company.</p>\n<p>What are your thoughts on the acquisition and will we see other WordPress maintenance companies acquired in the near future? If so, use the comments and give us your best guess.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 07 Oct 2014 23:15:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:30;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"Matt: Tavern Interview\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44238\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"http://ma.tt/2014/10/tavern-interview/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:276:\"<p>Sarah Gooding of the WordPress inside baseball blog <a href=\"http://wptavern.com/\">WP Tavern</a> has an interview with me she titled <a href=\"http://wptavern.com/matt-mullenweg-on-ensuring-the-future-of-wordpress\">Matt Mullenweg on Ensuring the Future of WordPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 07 Oct 2014 13:55:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:31;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"Post Status: Is WordPress right for eCommerce?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"http://www.poststat.us/?p=7165\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"http://www.poststat.us/wordpress-right-ecommerce/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:11868:\"<p><img class=\"aligncenter size-large wp-image-7170\" src=\"http://www.poststat.us/wp-content/uploads/2014/10/wordpress-ecommerce-discussion-752x352.jpg\" alt=\"wordpress-ecommerce-discussion\" width=\"627\" height=\"293\" /></p>\n<p>I&#8217;m going to take a leaf out of <a href=\"http://www.chrislema.com/\">Chris Lema&#8217;s</a> book right now to answer whether WordPress should be used for eCommerce: <strong>It depends</strong>.</p>\n<p>There are camps of thought that think WordPress isn&#8217;t right for eCommerce, and there are people that think it&#8217;s the only way to go. Having worked with and used several different eCommerce platforms (both hosted and self-hosted), I&#8217;ve definitely developed the mindset that there are use cases for each. WordPress can be the right choice in a lot of circumstances, but not all.</p>\n<h3>Hosted vs. self-hosted</h3>\n<p>If you&#8217;re not sure about the major differences between hosted vs self hosted platforms, I recommend reading <em>Patrick Rauland&#8217;s</em> <a href=\"http://speakinginbytes.com/2014/08/hosted-vs-self-hosted-e-commerce/\">overview of the major differences</a>. WordPress eCommerce usually falls under self-hosted eCommerce (I don&#8217;t count WordPress.com since it uses external eCommerce solutions). Forbes also <a href=\"http://www.forbes.com/sites/allbusiness/2014/09/26/which-e-commerce-platform-is-the-best-choice-for-your-online-store/\">recently wrote about this</a>, though I don&#8217;t necessarily agree with their conclusions.</p>\n<p>The <a href=\"http://www.practicalecommerce.com/articles/70101-When-to-Avoid-WordPress-Ecommerce\">typical viewpoint</a> is that WordPress plugins like WooCommerce or Easy Digital Downloads are great for small stores or people that just want to quickly and easily sell a few items, while hosted platforms like Shopify and Bigcommerce are for &#8220;serious&#8221; stores.</p>\n<p>This viewpoint is actually pretty backwards, not to mention the fact that the number of items is a poor way of determining which platform you should use.</p>\n<h3 id=\"give-each-its-due\">Give each its due</h3>\n<p>Is WordPress the best platform on which to build apps? I don&#8217;t always think so, but it <strong>could be</strong>. Is it always a good choice for eCommerce? Nope. However, it&#8217;s the <strong>right one</strong> for lots of stores, and it&#8217;s the <strong>wrong one</strong> for lots of stores.</p>\n<p>There are a few major strengths and weaknesses of both WordPress and hosted solutions. I&#8217;ve worked most with <a href=\"http://www.woothemes.com/woocommerce/\">WooCommerce</a>, <a href=\"http://easydigitaldownloads.com/\">Easy Digital Downloads</a>, and <a href=\"http://www.shopify.com/\">Shopify</a>, but have tried lots of other eCommerce solutions for comparison. Some of the knocks against WordPress aren&#8217;t valid, but we should note that some are.</p>\n<h3>WordPress eCommerce weaknesses</h3>\n<p>Everyone loves to talk about how easy certain WordPress plugins are to use. When you compare WordPress plugins to something like Shopify, this just <strong>isn&#8217;t true</strong>. They may be easy to use for people that are familiar with WordPress, but not for the average user who wants to start selling online with no experience.</p>\n<p>WordPress requires a domain name purchase, hosting setup, installation, plugin installation and setup, theme installation and setup, blah blah blah, you get the drift. With hosted solutions, you don&#8217;t worry about this (though solutions like <a href=\"http://evermo.re/\">Evermore</a> &#8212; which was <a title=\"Evermore, hosted WordPress with power and ease of use\" href=\"http://www.poststat.us/evermore-interview/\">covered by Post Status</a> when it launched &#8212; make this interesting). You pay your monthly bill, and you&#8217;re handed a store website &#8211; you just pick the name and get rolling. You can start adding products right away, and then you might get into changing your theme or other setup.<span id=\"more-7165\"></span></p>\n<div id=\"attachment_7167\" class=\"wp-caption alignright\"><img class=\"wp-image-7167 size-medium\" src=\"http://www.poststat.us/wp-content/uploads/2014/10/easy-300x258.jpg\" alt=\"easy\" width=\"300\" height=\"258\" /><p class=\"wp-caption-text\"><a href=\"https://c2.staticflickr.com/4/3181/3086827283_e9e762331c.jpg\">Image Credit</a></p></div>\n<p>Some of the site tweaks or setup with hosted solutions aren&#8217;t easy, but the learning curve for a solution like Shopify is far gentler than the learning curve for something like WooCommerce.</p>\n<p>There are also <strong>WP Cron</strong> issues for some sites, as it&#8217;s not a perfect system for scheduling actions, like recurring payments. It can work pretty well, but other platforms can make this far easier to implement and more reliable than Cron.</p>\n<p>WordPress store owners are also <strong>responsible</strong> for their own hosting, software updates, and security. For many site owners, these are huge responsibilities. Hosted solutions roll all of this into their package so that users don&#8217;t have to know how their website is powered. They just have to use it.</p>\n<p>Both WordPress and hosted solutions will scale, but there are considerations with WordPress that users need to be aware of. Database issues (like backups or memory with massive amounts of customers and orders) should be addressed, hosting has to be optimized, and plugins need to scale with the site. With a hosted solution, none of this is your problem as a user.</p>\n<h3>WordPress eCommerce strengths</h3>\n<p>Bearing these weaknesses in mind, it&#8217;s a bit crazy to me that WordPress is sometimes referred to as the &#8220;easy solution&#8221; or the right tool for &#8220;small stores&#8221;. It&#8217;s not. In many cases, it&#8217;s like bringing a tank to the eCommerce playground.</p>\n<p>So what does WordPress do well?</p>\n<p>First, WordPress offers the most all-in-one website solution available. WordPress can offer the eCommerce aspects of the website, in addition to its many other CMS features. The ability to createa single, seamless CMS experience for a multi-purpose website makes it quite compelling and more budget-friendly than more &#8220;eCommercefirst&#8221; platforms.</p>\n<p>Second, it&#8217;s optimized for <strong>SEO</strong>. Your content is crucial here, and WordPress is built for content. More importantly, if you&#8217;ve tried to blog on another platform, you know how painful it can be (don&#8217;t start with me Squarespace fans, that thing is difficult to use). WordPress doesn&#8217;t encourage you to avoid blogging to avoid headache: it&#8217;s built for <strong>complete websites</strong>, and is not simply focused on eCommerce.</p>\n<p>WordPress also contains functionality that you can&#8217;t always get with different platforms. There&#8217;s a massive selection of plugins, themes, and all sorts of solutions for WordPress that are readily available. Since it&#8217;s open source, it&#8217;s far easier to find ways to customize it when compared to closed platforms like Bigcommerce.</p>\n<p>Speaking of customizations, your ability to customize WordPress or plugins is <strong>far</strong> easier than with hosted solutions. There&#8217;s lots of functionality that can be achieved with WordPress that&#8217;s not even possible in hosted solutions. For example, developers have no control over the Shopify checkout process, but this can be entirely customized with WordPress.</p>\n<p>You can also usually find a plugin that will provide a &#8220;starting point&#8221; for a customization project. Even if you find a Shopify or Bigcommerce app that gets <em>close</em> to what you need, but not quite, you&#8217;ll need to create a completely custom solution anyway &#8211; there&#8217;s no &#8220;extending&#8221; there.</p>\n<p>Along with customization is the <strong>control over your environment</strong>. You can spin up your eCommerce site on something like Digital Ocean, and you&#8217;ve got control over the entire site, from server to theme.</p>\n<h3>Product type</h3>\n<p>The biggest difference for me between hosted solutions and self-hosted actually isn&#8217;t usability or scalability &#8211; it&#8217;s <strong>product type</strong>. Can almost every eCommerce platform sell tee shirts? Yes. Even EDD can do that, and it&#8217;s made for digital products.</p>\n<p>However, selling complex products becomes infinitely more difficult on hosted platforms, as you&#8217;re restricted to what the API offers for product changes, which isn&#8217;t always a lot. For example, if you&#8217;ve ever tried to add pricing changes for customization options in Shopify, you know that it literally takes some wizardry, black magic, and possibly bubble gum used as tape to do so.</p>\n<p>WordPress plugins make this far easier, because the entire platform is open, not just an API. Most eCommerce plugins have more than enough actions or filters to change products, product pages, checkout forms, or any other part of your site.</p>\n<h3>Recap</h3>\n<p>Hosted eCommerce solutions are typically easy to use, and can provide some customization options via apps or other add-on services. However, it&#8217;s like renting a house versus owning. With a rented house, you can&#8217;t go knocking down walls or completely remodeling &#8211; you&#8217;ve got to work inside of a framework you&#8217;re given. This is exactly how a hosted solution works.</p>\n<p>The benefit to this is that you absolve yourself of a lot of responsibility and worry. The entire experience is managed and supported, and is typically very easy to work with.</p>\n<p>However, WordPress eCommerce is like buying the house. You can do whatever you want &#8211; add-on, rebuild sections of the house, change layouts around, add tunnels to other houses, you name it. However, when the water heater blows up, it&#8217;s your responsibility.</p>\n<p>WordPress also affords the opportunity to sell complex products, such as measurement based products like corks by the pound, that simply can&#8217;t be sold on other platforms. The same ability to customize WordPress so thoroughly lets you customize the eCommerce plugin you&#8217;re using.</p>\n<p>You gain the flexibility that comes with the platform, as well as the benefits like tons of plugins, themes, a great content structure, and a consistently maintained and updated core solution. However, the Frankenstein site that you build is your baby, and yours alone &#8211; you need to host it, maintain it, and care for it.</p>\n<p>WordPress lets you create advanced functionality via plugins and customizations, but isn&#8217;t right for users looking for an easy, basic shop setup. If you want a move-in ready house or a beautiful rental, you should look at hosted solutions. If you&#8217;re willing to make your dream house from great bones and foundation, or you need to sell fairly complex products, then WordPress might be it for you. It&#8217;s not the &#8220;easy&#8221; solution, but it can be a great one.</p>\n<div id=\"single-hcard-beka\" class=\"loop-meta vcard\"><h4 class=\"author-bio fn n\">Beka Rice</h4><div class=\"author-description\"><img alt=\"Beka Rice\" src=\"http://1.gravatar.com/avatar/5ea957b08d0cf6a1e5e5cf5681519537?s=150&d=http%3A%2F%2F1.gravatar.com%2Favatar%2Fad516503a11cd5ca435acc9bb6523536%3Fs%3D150&r=G\" class=\"avatar avatar-150 photo\" height=\"150\" width=\"150\" /><div class=\"user-bio author-bio\">Beka is the content manager for <a href=\"http://skyverge.com\">SkyVerge</a>, where she writes sales copy, documentation, and website content. She also runs <a href=\"http://sellwithwp.com\">Sell with WP</a>, which is a site devoted to eCommerce using WordPress. When shes not furiously writing, shes playing music or leveling up her movie trivia knowledge.</div><!-- .user-bio .author-bio --></div><!-- .loop-description --></div><!-- .loop-meta -->\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 06 Oct 2014 19:03:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Beka Rice\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"Matt: Gambino Mixtape STN MTN\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44227\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:45:\"http://ma.tt/2014/10/gambino-mixtape-stn-mtn/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:640:\"<p>The ever-creative <a href=\"http://childishgambino.com/\">Childish Gambino</a> has released a <a href=\"http://stonemounta.in/\">new mixtape STN MTN</a>(<a href=\"http://www.hotnewhiphop.com/childish-gambino-stn-mtn-new-mixtape.115505.html\">track by track</a>)which is part of a longer EP Kauai <a href=\"https://itunes.apple.com/us/album/kauai/id925162758\">that was just released on iTunes</a>. Donald is a friend and an artist whose work fluently spans much more than music. And I&#8217;m not just saying that because, as Techcrunch noted, he shouts out to <a href=\"http://krutal.wordpress.com/\">Krutal</a> and I at the end of Go DJ.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 06 Oct 2014 15:49:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:33;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"Jen Mylo: Site Setup Journal: Prologue\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"http://jenmylo.com/?p=4558\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"http://jenmylo.com/2014/10/05/site-setup-journal-prologue/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2998:\"<p>I think that most of the people involved in creating software for the web have completely forgotten what it&#8217;s like to navigate these waters, and that &#8220;our setup is so simple!&#8221; statements are in general full of crap. Over the next few days, I am going to try to set up up a website on a domain I own using <em><strong>only</strong></em> the documentation and support available to the average person (who doesn&#8217;t have access to lead developers and heads of support teams). Is this decision predicated by the fact that none of those people were around when I tried pinging them today at 6am? Well, yes, yes it is. But given the frustration level I have encountered in the first 2 hours alone, I am glad they&#8217;re not around right now. I&#8217;ve been setting up websites since 1999, and I think we are making the process harder, not easier.</p>\n<p>Get ready for some painful descriptions of just how janky all our product flows and documentation are. I know I&#8217;m wincing.</p>\n<p>I&#8217;m thinking this will wind up being the equivalent of a play in 3 acts, but I could be wrong &#8212; it depends on how complicated things get.</p>\n<h3><img class=\"aligncenter size-full wp-image-4560\" src=\"http://jenmylo.files.wordpress.com/2014/10/screen-shot-2014-10-05-at-8-17-45-am.png?w=520&h=241\" alt=\"Screen shot of unavailable webpage\" width=\"520\" height=\"241\" /></h3>\n<h3></h3>\n<h3>Setting</h3>\n<p>A quiet home in the Pacific Northwest featuring cable internet with advertised speeds of 25Mbps down/10Mbps up. A comfortable bed with pillows propped against the headboard, against which our main character lounges at the opening of Act I, equipped with a MacBook Air circa 2010,an iPhone 5s, and a debitcard.</p>\n<h3>Cast of Characters</h3>\n<p><strong>Jen Mylo:</strong> An average web user trying to set up a site for the first time.</p>\n<p><strong>GoDaddy:</strong> The registrar holding the domain <em>[Ed. Note: Legacy registrar; I\'ll switch it to namecheap at some point before it\'s time to renew].</em></p>\n<p><strong>Dreamhost:</strong> A web hosting company that Jen Mylo has loved forever and that employs one of her favorite people as their resident WP expert. They were hosting non-profits for free before it was cool.</p>\n<p><strong>WordPress:</strong> An open source content management system you can use to run a website. Claims a famous 5-minute install, &#8220;well-known for its ease of installation.&#8221; Rumor has it this web app is made by a bunch of weirdos.</p>\n<p><strong>BuddyPress:</strong>An open source WordPress plugin that creates a social network on your site. Also made by weirdos.</p>\n<p><strong>Rivermark Community Credit Union:</strong> A community credit union in Portland, OR that likes to do everything online; where Jen Mylo keeps some of her money.</p>\n<p>Stay tuned for Act I!</p><img alt=\"\" border=\"0\" src=\"http://pixel.wp.com/b.gif?host=jenmylo.com&blog=45389656&post=4558&subd=jenmylo&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 05 Oct 2014 15:20:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:8:\"Jen Mylo\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:34;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"Matt: All About that Bass\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44224\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://ma.tt/2014/10/all-about-that-bass/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:164:\"<p>This catchy song has been making the rounds with my friends, see if you can listen and not move just a little bit:</p>\n<p><span class=\"embed-youtube\"></span></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 05 Oct 2014 13:03:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:35;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:24:\"Matt: New Diane Foug Art\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44236\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"http://ma.tt/2014/10/new-diane-foug-art/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:563:\"<p><a href=\"http://i2.wp.com/ma.tt/files/2014/10/IMG_2422.jpg\"><img src=\"http://i2.wp.com/ma.tt/files/2014/10/IMG_2422.jpg?w=604\" alt=\"IMG_2422.JPG\" class=\"alignnone size-full\" /></a></p>\n<p><a href=\"http://i2.wp.com/ma.tt/files/2014/10/IMG_2421.jpg\"><img src=\"http://i2.wp.com/ma.tt/files/2014/10/IMG_2421.jpg?w=604\" alt=\"IMG_2421.JPG\" class=\"alignnone size-full\" /></a></p>\n<p><a href=\"http://i1.wp.com/ma.tt/files/2014/10/IMG_2423.jpg\"><img src=\"http://i1.wp.com/ma.tt/files/2014/10/IMG_2423.jpg?w=604\" alt=\"IMG_2423.JPG\" class=\"alignnone size-full\" /></a></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 05 Oct 2014 03:11:59 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:36;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Matt: Streak\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44229\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://ma.tt/2014/10/streak/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4597:\"<p>You might have noticed there have been more posts around here lately. Actually until yesterday (Oct 3) there was an unbroken string of at least one post a day since August 25th, 40 posts in total. It started with a tweet from Colin Devroe:</p>\n<blockquote class=\"twitter-tweet\" width=\"550\"><p>I challenge <a href=\"https://twitter.com/mds\">@mds</a> <a href=\"https://twitter.com/Yarcom\">@yarcom</a> <a href=\"https://twitter.com/kyleruane\">@kyleruane</a> <a href=\"https://twitter.com/garyvee\">@garyvee</a> <a href=\"https://twitter.com/stewart\">@stewart</a> <a href=\"https://twitter.com/TechonomicMan\">@TechonomicMan</a> <a href=\"https://twitter.com/geoffd\">@geoffd</a> <a href=\"https://twitter.com/Clarko\">@clarko</a> <a href=\"https://twitter.com/photomatt\">@photomatt</a> to personal blogging every weekday for 30dys</p>\n<p>&mdash; Colin Devroe (@cdevroe) <a href=\"https://twitter.com/cdevroe/status/504630581117063169\">August 27, 2014</a></p></blockquote>\n<p></p>\n<p>Until now I forgot it was only weekdays, so I was doing weekends as well. Friends know I like doing personal experiments just to question assumptions or ingrained behavior, other examples this I&#8217;ve tried this year are giving up drinking for a month, going without a smartphone for 40 days, and more recently training for a half marathon with my friend Rene. I thought blogging every day would be a burden, but it actually became a great source of joy. It was more a shift in mindset than anything &#8212; every day I read things I think are interesting, share links with friends, have thoughts that are 80% of a blog post, and write a ton privately, it was just a matter of catching those moments and turning them into something that was shared with the world.</p>\n<p>The tools besides WordPress that I found super-helpful in this were <a href=\"http://simplenote.com/\">Simplenote</a>, which was great for capturing thoughts and drafts when I was on the go, and I&#8217;ve been using the <a href=\"https://wordpress.org/plugins/editorial-calendar/\">Editorial Calendar</a> plugin to help me schedule drafts and keep an eye on my progress. The Editorial Calendar plugin is useful but I don&#8217;t love it &#8212; I wish the calendar view moved week by week rather than replacing the whole table, that it was responsive or worked on mobile, and that it would take over your publish button so you could define a desired posting cadence (in my case every 24 hours) and it would put a finished post in the next free slot, or let you bump something to the front of the queue and push all the other posts back a day. There were a few missteps along the way with timezones but overall I&#8217;m happy with how the experiment turned out.</p>\n<p>So what broke the streak? It was actually one of the other experiments: running. I&#8217;ve never considered myself a runner, and never really done it in my life, but a few months ago I started trying it and have been training up for a half marathon on November 16. (<a href=\"http://ma.tt/2014/10/photo-run-through-stockholm/\">It&#8217;s also a great opportunity to take photos</a>.) Yesterday morning I woke up early around 5 AM and as the sun started to come up, and the weather was so nice after <a href=\"https://cloudup.com/cCYGA3rqlvi\">I rounded the Bay Bridge</a> (planned turnaround point) kept going to Crissy Field where <a href=\"https://cloudup.com/caWpo6oFQ0d\">I saw the Golden Gate from afar</a> and thought it would be fun to cross it. <a href=\"http://matt.wordpress.com/2014/10/04/under-golden-gate/\">After crossing</a> I was starving by and figured 3 more miles would be a half marathon and also put me in Sausalito. The last mile or two was really tough, definitely beyond what I was ready for and I walked a lot, but <a href=\"http://runkeeper.com/user/photomatt/activity/446743645?&activityList=false&tripIdBase36=7dz9lp&channel=web.activity.shorturl\">I was very proud of the result</a>, finishing in around 2 hours 45 minutes. But I hadn&#8217;t planned to stay out that long, and the rest of my day was full of meetings. I had moved my scheduled post for the day out so I could talk about the new Childish Gambino mixtape (post coming tomorrow) but the rest of the day was so busy and I got exhausted so early I totally forgot to post.</p>\n<p>So achieved one life goal while breaking the streak on another, which is not ideal, but today is another day and I want to see if I can break the 39 day streak next. Everything happens one day at a time. <img src=\"http://i1.wp.com/s.ma.tt/blog/wp-includes/images/smilies/icon_smile.gif?w=604\" alt=\":)\" class=\"wp-smiley\" /></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 04 Oct 2014 17:42:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:37;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"WPTavern: Contributing Back to WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31765\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"http://wptavern.com/contributing-back-to-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9026:\"<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/matt-mullenweg.jpg\" rel=\"prettyphoto[31765]\"><img class=\"size-full wp-image-31713\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/matt-mullenweg.jpg?resize=1024%2C522\" alt=\"Photo by Vladimir Kaladan Petkov\" /></a>Photo by Vladimir Kaladan Petkov\n<p>During a session at <a title=\"http://2014.europe.wordcamp.org/\" href=\"http://2014.europe.wordcamp.org/\">WordCamp Europe</a>, Matt Mullenweg was asked how companies contribute back to WordPress, how they&#8217;re doing it, and what companies should do more of. He responded to the question in-depth in a blog post entitled <a title=\"http://ma.tt/2014/09/five-for-the-future/\" href=\"http://ma.tt/2014/09/five-for-the-future/\">Five for the Future</a>. In the post, he outlines 5% as being a good rule of thumb to avoid the <a title=\"http://en.wikipedia.org/wiki/Tragedy_of_the_commons\" href=\"http://en.wikipedia.org/wiki/Tragedy_of_the_commons\">tragedy of the commons</a>. The post ignited a healthy discussion throughout the WordPress community.</p>\n<p>While his post is more about WordPress organizations, companies, and agencies and how they can grow their part of the pie and WordPress as a whole, I&#8217;m going to focus on individual contributions.</p>\n<h2>What is a WordPress Contribution?</h2>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/ContributionBox.png\" rel=\"prettyphoto[31765]\"><img class=\"size-full wp-image-31791\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/ContributionBox.png?resize=640%2C213\" alt=\"Contribution Box\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/chrstopher/341538188/\">Chrstopher</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nc-nd/2.0/\">cc</a>\n<p>The definition of what classifies as a contribution to WordPress is subjective. In the broadest sense of the term, I define contribution as anything that furthers the WordPress project. I seperate contributions to WordPress into two groups, <strong>direct</strong> and <strong>indirect</strong>. Direct contributions are those that deal with the core of WordPress such as patches, leading a release, and commits. These have a direct impact on WordPress and the millions of people who use it.</p>\n<p>Indirect contributions are those that further the project without using code. Examples include meetups, WordCamps, and tech support. These are what I think make up the vast majority of contributions to WordPress.</p>\n<h2>Contributing to WordPress Without Realizing it</h2>\n<p>As I thought about the 5% goal and whether or not I meet the criteria, I had an epiphany. <em>Thousands of people likely contribute to WordPress everyday without realizing it</em>.</p>\n<ul>\n<li>A friend emails you and needs WordPress support. You help fix their problem.</li>\n<li>Someone needs a particular plugin to fulfill a need and you offer a suggestion that works.</li>\n<li>You&#8217;re at a local meetup and help someone figure out how to use a particular feature in WordPress.</li>\n</ul>\n<p>All of the examples above are <strong>indirect</strong> ways of contributing to WordPress but are things millions of people do everyday. In these moments, users are helping each other while in the background, they&#8217;re contributing to WordPress. This is important because it means a lot of individuals are probably closer to the 5% goal than they might realize.</p>\n<h2>The Impact of Contributions</h2>\n<p>One of the first comments to Mullenweg&#8217;s article is a question <a title=\"http://ma.tt/2014/09/five-for-the-future/#comment-578864\" href=\"http://ma.tt/2014/09/five-for-the-future/#comment-578864\">asked by bftrick</a>, &#8220;I like the idea of having a full-time employee that works on WordPress core but I think Id rather have everyone on board and contributing 5% of their time. What do you think about that?&#8221; Mullenweg&#8217;s response is as follows:</p>\n<blockquote><p>Any percent that people can pitch in is fantastic! Some tasks divide into smaller pieces better than others, Im sure over time youll find the balance that maximizes your impact. That actually brings up a good point, its good to look at what impact youre having  Ive seen companies dedicate a person full-time that hasnt really had a big impact, and people working just a few hours a week that have had a big one. Look at the outcomes and results of what you contribute objectively, and if its not working try something different.</p></blockquote>\n<p>I find it fascinating that some companies devoting time and effort to work on WordPress can end up having little impact. Mullenweg&#8217;s comment is a good reminder to look at the impact your contributions are having.</p>\n<h2>The Value of Contributions</h2>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/ValueOfContributions.png\" rel=\"prettyphoto[31765]\"><img class=\"aligncenter wp-image-31792 size-full\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/ValueOfContributions.png?resize=641%2C222\" alt=\"Value Of Contributions\" /></a></p>\n<p>After years of being involved in the community, it&#8217;s my understanding that every contribution counts no matter how small it is. In December of 2013, I explainedwith the help of a few mentors, <a title=\"http://wptavern.com/i-contributed-to-the-core-of-wordpress-and-you-can-too\" href=\"http://wptavern.com/i-contributed-to-the-core-of-wordpress-and-you-can-too\">how I contributed to the core</a> of WordPress for the first time. I corrected a typo inside the default theme. I&#8217;d almost classify this as an indirect contribution but since it deals with the core of WordPress, I consider it a direct contribution. Due to the typo I fixed, my name was added to the credits page of WordPress 3.8.</p>\n<p>There are hundreds of ways for people to contribute to WordPress but few that receive public acknowledgement. This is one of the reasons why badges have been added to WordPress.org user profiles.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/04/wordpress-profile.png\" rel=\"prettyphoto[31765]\"><img class=\"aligncenter size-full wp-image-20468\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/04/wordpress-profile.png?resize=1025%2C460\" alt=\"wordpress-profile\" /></a>If you&#8217;ve organized or have spoken at a WordCamp, which I classify as an indirect contribution, you&#8217;ll be publicly acknowledged with a badge.</p>\n<p>On the surface, all contributions to WordPress no matter how small appear to be valued equally. However, WordPress is code that is written and maintained by humans. If direct contributions from volunteers decline to nothing, all of the indirect contributions become a moot point. While I think writing about WordPress is definitely a worthy contribution to the project, the reality is, <em>code is what gets the job done</em>.</p>\n<h2>Contributing Back to WordPress Just Makes Sense</h2>\n<p>While Automattic makes a significant contribution to the WordPress project, I&#8217;d hate to see it become the <strong>only</strong> large contributor. Development of WordPress 4.1 is being <a title=\"http://wptavern.com/meet-john-blackbourn-wordpress-4-1-release-lead\" href=\"http://wptavern.com/meet-john-blackbourn-wordpress-4-1-release-lead\">lead by John Blackbourn</a>, who is employed by the agency, <a title=\"http://codeforthepeople.com/\" href=\"http://codeforthepeople.com/\">Code For The People</a>. It&#8217;s the second release in a row to be lead by an individual not employed by Audrey Capital or Automattic. This is a welcome trend and something I&#8217;d like to see continue into the future.</p>\n<p>For companies, agencies, and anyone else who rely on WordPress to put food on the table, contributing back to the project seems like common sense. WordPress is 11 years old but if those with a vested interest don&#8217;t contribute back at least 5% as suggested by Mullenweg, there&#8217;s a chance we might not be able to celebrate WordPress&#8217; 21st birthday.</p>\n<h2>Related Material</h2>\n<ul>\n<li>Post Status &#8211; <a href=\"http://www.poststat.us/contribution-culture/\">Contribution Culture </a></li>\n<li>Ben Metcalf &#8211;<a title=\"http://benmetcalfe.com/blog/2014/09/wordpress-what-exactly-do-they-get-for-their-5/\" href=\"http://benmetcalfe.com/blog/2014/09/wordpress-what-exactly-do-they-get-for-their-5/\">The feasibility and governance concerns behind 5% contribution to WordPress Core</a></li>\n<li>Tony Perez &#8211; <a href=\"http://perezbox.com/2014/10/wordpress-the-vision-of-five-and-what-it-means/\">The Vision of Five and What it Means</a>.</li>\n<li>Dries Buytaert &#8211; <a title=\"http://buytaert.net/scaling-open-source-communities\" href=\"http://buytaert.net/scaling-open-source-communities\">Scaling Open Source Communities</a></li>\n<li>Chris Lema &#8211; <a title=\"http://chrislema.com/contribute-to-wordpress/\" href=\"http://chrislema.com/contribute-to-wordpress/\">There Are Many Ways to Contribute to WordPress</a></li>\n</ul>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 03 Oct 2014 05:57:44 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:38;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"WordPress.tv Blog: Build your audience:  Recent WordCamp videos from experienced content creators\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.wordpress.tv/?p=398\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:113:\"http://blog.wordpress.tv/2014/10/03/build-your-audience-recent-wordcamp-videos-from-experienced-content-creators/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2710:\"<p>Building an audience and growing traffic on your blog is an evergreen topic at WordCamps everywhere. Here are some recent videos from <a href=\"http://wordpress.tv/event/wordcamp-cape-town-2013/\" target=\"_blank\">WordCamp Capetown</a> and <a href=\"http://wordpress.tv/event/wordcamp-calgary-2014/\" target=\"_blank\">WordCamp Calgary </a> on how you can raise the profile of your blog with the power of content!</p>\n<h2>How to build an audience in 743 difficult steps</h2>\n<div id=\"v-revo65sd-1\" class=\"video-player\">\n</div>\n<p>Rian van der Merwe shares why it is better to stay away from the easy ways and choose the difficult ways instead, and how a struggling blog with an insignificant number of readers can become not only a source of great joy and expression, but also a source of non-insignificant income.</p>\n<p><a href=\"http://wordpress.tv/2014/10/01/rian-van-der-merwe-how-to-build-an-audience-in-743-difficult-steps/\" target=\"_blank\">View on WordPress.tv</a></p>\n<h2>Finding Your Voice  Learnings From 6 years of Failure</h2>\n<div id=\"v-tS1GsW4N-1\" class=\"video-player\">\n</div>\n<p>In this talk, Ernest Barbaric discusses how  6 years of failure, and trying thousands of tips, tricks and best practices helped him to build an audience and a blog presence and how finally the right words came out through the keyboard, they connected with the right people, traffic quadrupled almost instantly, Publications came knocking and business started coming in from across the globe.</p>\n<p><a href=\"http://wordpress.tv/2014/09/30/ernest-barbaric-finding-your-voice-learnings-from-6-years-of-failure/\" target=\"_blank\">View on WordPress.tv</a></p><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/wptvblog.wordpress.com/398/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wptvblog.wordpress.com/398/\" /></a> <img alt=\"\" border=\"0\" src=\"http://pixel.wp.com/b.gif?host=blog.wordpress.tv&blog=5310177&post=398&subd=wptvblog&ref=&feed=1\" width=\"1\" height=\"1\" /><div><a href=\"http://blog.wordpress.tv/2014/10/03/build-your-audience-recent-wordcamp-videos-from-experienced-content-creators/\"><img alt=\"WordCamp Cape Town 2013 &#8211; Rian van der Merwe &#8211; How to build an audience in 743 difficult steps.mp4\" src=\"http://videos.videopress.com/revo65sd/video-e29d41ae2b_scruberthumbnail_0.jpg\" width=\"160\" height=\"120\" /></a></div><div><a href=\"http://blog.wordpress.tv/2014/10/03/build-your-audience-recent-wordcamp-videos-from-experienced-content-creators/\"><img alt=\"Ernest Barbaric: Finding Your Voice  Learnings From 6 years of Failure\" src=\"http://videos.videopress.com/tS1GsW4N/video-5e3790afbe_scruberthumbnail_1.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 03 Oct 2014 01:32:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"Jerry Bates\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:39;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"WPTavern: 5 WordPress Conferences Taking Place This Weekend\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31778\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"http://wptavern.com/5-wordpress-conferences-taking-place-this-weekend\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5511:\"<p>This weekend is a busy time for WordPress conferences.One event to keep an eye on is WordCamp Tampa. They have been selected as one of the first to participate in a live stream pilot program using new equipment purchased by the WordPress Foundation.</p>\n<p>Depending on the outcome of the experiment at this and other events, live streaming may become a regular feature of future WordCamps. Here&#8217;s a recap of the events taking place this weekend and how you can enjoy some of them from the comfort of your home.</p>\n<h2>PodsCamp</h2>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/08/PodsCampFeaturedImage.png\" rel=\"prettyphoto[31778]\"><img class=\"size-full wp-image-29491\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/08/PodsCampFeaturedImage.png?resize=697%2C284\" alt=\"The First Ever Podscamp\" /></a>The First Ever Podscamp\n<p>PodCamp is being held in Dallas, TX on October 3rd, 2014, a day before <a title=\"http://2014.dfw.wordcamp.org/\" href=\"http://2014.dfw.wordcamp.org/\">WordCamp DFW</a> (Dallas/Fort Worth) with a ticket price of $50. Each ticket grants you access to the event, BBQ for lunch, and direct access to the developers of Pods Framework. This will be the first time every member of the Pods development team will be in the same physical location. There are <a title=\"http://podscamp.org/tickets/\" href=\"http://podscamp.org/tickets/\">12 tickets remaining</a>.</p>\n<h2>PrestigeConf</h2>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/08/PrestigeConfLogo.png\" rel=\"prettyphoto[31778]\"><img class=\"aligncenter size-full wp-image-27630\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/08/PrestigeConfLogo.png?resize=275%2C233\" alt=\"Prestige Conference Logo\" /></a></p>\n<p>Prestige is a <a title=\"http://prestigeconf.com/\" href=\"http://prestigeconf.com/\">new conference </a>taking place on October 3rd-5th, 2014 in downtown Minneapolis, Minnesota and is being organized by Josh Broton and Kiko Doran. Unlike WordCamps, Prestige only has one track and is devoted to the business of WordPress. There are <a title=\"http://prestigeconf.com/tickets/\" href=\"http://prestigeconf.com/tickets/\">17 tickets remaining</a> for October 4th. However, there are 32 tickets remaining at $49 each to view a live stream of the event. Prestige also has a <a title=\"http://prestigeconf.wparmchair.com\" href=\"http://prestigeconf.wparmchair.com\">WP Armchair site</a> to monitor the hashtag assigned to the event.</p>\n<h2>WordCamp DFW (Dallas/Fort Worth)</h2>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/WordCampDallas2014Header.png\" rel=\"prettyphoto[31778]\"><img class=\"aligncenter size-full wp-image-31782\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/WordCampDallas2014Header.png?resize=503%2C265\" alt=\"WordCamp Dallas 2014 Header\" /></a></p>\n<p>For the first time <a title=\"http://central.wordcamp.org/wordcamps/dallas-2009/\" href=\"http://central.wordcamp.org/wordcamps/dallas-2009/\">since 2009</a>, there is a <a title=\"http://2014.dfw.wordcamp.org/\" href=\"http://2014.dfw.wordcamp.org/\">WordCamp being held</a> in the Dallas/Forth Worth area. WordCamp Dallas is a two-day event beginning on October 4th. The first day will have sessions covering various aspects of WordPress while Sunday, October 5th is contributor day. Tickets are sold out but you can keep tabs on the event via <a title=\"http://wcdfw.wparmchair.com/\" href=\"http://wcdfw.wparmchair.com/\">http://wcdfw.wparmchair.com/</a>.</p>\n<h2>WordCamp Ann Arbor</h2>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/10/WordCampAnnArbor2014.png\" rel=\"prettyphoto[31778]\"><img class=\"aligncenter size-full wp-image-31783\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/10/WordCampAnnArbor2014.png?resize=680%2C265\" alt=\"WordCamp Ann Arbor 2014 Header\" /></a></p>\n<p><a title=\"http://2014.annarbor.wordcamp.org/\" href=\"http://2014.annarbor.wordcamp.org/\">WordCamp Ann Arbor</a> is a one day event in downtown Ann Arbor, Michigan near the University of Michigan. For just $12, attendees will have an entire day of sessions to choose from to learn WordPress. It&#8217;s the first event of its kind in for Ann Arbor and tickets are sold out. I&#8217;ll be at this event so if you see me, stop and say hi.</p>\n<h2>WordCamp Tampa</h2>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/10/WordCampTampa2014Header.png\" rel=\"prettyphoto[31778]\"><img class=\"aligncenter size-full wp-image-31784\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/10/WordCampTampa2014Header.png?resize=458%2C225\" alt=\"WordCamp Tampa 2014 Header\" /></a></p>\n<p><a title=\"http://2014.tampa.wordcamp.org/\" href=\"http://2014.tampa.wordcamp.org/\">WordCamp Tampa</a>, Florida, is a two-day event beginning on October 4th. Tickets are sold out but you can watch the event from home if you purchase a <a title=\"http://2014.tampa.wordcamp.org/live-streaming/\" href=\"http://2014.tampa.wordcamp.org/live-streaming/\">live stream ticket</a>. There are 954 tickets remaining at a cost of $5 each. WordCamp Tampa is part of a pilot program to experiment with new equipment purchased by the WordPress Foundation to generate a high quality live stream. Depending on the results of the experiment at this and other events, live streaming may become a common feature at future WordCamps. Alternatively, you can follow along via <a title=\"http://wctpa.wparmchair.com/\" href=\"http://wctpa.wparmchair.com/\">http://wctpa.wparmchair.com/</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 02 Oct 2014 22:33:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:40;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"WPTavern: WPWeekly Episode 164  Interview With Lester GaMerZ Chan\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://wptavern.com?p=31769&preview_id=31769\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"http://wptavern.com/wpweekly-episode-164-interview-with-lester-gamerz-chan\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4336:\"<p>In this episode of WordPress Weekly, <a href=\"http://marcuscouch.com/\" title=\"http://marcuscouch.com/\">Marcus Couch</a> and I travel to Singapore to interview <a href=\"http://lesterchan.net/\" title=\"http://lesterchan.net/\">Lester &#8220;GaMerZ&#8221; Chan</a>. Chan has <a href=\"https://profiles.wordpress.org/gamerz/#content-plugins\" title=\"https://profiles.wordpress.org/gamerz/#content-plugins\">23 different plugins</a> in the plugin directory, amassing an incredible total download count of <strong>12,241,325</strong>! This accounts for approximately <strong>1.6%</strong> of all plugin downloads from the directory.</p>\n<p>Chan explains how he handles support for 23 different plugins and offers suggestions to improve WordPress.org to make providing support easier. One of his suggestions is to give plugin authors the ability to close threads in their plugin&#8217;s support forums. Chan describes what the WordPress scene is like in Singapore and informs us that there a shortage of WordPress developers. Last but not least, he explains his role as &#8220;Tech Guy&#8221; for the <a href=\"http://www.techinasia.com/\" title=\"http://www.techinasia.com/\">Tech In Asia</a> website which is powered by WordPress.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"http://wptavern.com/reader-poll-what-are-your-favorite-features-in-wordpress-4-0\" title=\"http://wptavern.com/reader-poll-what-are-your-favorite-features-in-wordpress-4-0\">Reader Poll: What Are Your Favorite Features In WordPress 4.0?</a><br />\n<a href=\"http://wptavern.com/meet-john-blackbourn-wordpress-4-1-release-lead\" title=\"http://wptavern.com/meet-john-blackbourn-wordpress-4-1-release-lead\">Meet John Blackbourn, WordPress 4.1 Release Lead</a><br />\n<a href=\"http://wptavern.com/ben-gillbanks-announces-the-end-of-timthumb\" title=\"http://wptavern.com/ben-gillbanks-announces-the-end-of-timthumb\">Ben Gillbanks Announces The End of TimThumb</a><br />\n<a href=\"http://wptavern.com/godaddy-and-media-temple-engage-in-strategic-partnership-with-wp101\" title=\"http://wptavern.com/godaddy-and-media-temple-engage-in-strategic-partnership-with-wp101\">GoDaddy and Media Temple Engage in Strategic Partnership With WP101</a></p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href=\"https://wordpress.org/plugins/gravity-forms-personality-quiz-add-on/\" title=\"https://wordpress.org/plugins/gravity-forms-personality-quiz-add-on/\">Gravity Forms Personality Quiz Add-On</a> lets you create simple, un-scored personality quizzes (think Buzzfeed-style quizzes). While there is an official quiz add-on for Gravity Forms, it is focused on graded quizzes like those you might take in school. This add-on lets you easily create quizzes that return a result rather than a grade, like &#8220;How Texan are you?&#8221; or &#8220;What Disney character would you be?&#8221;</p>\n<p><a href=\"https://wordpress.org/plugins/ttt-crop/\" title=\"https://wordpress.org/plugins/ttt-crop/\">TTT Crop</a> This is an easy and fast way to crop any uploaded image into WordPress. No more complicated graphical editors, photos of people without heads, or products with a wrong view. Select the thumbnail, edit the crop area, and save a new thumbnail image.</p>\n<p><a href=\"https://wordpress.org/plugins/family-tree/\" title=\"https://wordpress.org/plugins/family-tree/\">WP Family Tree</a> is a graphically formatted family tree generator for WordPress. Family members are registered as custom post types through which you can manage things such as name, birthday, the person&#8217;s picture, occupation, etc. You can also establish relationship associations, such as who a person&#8217;s mother and father are or their spousal relationship.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, October 8th 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"http://www.wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #164:</strong><br />\n</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 02 Oct 2014 21:21:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:41;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"WPTavern: Matt Mullenweg on Ensuring the Future of WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31712\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"http://wptavern.com/matt-mullenweg-on-ensuring-the-future-of-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:17398:\"<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/matt-mullenweg.jpg\" rel=\"prettyphoto[31712]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/matt-mullenweg.jpg?resize=1024%2C522\" alt=\"Photo by Vladimir Kaladan Petkov\" class=\"size-full wp-image-31713\" /></a>Photo by Vladimir Kaladan Petkov\n<p>Matt Mullenweg made waves this past weekend during his Q&amp;A session at <a href=\"http://wptavern.com/wordpress-beyond-boundaries-a-recap-of-wordcamp-europe-2014\" target=\"_blank\">WordCamp Europe</a> when he strongly advocated the importance of companies contributing back to WordPress. He offered a rule of thumb for companies that benefit from the software and want to invest in the future of WordPress:</p>\n<blockquote><p>I think a good rule of thumb that will scale with the community as it continues to grow is that organizations that want to grow the WordPress pie (and not just their piece of it) <strong>should dedicate 5% of their people to working on something to do with core</strong>  be it development, documentation, security, support forums, theme reviews, training, testing, translation or whatever it might be that helps move WordPress mission forward.</p></blockquote>\n<p>He cites the <a href=\"http://en.wikipedia.org/wiki/Tragedy_of_the_commons\" target=\"_blank\">tragedy of the commons</a> as an example fate that he hopes WordPress can avoid.</p>\n<p>The <a href=\"http://ma.tt/2014/09/five-for-the-future/\" target=\"_blank\">5% statement</a> was instantly controversial, sparking a number of heated discussions on <a href=\"http://benmetcalfe.com/blog/2014/09/wordpress-what-exactly-do-they-get-for-their-5/\" target=\"_blank\">blogs</a>, <a href=\"http://www.poststat.us/contribution-culture/\" target=\"_blank\">news sites</a>, and Twitter. Some took exception to the wording of his suggestion, as the use of &#8220;should&#8221; implies a moral obligation, complicated further by the fact that the statement originates from a person in a position of power, who many perceive as the person most likely to benefit from increased contributions.</p>\n<p>Granted, Mullenweg is at the helm of what is undeniably the most successful WordPress-based company in operation. Automattic is one of many companies that are entirely reliant on this software for their continued existence. Though all may not benefit equally from contribution, it does not negate the fact that the WordPress project is 100% dependent on contribution and would not exist without it. If we want to see it grow, there must be continued contribution, and in the end it doesn&#8217;t matter if that motivation is practical or ideological.</p>\n<p>Open source businesses are free to act on Mullenweg&#8217;s suggestion of 5% contribution or to throw it out entirely. The issue cuts close to home. It&#8217;s a personal question of philosophy as much as it is a business consideration.</p>\n<p>For Mullenweg, the suggestion of a 5% contribution originates out of a desire to ensure the future of WordPress. The project started out much like your average garage band. Mullenweg <a href=\"http://ma.tt/2003/01/the-blogging-software-dilemma/\" target=\"_blank\">wanted a place to blog and post photos</a>, so with the help of a handful of contributors, WordPress was born. Since the very early days, he has been unwavering when it comes to protecting user freedoms with the GPL and established the project&#8217;s mission to democratize publishing through open source software.</p>\n<p>Before you decide to contribute, it&#8217;s a good idea to consider the future of WordPress. Where does Matt see the project going? Do you want to be a part of taking it there? I had the opportunity to speak with him at WordCamp Europe to press further into his vision of WordPress for the next decade.</p>\n<h2>Mobile</h2>\n<p>You&#8217;ve probably heard it before: mobile is a big part of the future of WordPress. Mullenweg emphasizes this in nearly every recent interview I&#8217;ve read and Automattic is aggressively hiring mobile developers. For many internet users, their mobile device is the only way they access the web. This is particularly true for users in countries like <a href=\"http://en.wikipedia.org/wiki/List_of_countries_by_number_of_mobile_phones_in_use\" target=\"_blank\">China and India</a>. If WordPress is to gain penetration in these geographical regions, it must provide a solid mobile experience.</p>\n<p>This puts the WordPress mobile apps in a singular place of influence, which results in a bit of controversy at the moment. Currently, the apps are packed full of WordPress.com features that provide functionality beyond the core publishing experience. Many self-hosted WordPress users <a href=\"http://wptavern.com/poll-who-uses-reader-in-the-wordpress-mobile-apps\" target=\"_blank\">find the Reader in particular to be irrelevant</a>.</p>\n<p>Mullenweg explained Automattic&#8217;s approach to the mobile apps:</p>\n<blockquote><p>The goal with the mobile apps is first and foremost to get as many mobile app users as possible, because I think that ensures WordPress development for years to come. They are open source projects and people can contribute code to make them do a lot of different things. The team is focused on developing the things that will be most compelling to people on the mobile side. That&#8217;s notifications, stats, and the reader.</p></blockquote>\n<p>Since the apps are open source, developers can fork them and remove unwanted features if they want to. However, this seems a bit counterintuitive for self-hosted WordPress users who don&#8217;t use WordPress.com features. The recent <a href=\"http://wptavern.com/wordpress-com-publishes-first-ever-video-ad-entitled-welcome-home\" target=\"_blank\">video ad</a> produced by Automattic does not put the spotlight on the Reader but rather features the mobile apps in use for publishing media. Won&#8217;t people be using the publishing features more often than the Reader? Mullenweg doesn&#8217;t think so.</p>\n<blockquote><p>By definition, people read more than they write. You read far more than you write.  The average blogger doesn&#8217;t post every day. They read blogs every day. In fact, they read WordPress blogs every day, over a billion per month. By connecting more of those to the active users with this thing we call WordPress, I think it opens the door for more publishing in the future, which is really exciting.</p></blockquote>\n<p>The apps are technically open source. If there&#8217;s a strong contingency of developers who don&#8217;t agree with the preeminence of WordPress.com&#8217;s Reader in the app, they can work to change that through contribution. The reality is that mobile developers are few and far between. At the moment, Automattic drives nearly 100% of the contribution on the apps and its agenda is unrivaled. These apps wouldn&#8217;t exist without the company&#8217;s contributions.</p>\n<p>I asked Mullenweg if other contributing commercial entities are free to push their own features through the official mobile apps. &#8220;Yeah they could,&#8221; he said, but followed it up with more insight on what he believes to be Automattic&#8217;s role in the mobile apps:</p>\n<blockquote><p>I think that in many ways, Automattic is a shepherd. When you type in WordPress into a search engine, we&#8217;re the thing that pops up first. We&#8217;re the gateway drug, the thing that brings in the billions of people who don&#8217;t use WordPress yet. That&#8217;s our responsibility.</p></blockquote>\n<p>He believes that, as more users easily gain access through WordPress.com, it will mean a greater number of those who transition to self-hosted sites, as people graduate from the service. &#8220;We&#8217;ll even help them move on,&#8221; he said. Obviously, you cannot simply download PHP files to your phone and get started.</p>\n<p>&#8220;We want you to be able to start a blog and engage with the world of blogging 100% from the mobile device,&#8221; he said. &#8220;That requires WordPress.com and Jetpack features. Will it forever? Maybe not, but, as an idealist in a practical world, while that is not what I&#8217;d choose as a perfect solution &#8211; I&#8217;d love for you to be able to run WordPress on your phone and the world could access it, but that&#8217;s not reality today.&#8221;</p>\n<p>So why doesn&#8217;t Automattic simply rename the apps to reflect the fact that the it heavily features WordPress.com? &#8220;We could rename it to WordPress.com App, but then there would be no WordPress app.&#8221; Automattic only has 15 mobile engineers at present and there aren&#8217;t many on the outside lining up to contribute to the open source apps. For Mullenweg, the ease of starting a free blog via the app is something that will help to ensure the future of WordPress:</p>\n<blockquote><p>It&#8217;s difficult to build an open source thing on a closed source platform. I see it as a gateway drug and it gives people more options down the road. If we don&#8217;t do anything on mobile, five years from now, when everyone is only using mobile devices, they will all have Squarespace&#8217;s or Weebly&#8217;s. WordPress is still around but it just doesn&#8217;t matter. This allows us to matter five years from now.</p></blockquote>\n<p>Mullenweg sees the apps as an easy onramp to the WordPress software in general, but recognizes that the method isn&#8217;t the most ideal situation for everyone. &#8220;The direction we&#8217;re moving is to make them more modular, so people can fork the apps more easily in the future,&#8221; he said. &#8220;If you talk to anyone on the mobile team, you will find a passion for open source.&#8221; This means that there&#8217;s the potential for the focus of the app&#8217;s development to change in the future.</p>\n<h2>Internationalization and Global Adoption</h2>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/wp-croatia-serbia-slovenia-communities.png\" rel=\"prettyphoto[31712]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/10/wp-croatia-serbia-slovenia-communities.png?resize=1025%2C509\" alt=\"Croatian, Serbian and Slovenian WP communities with @photomatt @nacin at #WCEU - photo credit: Konstantin Tatar\" class=\"size-full wp-image-31716\" /></a>Croatian, Serbian and Slovenian WP communities with @photomatt @nacin at #WCEU &#8211; photo credit: Konstantin Tatar\n<p>WordCamp Europe is unique in that it brings together many WordPress users whose primary language is not English. Mullenweg could not hide his excitement about the recent and upcoming changes related to internationalization. &#8220;If WordPress is representative of the world, then English should be a minority of the interactions, contributions and even plugins,&#8221; he said, and remarked further on how we&#8217;re still in the old mindset of taking English plugins and themes and then translating them into another language.</p>\n<blockquote><p>Personally, I am far and away most excited about the internationalization improvements, because the fact that WordPress has that many users at all in these other languages where there&#8217;s not very much documentation, no plugins, very few themes, it&#8217;s kind of amazing. Basically we have lots of usage in other countries but it&#8217;s primarily built by English-speaking people. So when that starts to change to where you can, for example, login to your dashboard in Spanish, installation, plugins and themes in Spanish, I think it could substantially change WordPress&#8217; adoption rate.</p></blockquote>\n<p>He believes that internationalization improvements will be key to improving WordPress&#8217; global adoption and may perhaps be more of an influential factor than the software&#8217;s incremental improvement on features:</p>\n<blockquote><p>Honestly, incremental features in WordPress probably aren&#8217;t going to change its adoption rate (the number of people starting a WP blog every day). At this point, that&#8217;s primarily driven by our reputation and existing users. What will substantively change that is if WordPress opens up to vastly more audiences than it was before, be that platforms, languages, or cost. At the moment WordPress.com is free but it&#8217;s not fully available to all languages.</p></blockquote>\n<p>WordPress already receives many contributions from contributors who do not speak English as their first language. Mullenweg believes it may be quite a ways down the road from now before WordPress core development requires translators to effectively incorporate contributions from what may someday be a larger contingency of non-English speaking lead developers.</p>\n<p>&#8220;Maybe there&#8217;s a full-time translator working with Nacin,&#8221; he commented, imagining how internationalization could change the project in the future. With WordPress fully opened up to more languages, the software has the potential to improve at an exponentially faster rate than it does now. It&#8217;s an exciting prospect to consider.</p>\n<h2>The Value of Experimentation</h2>\n<p>In his quest to ensure the future of WordPress, Mullenweg often looks outside of the project for inspiration. He&#8217;s devoted a team at Automattic to experimenting with non-WordPress technologies. This was the team that created the <a href=\"http://wptavern.com/automattics-planned-gravatar-app-morphs-into-a-selfies-app-for-android\" target=\"_blank\">Selfies app</a>, released earlier this year.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/07/selfies.jpg\" rel=\"prettyphoto[31712]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/07/selfies.jpg?resize=582%2C267\" alt=\"selfies\" class=\"aligncenter size-full wp-image-26965\" /></a></p>\n<p>The app wasn&#8217;t built on WordPress and didn&#8217;t appear to be as polished as other Automattic products. I asked Mullenweg why they chose to release the app in its unpolished state. He highlighted the importance of experimentation:</p>\n<blockquote><p>One thing that&#8217;s difficult in a company, as it grows, is to not just work on the thing that&#8217;s most successful. WordPress, WordPress.com, Jetpack, these are ridiculously successful by any measure. It would be very easy for all 272 people at Automattic to only work on that. One of the things we did this year is create a team that is almost like our version of Google X, except we&#8217;re not going to space. As a smaller company our ambitions are a little more modest, but we do want that sense of experimentation, and that it&#8217;s ok to release something that&#8217;s not 100% polished.</p></blockquote>\n<p>This further clarifies the release of the Selfies app, which the team presented as an accident wherein the planned Gravatar App morphed into Selfies. &#8220;There&#8217;s no one working on a Gravatar app right now,&#8221; Mullenweg said, confirming that the idea was considered and then scrapped. What they learned in the process was more valuable than delivering on the original idea.</p>\n<blockquote><p>Usage is oxygen for ideas, right? The things that we know and learn by releasing stuff, we never could have learned otherwise, so look for more of that. That team has lots of things planned &#8211; their charter is specifically not to do things that integrate with WordPress. I&#8217;d love for it to be a much larger team, actually.</p></blockquote>\n<p>This spirit of experimentation is what sets Automattic apart from many other companies that simply focus on their successful products. Perhaps it will someday translate into technology that can work alongside WordPress, especially when the software adopts more modern APIs.</p>\n<h2>The Mission</h2>\n<p>In recent press, Automattic has received considerable attention due to the fact that the company doesn&#8217;t work from one centralized office. The idea is brand new to those who have only experienced more traditional workplaces. I asked Mullenweg what he believes is truly unique about his company. He cited a few things, such as the hiring process, the reliability of WordPress.com&#8217;s technical architecture, the dedication to experimentation. But in the end, for him, everything loops back around to the mission of democratizing publishing.</p>\n<blockquote><p>I don&#8217;t think there&#8217;s anything that doesn&#8217;t exist in any other company. Obviously we&#8217;re really deeply involved with WordPress. So is 10up and many other WP consultancies. We do a ton of open source but so does Canonical, Acquia, Redhat, and everyone else. I think it&#8217;s just the combination of all of these things, the truly distributed nature, and the mission, which isn&#8217;t just about bottom lines. It has an altruistic aspect as well.</p></blockquote>\n<p>Mullenweg&#8217;s <a href=\"http://ma.tt/2014/09/five-for-the-future/\" target=\"_blank\">Five for the Future</a> post compelling open source companies to strive to contribute 5% back to the core software is a hotly debated topic in the WordPress ecosystem right now. Those who do not share the same practical convictions or altruistic ideals feel that the idea comes with an implication of people &#8220;working for free.&#8221; The folks at Automattic are hoping to lead the way in proving that commercial success can go hand-in-hand with an altruistic mission. For Mullenweg, it&#8217;s part of a larger vision and an unwavering commitment to ensure the future of WordPress for all.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 02 Oct 2014 18:31:08 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:42;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"Matt: Singapore Suites Class\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44174\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://ma.tt/2014/10/singapore-suites-class/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1153:\"<p>Derek Low on What It&#8217;s like to Fly the $23,000 Singapore Airlines Suites Class [link removed, see end]. I&#8217;ve been on the <a href=\"http://thepointsguy.com/2014/01/flight-review-emirates-first-class-a380-dubai-new-york-jfk/\">Emirates First Class A380 with the shower before</a>, but this looks like an entirely other level. I also must confess I think Emirates has rather gaudy design. <a href=\"http://www.svenblogt.de/review-first-class-airbus-a330-with-swiss-air/\">The best I&#8217;ve seen design-wise is actually from Swiss Air</a>, as you&#8217;d expect. Update: Apparently the original link <a href=\"http://www.reddit.com/r/singapore/comments/2huw34/what_its_like_to_fly_the_23000_singapore_airlines/\">borrowed pretty heavily</a> from another blogger, so here are links to the original author&#8217;s posts: <a href=\"http://andystravelblog.com/2013/04/22/sia-singapore-airlines-suites-class-a380-frankfurt-singapore/\">one</a>, <a href=\"http://andystravelblog.com/2013/05/05/singapore-airlines-777-first-class-private-room/\">two</a>, <a href=\"http://andystravelblog.com/2013/05/09/cathay-pacific-first-class-747-hkg-sfo/\">three</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 02 Oct 2014 11:27:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Matt Mullenweg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:43;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"Akismet: September Stats Roundup\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.akismet.com/?p=1705\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"http://blog.akismet.com/2014/10/01/september-stats-roundup/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3608:\"<p><img class=\"alignright wp-image-1716\" src=\"http://akismet.files.wordpress.com/2014/10/akisbot-party1.jpg?w=500&h=291\" alt=\"akisbot-party\" width=\"500\" height=\"291\" />T&#8217;was an exciting month around Akismet headquarters. <strong>We caught over 300 million spam messages in just one day for the first time</strong>, on September 26. And if that wasn&#8217;t enough, we sawover 300 million comments in one dayagain on September 30.</p>\n<p>But wait, there&#8217;s more&#8230; we also broke our daily record a total of 4 times this month. Our last daily record was 269 million spam messages on August 21, here&#8217;s what happened since then:</p>\n<ul>\n<li>We broke the daily record on <strong>September 4th</strong> with 280 million spam comments</li>\n<li>And then again on <strong>September 7th</strong> with 284 million spam messages</li>\n<li>And then again on <strong>September 26th</strong> with the groundbreaking 312 million comments</li>\n<li>And finally, just yesterday &#8211; on <strong>September 30</strong> -we broke our record again with 366 million spam comments</li>\n</ul>\n<p>Phew. What a ride. <span class=\"wp-smiley wp-emoji wp-emoji-mrgreen\" title=\":mrgreen:\">:mrgreen:</span></p>\n<p>There were two other times in Akismet history when we broke the daily record this many times in one month. In November 2011 we broke the daily record 8 times (!) and in December 2012, we broke it 6 times. Though, the numbers were much easier to beat then &#8211; 90 to 100 million daily spam comments in November 2011, and 177 to 196 million in December 2012.</p>\n<p>Here are the daily numbers for September, with the previous record marked for comparison:</p>\n<div id=\"attachment_1719\" class=\"wp-caption alignnone\"><a href=\"http://akismet.files.wordpress.com/2014/10/akismet-spam-and-ham-stats-sept-2014.png\"><img class=\"wp-image-1719 size-large\" src=\"http://akismet.files.wordpress.com/2014/10/akismet-spam-and-ham-stats-sept-2014.png?w=700&h=436\" alt=\"We saw 7,955,568,000 spam comments go through this month, and 357,739,000 real comments.\" /></a><p class=\"wp-caption-text\">We saw 7,955,568,000 spam comments go through this month, and 357,739,000 real comments.</p></div>\n<p>You may have also seen a rise in your own spam comments this month. If you&#8217;re noticing a larger number of comments than usual being missed by Akismet, please do get in touch through <a href=\"http://akismet.com/contact/\">our contact form</a> so we can help out. Let us know what your API key is, and on what website you&#8217;re seeing the increase, and we&#8217;ll be happy to take a look.</p>\n<p>Our slowest day this month was September 14, with a mere 218 million spam comments going through. Compared with September of last year, the number of spam comments going through Akismet increased by 112%, and it increased from last month by 10%. This month, we missed about 1 in every 4,574 spams.</p>\n<p>As usual, real comments make up only a small portion of the total comments we see coming through &#8211; at 4% this month.</p>\n<p><em>This post is part of a monthly series summarizing some stats and figures from the Akismet universe. Feel free to browse <a href=\"http://blog.akismet.com/category/monthly-roundup/\">all of the posts in the series</a>.</em></p><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/akismet.wordpress.com/1705/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/akismet.wordpress.com/1705/\" /></a> <img alt=\"\" border=\"0\" src=\"http://pixel.wp.com/b.gif?host=blog.akismet.com&blog=116920&post=1705&subd=akismet&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 02 Oct 2014 01:00:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"Valerie\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:44;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"WPTavern: WordPress Theme Review Team Gains 27 New Reviewers at WordCamp Europe Contributor Day\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31680\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:105:\"http://wptavern.com/wordpress-theme-review-team-gains-27-new-reviewers-at-wordcamp-europe-contributor-day\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4310:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/10/wceu-contributor-day.png\" rel=\"prettyphoto[31680]\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/10/wceu-contributor-day.png?resize=1025%2C495\" alt=\"wceu-contributor-day\" class=\"aligncenter size-full wp-image-31687\" /></a></p>\n<p>The contributor day following <a href=\"http://wptavern.com/wordpress-beyond-boundaries-a-recap-of-wordcamp-europe-2014\" target=\"_blank\">WordCamp Europe</a> was a tremendous success, bringing approximately 180 people to the <a href=\"http://www.siteground.com/\" target=\"_blank\">SiteGround</a> offices in Sofia. A healthy mixture of veteran contributors were in attendance, as well as many folks who were brand new to contributing.</p>\n<p>At the beginning of the day, contributors split off into smaller groups to focus on translations, core, documentation, theme review, support, GlotPress, and Rosetta. When Theme Review Team member Tammie Lister put out a call for theme reviewers, hands shot up all over the room. Automattic donates Lister&#8217;s time two or three days per week specifically for helping with WordPress.org theme review.</p>\n<p>After the event, she reported that 27 new people were added to the <a href=\"https://make.wordpress.org/themes/\" target=\"_blank\">WordPress Theme Review Team</a>. They started by introducing themselves and discussing why one might want to get involved. Those who had some experience shared their individual processes. After this, they dove straight into reviewing and each person was given a theme.</p>\n<p>&#8220;The current idea is that during the month of October we will be focusing on how we do contribution days now, so we&#8217;re having experiments and thinking about ways to improve that,&#8221; Lister said. During the last <a href=\"https://make.wordpress.org/themes/2014/09/24/weekly-meeting-notes-2/\" target=\"_blank\">weekly meeting</a>, the Theme Review Team identified the pain points in adding reviewers and brainstormed ideas for onboarding new reviewers during contributor days. This includes the possibility of creating a doing_it_wrong() theme, as a project at WordCamp San Francisco, that can be used for education and testing. Lister said they will be playing with a few ideas at upcoming contribution days in San Francisco and Toronto.</p>\n<h3>A Room Full of Themers</h3>\n<p>The best part of getting a record number of new reviewers together was packing a room full of themers who were all buzzing about the craft of WordPress theming. &#8220;What was really exciting about today is that it wasn&#8217;t just developers,&#8221; Lister said. &#8220;We had some people who didn&#8217;t know much HTML, some who were newer to theming, and some who were doing it the right way.&#8221;</p>\n<p>The key thing for new reviewers is to take your time, Lister said. &#8220;I think the thing is that you just have to take it slowly when you start theme reviewing. You go through the process and you get faster.&#8221;</p>\n<p>New reviewer <a href=\"https://twitter.com/andrew_liyanage\" target=\"_blank\">Andrew Liyanage</a> decided to jump in and join the Theme Review Team in order to sharpen his professional skills. &#8220;I wanted to get into theme design. I thought before designing a theme, I could get into review in order to get to know what the do&#8217;s and the don&#8217;ts are,&#8221; he said. &#8220;I&#8217;m already reviewing a theme right now, and it&#8217;s going better than I thought it would.&#8221;</p>\n<p>Lister plans to match each new reviewer with someone from the new <a href=\"http://wptavern.com/wordpress-theme-review-team-to-launch-mentoring-program\" target=\"_blank\">mentoring program</a>, established last month. Although most of the communication happens on trac, there are more people than ever to help out with the process.</p>\n<p>&#8220;A lot of it is trac focused, because it has to be, but we now have mentors, more admins, and trusted reviewers. So there&#8217;s a lot more people but there&#8217;s a lot more people looking after those people,&#8221; Lister said.</p>\n<p>With a record number of new theme reviewers added in one day, the team now has 27 more people who are familiar with the guidelines. This is bound to make a significant dent in the queue and lighten the load for the rest of the team.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 01 Oct 2014 09:52:09 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:45;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"Post Status: Contribution as culture\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"http://www.poststat.us/?p=7153\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://www.poststat.us/contribution-culture/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:12488:\"<p><img class=\"aligncenter size-large wp-image-7157\" src=\"http://www.poststat.us/wp-content/uploads/2014/10/five-percent-752x250.gif\" alt=\"five-percent\" width=\"627\" height=\"208\" /></p>\n<p><em>This post spends a lot of time analyzing and referencing two other blog posts. Excuse me for that, but also be sure to read both, as they are relevant for this post and also interesting in their own right.</em></p>\n<p>Matt Mullenweg wrote a blog post called <a href=\"http://ma.tt/2014/09/five-for-the-future/\">Five for the Future</a> yesterday that advocates his belief that WordPress-centric companies should aim to utilize 5% of their company resources toward contributing back to the project.</p>\n<p>He noted in the post that <a href=\"http://automattic.com\">Automattic</a> isn&#8217;t quite to this point, but that they are working on it, and describes why he believes it&#8217;s important. He closes with this:</p>\n<blockquote><p>Its a big commitment, but I cant think of a better long-term investment in the health of WordPress overall. <strong>I think it will look incredibly modest in hindsight.</strong> This ratio is probably the bare minimum for a sustainable ecosystem, avoiding the <a href=\"http://en.wikipedia.org/wiki/Tragedy_of_the_commons\">tragedy of the commons</a>. I think the 5% rule is one that all open source projects and companies should follow, at least if they want to be vibrant a decade from now.</p></blockquote>\n<p>This was followed up by one of the co-founders of one of the very hosting companies Matt partially referenced in his post &#8212; WP Engine&#8217;s Ben Metcalfe &#8212; who responded with a blog post of his own:<a href=\"http://benmetcalfe.com/blog/2014/09/wordpress-what-exactly-do-they-get-for-their-5/\">WordPress: What exactly do they get for their 5%?</a></p>\n<p>I think I was immediately thrown off by Ben&#8217;s post title, but so many times throughout reading it I was shocked at how he made assumptions of Matt&#8217;s intentions or missed what I would call &#8220;the point&#8221;.</p>\n<h3>5% is not a decree</h3>\n<p>Obviously, Matt is not speaking from the mountaintop with a proclamation of law. This is his recommendation &#8212; one that he believes will reward the firms that strive for it.</p>\n<p>I believe thatthe community has already shown us that those that invest into WordPress are rewarded from it. We improve our understanding of a foundational software of our careers, improveour skills, are more marketable, more attractive to employers, and create natural opportunities for developing industry relationships.</p>\n<p>How should5% of &#8220;people&#8221; be defined? I&#8217;m pretty sure Matt would agree that 5% of people or 5% of revenue toward people doesn&#8217;t really matter to him; yet Ben makes a continuous sticking point about the cost of &#8212; and need for &#8212; engineers.</p>\n<p>Additionally, while Matt utilizes full-time employees, the same (or better) effect could be had with shared time from more employees.</p>\n<p>I&#8217;m not biginto absolutes, so it&#8217;s important to remember that while I&#8217;m advocating that Matt&#8217;s recommendation of 5% time, I think it&#8217;s simply a good recommendation. This is a free economy and companies can do what they want. But I think in the current and long term, contribution will be key to greater corporate success for those that choose to do so.</p>\n<h3>What does 5% cost, and who does it require?</h3>\n<p><span id=\"more-7153\"></span></p>\n<blockquote><p>While Matt was careful to include numerous non-engineering roles companies could help with, ultimately what drives the open source project is source code contribution by software engineers. &#8230;</p>\n<p>A reasonable engineer in the US costs $100k/y, and if you factor in benefits <em>(tax funded health-care, anyone?)</em> and overheads you could easily be looking at $130k or more per person, per year.&#8230;</p>\n<p>A 200+ person web hosting company would need to hire 10 engineers to meet a 5% goal, requiring a budget of anything between $1MM-1.3MM+ per year. Those engineers probably need a manager  to mentor them, provide career development etc. Those 11 people also put pressure on human resources, finance, legal, facilities etc  probably equating to another person again. Now were talking probably more like $1.25-$1.5m annually.</p></blockquote>\n<p>First, I believe Ben has spent too much time in the world&#8217;s largest cities if he believes engineerscost $100,000 per year on average. In my experience (yes, I interview people myself), that&#8217;s not the case, and based on my decent view of the ecosystem it&#8217;s not an appropriate going rate &#8212; especially if the offer on the tableis a particularly desirable position.</p>\n<p>More importantly, <strong>the project needs far more non-technical contributors</strong>. Ben&#8217;s assertion that &#8220;ultimately&#8221; software engineers drive the project is not true. Users drive the project. A technically savvy user-minded contributor can be a beacon of light to a group of software developers. And given the user-facing nature of WordPress itself, non-engineercontributors could drastically improve the less code-sexy parts of the WordPress ecosystem: project management, docs, training, testing, support, translation, etc.</p>\n<p>Additional to &#8220;core&#8221; contributions, WordCamps, plugins, themes, communities, and many other venues are outstanding places where contributors &#8212; yes, they&#8217;re still contributors! &#8212; can impact the overall project.</p>\n<p>Finally, as I noted above, I think companies could quite effectively contribute parts of employees&#8217; time versus dedicated 100% time, which would also prevent the need to have dedicated managers for open source contributors.</p>\n<h3>Foundational software to your business</h3>\n<p>Ben spends a chunk of time saying that big companies like GoDaddy get a &#8220;get out of jail free card&#8221; and that obviously Matt wouldn&#8217;t expect they dedicate 5% of their thousands of employees.</p>\n<p>GoDaddy definitely benefits from WordPress and they also contribute to it; and no, they don&#8217;t contribute 5% I&#8217;m sure. But WordPress is not foundational to GoDaddy&#8217;s business. They have a dedicated sub-product for it, and they also have many contributors to it.</p>\n<p>WP Engine, and many others (including mine), are almost completely or completely reliant on WordPress as a platform. WordPress and its underlying technologies are foundational to our careers and businesses.</p>\n<p>It is simply a different story to compare a company that would continue on pretty much fine without WordPress and one that would have to seriously reconsider their entire business model.</p>\n<p>For example, let&#8217;s compare the scenario to a publisher. <a href=\"http://recode.net\">Re/code</a> is built on WordPress. They have a staff of 20+. Do they <em>completely rely</em> on WordPress for their website? Yes. For their business model? No. In their scenario, it makes sense for them &#8212; and could benefit them pretty directly &#8212; to allocate some time of some employees to WordPress, but if WordPress disappears they can and will migrate to a different platform.</p>\n<h3>Contributing to the full stack</h3>\n<p>It was questioned to me on Twitter, after my initial reaction to Ben&#8217;s post, whether I contribute 5% of my time to open source projects like PHP, MySQL, and other tools that WordPress relies on.</p>\n<p>This is a good question and point, but it does not cause meto stumble in my opinions. I believe open source contributions in general benefit the entire software stack.</p>\n<p>In my scenario, I can be more impactful on the WordPress project than others. But I believe contributions can take many shapes, in both directions.</p>\n<p>Some folks, like Daniel Bachhuber, greatly contribute tothe project as a whole by supporting upstreamprojectslike <a href=\"http://wp-cli.org\">WP CLI.</a></p>\n<p>Automattic is a fantastic example of a company that has both upstream and downstream contributions. They are active contributors to, employers of contributors or founders, or monetary sponsors to a huge number of downstream projects: WordPress, PHP, Nginx, jQuery, Elastic Search, Node, Socket.io, and probably a bunch I can&#8217;t think of or don&#8217;t know about. Additionally, they are adriving force behind dozens of upstream, open source themes and plugins.</p>\n<p><em>Edit: Matt <a href=\"https://twitter.com/photomatt/status/517270097355091968\">says in a Tweet</a> where Andrey Savchenko asked for clarification about PHP contributions that Automattic doesn&#8217;t actively contribute to PHP. Though I think I define contribution a bit more loosely than Matt does.</em></p>\n<p>Whether a company is contributing to their foundational piece of software, a downstream or upstream application, or on an adjacent aspect that leads to the betterment of the platform that is foundational to their business objectives, then I believe it will in turn be beneficial to their bottomline.</p>\n<h3>Contribution as culture</h3>\n<p>Contribution should not be considered an isolated cost, but an enabling investment.</p>\n<p>If I run a business that relies on a foundational piece of software like WordPress, then it benefits me greatly for my employees &#8212; no matter what role they play within the company &#8212; to be intimately familiar with that software.</p>\n<p>In my last job, I was tasked with guiding a transition of my company from developing mostly on a proprietary CMS to WordPress. I consistently preached the importance foreveryone in the company to understand some fundamentals of WordPress itself. During my time there and since I&#8217;ve moved on, I&#8217;ve seen other members of that company learn the software, get involved in our local community, and even contribute back to WordPress itself; and both they and the company are better off for it.</p>\n<p>Whether an employee is in sales, customer service, design, development, management, or wherever else &#8212; every employee knowing your product is important. I firmly believe this. I would want anyone in an organization I&#8217;m part of to be able to discuss our product in detail and with confidence to anyone.</p>\n<p>When your company relies on a foundational piece of software &#8212; such as those we&#8217;re discussing in this post &#8212; that&#8217;s in effect part of your product. We are building products and services around and for WordPress. How important should it be that our company&#8217;s employees understand it?</p>\n<p>And how can they understand it better? By contributing of course!</p>\n<p>Have a new support rep? Show them the WordPress.org forums to get their feet wet. New designer or front-end developer? Have them sit in on default theme conversations or read through the Make UI blog. New sales person? Get them involved atyour local meetup and WordCamp. This list can go on.</p>\n<p>Avenues for contribution are an incredible gateway for learning WordPress. Blogging about WordPress (another avenue of contribution) has greatly enabled me to be better at my job, and therefore made me significantly more valuable to the companies I&#8217;ve worked with.</p>\n<h3>Five for now</h3>\n<p>Matt called his post Five for the Future, and talked specifically about how a 5% investment by a company will ensure a greater future for WordPress and therefore said company. I disagree.</p>\n<p>Contributing now will benefit the company and its employees <em>right now</em>. And while both Matt and Ben focused on individualswithin the company being targeted contributors, I think it&#8217;s much more beneficial to have a much larger percentage of a company contributing a portion of their time (even if small). I&#8217;d rather see 2 of 200 employees be full time contributors and then have 80 10% contributors than have 10 full time contributors.</p>\n<p>I think we&#8217;ve seen many, many examples of contributors (people and companies) reaping tangible and intangible benefits from when they contribute &#8212; whether that contribution is to the codebase or the community. Contributors in this ecosystem come out on top.</p>\n<p>Contributions are not an isolated cost or burden. Nor should their effects be limited to good faith investments to the sustainability of the ecosystem.</p>\n<p>Contributions benefit the bottom line, and they benefit the bottom line right now.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 01 Oct 2014 06:17:08 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:46;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"WPTavern: Interview With Stream Project Lead, Frankie Jarrett\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31664\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"http://wptavern.com/interview-with-stream-project-lead-frankie-jarrett\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9745:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/09/FrankieJarretFeaturedImage.png\" rel=\"prettyphoto[31664]\"><img class=\"aligncenter size-full wp-image-31673\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/09/FrankieJarretFeaturedImage.png?resize=651%2C246\" alt=\"Frankie Jarrett Featured Image\" /></a></p>\n<p>Stream 2.0 is a <a title=\"http://wptavern.com/stream-morphs-from-a-plugin-into-a-service\" href=\"http://wptavern.com/stream-morphs-from-a-plugin-into-a-service\">significant update</a> that changes the stand alone plugin into a service. But not everyone is happy with the change. Those who use Stream in enterprise environments have voiced disappointment regarding the latest update. The following is feedback from a user on the <a title=\"https://www.facebook.com/groups/advancedwp/?fref=nf\" href=\"https://www.facebook.com/groups/advancedwp/?fref=nf\">Advanced WordPress Facebook group</a>. &#8220;Heads up if you use Stream. The 2.0 upgrade now stores everything in the cloud instead of the local database and requires a WordPress.com account to use it. It&#8217;s a great plugin but this new functionality is not optional and I can no longer use it with our enterprise data.&#8221;</p>\n<p>I reached out to Stream project lead, <a title=\"http://frankiejarrett.com/\" href=\"http://frankiejarrett.com/\">Frankie Jarrett</a>, and asked why the team decided to rely on third-party services. I also inquired whether users have any options to house data on their own servers or connect it to a service of their choosing. Jarrett gives insight into the future of Stream as a Service and let&#8217;s us know if they are working on a version that is compatible with enterprise environments.</p>\n<h2>Interview With Frankie Jarrett</h2>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/09/WordPressLogging.png\" rel=\"prettyphoto[31664]\"><img class=\"size-full wp-image-31670\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/09/WordPressLogging.png?resize=640%2C200\" alt=\"WordPRess Logging\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/astro-dudes/1492818224/\">Claire L. Evans</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nd/2.0/\">cc</a>\n<p><strong>Jeff &#8211; Why the decision to use an external service by default to offload Stream activity data?</strong></p>\n<p>Over the past 10 months weve learned a lot about logging events, specifically logging actions taken inside the WordPress Admin. As time went on, some of the biggest concerns we had revolved around the topics of performance and security. It became clear to us that Stream needed to be more than just a plugin to advance into a solid solution, it needed to be a service that was self-contained and lived alongside WordPress instead of trying to force it to work inside the WordPress architecture and never truly being scalable or secure.</p>\n<p>MySQL is nice solution for storing content with simple querying, this is how WordPress uses it, but MySQL is actually bad for storing logs, especially if you want to retain them for a long time and/or run complex queries on them while also expecting those queries to be fast. Not to mention, you dont want the performance of your websites content to be affected at all. Since the primary purpose of the MySQL database is to store and serve up content to your website visitors, it was our view that should never be hindered by event logging.</p>\n<p>Now that Stream is a service, we can use brand new technologies like <a title=\"http://www.elasticsearch.org/\" href=\"http://www.elasticsearch.org/\">Elasticsearch</a>, that are better suited for (and even designed for) querying huge numbers of logs. The result is a more powerful querying performance, the possibility for users to do even more complex queries in the future (for their Reports), and have no worries about keeping logs for a very, very long time. The things we are now doing in Stream 2.0, and plan to do in the future, require the power of Elasticsearch and dont translate into MySQL storage solutions.</p>\n<p>In regards to security, websites and databases get hacked all the time. Unfortunately thats just the way it is. Since all of Streams records had previously lived inside the website, it too was as vulnerable as the website itself. This means that any hacker that gained access could mess up a site and then cover up their tracks by simply deleting the Stream log data. This was a bad thing and meant those logs werent really a true security audit trail at all. Now that Stream is a service, those logs are untouchable by an intruder. Once an action is performed, its forever in the event history, so the site owner knows without a doubt what things have happened on their site and can go through an undo the damage.</p>\n<p><strong>Jeff &#8211; Why the connection between Stream and WordPress.com ID logins?</strong></p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/09/WordPressStreamConnection.png\" rel=\"prettyphoto[31664]\"><img class=\"size-full wp-image-31671\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/09/WordPressStreamConnection.png?resize=639%2C200\" alt=\"WordPress Stream Connection\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/manchester-monkey/5432450932/\">Manchester-Monkey</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-sa/2.0/\">cc</a>\n<p>This was an easy decision for us, actually. Over the past few years there have been several WordPress companies that have had their sites hacked and user passwords have been compromised as a result. Its a sad and unfortunate thing that can be avoided by simply not storing them. Our solution for this was to use SSO (Single sign on) powered by <a title=\"https://wordpress.com/\" href=\"https://wordpress.com/\">WordPress.com</a>.</p>\n<p>This means Stream doesnt have to store any login details for any customer and customers dont have to sign up for yet another account somewhere. Furthermore, <a title=\"http://en.support.wordpress.com/security/two-step-authentication/\" href=\"http://en.support.wordpress.com/security/two-step-authentication/\">WP.com SSO supports two-factor authentication</a>. This is a huge win for folks who are really concerned about the security of their logins, and we wanted Stream to have this capability.</p>\n<p>The reason why we chose WP.com SSO was because of its status and reach in the WordPress community. Stream is a WordPress product and service, so it only makes sense to reach as many WordPress users as possible. When you think about all the people who use Jetpack, Gravatar, Akismet, VaultPress and Polldaddy &#8211; thats a lot of people. Maybe not everyone, but again, we wanted to make a decisive decision not to store user login credentials at all, and that could mean some people might not be able to use it, but its for the good of all our users. WordPress.com SSO was also very easy to implement on our WordPress-powered site compared with the Facebook, Twitter or Google SSO alternatives.</p>\n<p><strong>Jeff &#8211; Is the connection between Stream and WordPress.com similar to Jetpack in that some things wont work without the connection?</strong></p>\n<p>The only time Stream needs to talk to WordPress.com is during sign up, for login credentials. Stream doesnt <em>ping</em> back to your website like Jetpack does. This means your site doesnt have to be publicly accessible for Stream to work and can be run on a local/development environment without any problems or extra steps needed.</p>\n<p><strong>Jeff &#8211; Overall, what are the future plans for Stream now that its morphed into a service?</strong></p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/09/FutureOfStream.png\" rel=\"prettyphoto[31664]\"><img class=\"size-full wp-image-31672\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/09/FutureOfStream.png?resize=639%2C200\" alt=\"Future of Stream\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/wwarby/9641216546/\">wwarby</a> &#8211; <a href=\"http://creativecommons.org/licenses/by/2.0/\">cc</a>\n<p>Now that we have some scalability, performance and security milestones behind us, we are very much looking forward to making Stream even better in the coming months and years. You might have already noticed, but Stream 2.0 featured built-in integration with eight popular WordPress plugins. We intend to continue making Stream compatible out-of-the-box with tracking things that many other popular plugins do.</p>\n<p>Another thing we plan to do is open up a <strong>REST API</strong> for people to be able to access their data and do anything they want with it. This is a very exciting prospect. Finally, we are working on ways to have a complete mash-up of all of your Stream data in one place. This is based on a lot of feedback weve been getting from folks who run not just multi-site, but multiple single-site installs for their clients and want to see everything thats happening in one place. We think that will be another huge benefit to people and something that is only possible because Stream is now a service.</p>\n<p><strong>Jeff &#8211; One of the complaints I&#8217;ve seen is that Stream&#8217;s reliance on third-party services makes it incompatible with enterprise environments. What is the team doing to address this issue?</strong></p>\n<p>The new Stream relies on the power of Elasticsearch for performance and complex queries, but we are exploring ways for the Stream service stack to be run <em>on-premise</em> for Enterprise organizations who have strict internal policies that would require that. We dont have have an ETA on when this type of solution will be ready, but we are actively pursuing it.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 01 Oct 2014 04:07:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:47;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"WPTavern: Stream Morphs From a Plugin Into a Service\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31615\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"http://wptavern.com/stream-morphs-from-a-plugin-into-a-service\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6231:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2013/12/stream-banner.jpg\" rel=\"prettyphoto[31615]\"><img class=\"aligncenter size-full wp-image-12902\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2013/12/stream-banner.jpg?resize=772%2C250\" alt=\"stream plugin banner\" /></a></p>\n<p>Stream 2.0 is <a title=\"https://wp-stream.com/the-new-stream-is-here/\" href=\"https://wp-stream.com/the-new-stream-is-here/\">available for download</a> and includes a plethora of enhancements. This version features a rewrite from the ground up with a focus on <em>scalability, security</em>, and <em>activity</em>. As part of the rewrite, Stream activity data is stored in the cloud using <a title=\"http://aws.amazon.com/\" href=\"http://aws.amazon.com/\">Amazon Web Services</a> with <a title=\"http://www.elasticsearch.org/\" href=\"http://www.elasticsearch.org/\">Elasticsearch</a>. This is the same type of setup Jetpack uses to power its <a title=\"http://jetpack.me/support/related-posts/\" href=\"http://jetpack.me/support/related-posts/\">Related Posts</a> module.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/09/ConnectToStream.png\" rel=\"prettyphoto[31615]\"><img class=\"size-full wp-image-31654\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/09/ConnectToStream.png?resize=989%2C120\" alt=\"Connect To Stream Service\" /></a>Request For a WordPress.com ID\n<p>The data is stored over an SSL connection making it hard to tap into your activity stream. The Stream team explains the plugin as being the <em>black box</em> of a WordPress site that even the NSA can&#8217;t penetrate. As part of the security enhancements, <span class=\"wp-stream-tooltip\">Stream uses your WordPress.com ID to authorize your account. </span></p>\n<p><span class=\"wp-stream-tooltip\">After connecting my WordPress.com ID to Stream, it loaded a <a title=\"https://wp-stream.com/pricing/\" href=\"https://wp-stream.com/pricing/\">Plans and Pricing page</a> in place of the backend instead of just connecting my account. This is unexpected behavior and a disappointing user experience. I ended up having to load the WordPress backend in a new browser tab. </span></p>\n<p>I ran into a loop where each time I logged into the backend of WordPress, I&#8217;d see the <strong>Connect to Stream</strong> notification. Each time I clicked the button, it would load the Plans and Pricing page. As it turns out, the reason for the endless loop is because I didn&#8217;t have a subscription registered with the Stream website. Once I completed the process of registering for a free account, the WordPress backend loaded the Stream records screen.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/09/SuccessfulConnectionToStream.png\" rel=\"prettyphoto[31615]\"><img class=\"size-full wp-image-31655\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/09/SuccessfulConnectionToStream.png?resize=765%2C336\" alt=\"Successful Connection To Stream\" /></a>Successful Connection To Stream\n<p>I recommend text be added to the top of the Plans and Pricing page. The text should explain that in order to complete the connection to Stream, a subscription plan needs to be selected. It&#8217;s not obvious and gave me the impression the plugin is broken.</p>\n<h2>Support For SMS Notifications Thanks to an Outside Source</h2>\n<p>One of the neat features in 2.0 is the ability to set up SMS notifications. For instance, every time a theme, plugin, or WordPress is updated, you can configure Stream to send you a text message.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/09/ConfiguringSMSNotifcations.png\" rel=\"prettyphoto[31615]\"><img class=\"size-full wp-image-31656\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/09/ConfiguringSMSNotifcations.png?resize=1025%2C552\" alt=\"Configuring SMS Notifications In Stream\" /></a>Configuring SMS Notifications In Stream\n<p>SMS notifications ended up in 2.0 thanks to the contributing efforts of <a title=\"https://jeffmatson.net/\" href=\"https://jeffmatson.net/\">Jeff Matson</a>. Matson is the author of the <a title=\"http://wordpress.org/plugins/wp-sms-notifications/\" href=\"http://wordpress.org/plugins/wp-sms-notifications/\">WP SMS Notifications</a> plugin <a title=\"http://wptavern.com/keep-track-of-changes-to-your-wordpress-site-with-the-wp-sms-notifications-plugin\" href=\"http://wptavern.com/keep-track-of-changes-to-your-wordpress-site-with-the-wp-sms-notifications-plugin\">we highlighted on the Tavern</a> back in July. Matson explains why he decided to contribute to the Stream project, &#8220;When I created WP SMS Notifications, the biggest comment I received was that I should work with Stream to add my functionality to their plugin. The team behind Stream agreed and I was given access to their Github account. Now, I can proudly say that my code is behind one of the greatest activity tracking plugins out there.&#8221; However, the only way to take advantage of SMS notifications is to use the Pro account which is available for <strong>$2 per month</strong>.</p>\n<h2>Older Version of Stream Will Remain Available For Download</h2>\n<p>Stream has undergone major changes and is now a service versus a stand alone plugin. For those who don&#8217;t want to update to the new version, the Stream Team is leaving the <a title=\"https://github.com/wp-stream/stream/releases/tag/1.4.9\" href=\"https://github.com/wp-stream/stream/releases/tag/1.4.9\">previous version online</a> via Github. Versions 1.4.9 and below won&#8217;t receive any more updates outside of patching major bugs or security vulnerabilities.</p>\n<h2>Overall, a Solid Update</h2>\n<p>Stream 2.0 is a solid update. The latest edition supports activity tracking for eight of the most popular WordPress plugins out-of-the box including: Advanced Custom Fields, bbPress, BuddyPress, Easy Digital Downloads, Gravity Forms, Jetpack, WooCommerce and WordPress SEO by Yoast. SMS notification is a great enhancement and I think it&#8217;s respectable of the team to keep 1.4.9 available for those that don&#8217;t like the new direction Stream is heading in.</p>\n<p>Are you satisfied with the latest update to Stream? Does using WordPress.com and Amazon Web Services turn you off from using it?</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 01 Oct 2014 02:46:04 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:48;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:107:\"WPTavern: WordPress Plugin Checks if The Server Hosting Your Site is Vulnerable to The ShellShock Bug\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31659\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:111:\"http://wptavern.com/wordpress-plugin-checks-if-the-server-hosting-your-site-is-vulnerable-to-the-shellshock-bug\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2910:\"<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/09/ShellShockFeaturedImage.png\" rel=\"prettyphoto[31659]\"><img class=\"size-full wp-image-31661\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/09/ShellShockFeaturedImage.png?resize=636%2C300\" alt=\"ShellShock Featured Image\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/tbuser/6076934115/\">Tony Buser</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-sa/2.0/\">cc</a>\n<p>In recent days, a <a title=\"http://web.nvd.nist.gov/view/vuln/detail?vulnId=CVE-2014-6271\" href=\"http://web.nvd.nist.gov/view/vuln/detail?vulnId=CVE-2014-6271\">security vulnerability</a> in Bash known as &#8220;ShellShock&#8221; has put millions of servers at risk. Without going into too much detail, the vulnerability allows an attacker to execute any code on a vulnerable server. The amount of servers at risk is far greater than the <a title=\"http://heartbleed.com/\" href=\"http://heartbleed.com/\">Heartbleed bug</a> discovered earlier this year. The founder of <a title=\"https://managewp.com\" href=\"https://managewp.com\">ManageWP</a>, Vladimir Prelovac, has released a <a title=\"https://wordpress.org/plugins/shellshock-check/\" href=\"https://wordpress.org/plugins/shellshock-check/\">new WordPress plugin</a> that helps determine if the server hosting your website is vulnerable to the ShellShock bug.</p>\n<p>The plugin checks for both disclosed ShellShock vulnerabilities<a href=\"http://web.nvd.nist.gov/view/vuln/detail?vulnId=CVE-2014-6271\">CVE-2014-6271</a> and<a href=\"http://web.nvd.nist.gov/view/vuln/detail?vulnId=CVE-2014-7169\">CVE-2014-7169</a>. Simply download the plugin, activate it, and browse to <strong>Settings &gt; Shellshock.</strong> Click the <strong>Run Test</strong> button. After the test is completed, a notice displays whether the server is vulnerable or not. In the following screenshot, the server I tested is not vulnerable.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/09/ShellShockTestResults.png\" rel=\"prettyphoto[31659]\"><img class=\"size-full wp-image-31660\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/09/ShellShockTestResults.png?resize=890%2C229\" alt=\"ShellShock Test Results\" /></a>ShellShock Test Results\n<p>If the server is vulnerable, take a screenshot and contact your host as soon as possible. Create a trouble ticket. Then, inform the support representative you tested the server and the results show it&#8217;s vulnerable. Attach the screenshot to the trouble ticket with a link to <a title=\"http://www.troyhunt.com/2014/09/everything-you-need-to-know-about.html\" href=\"http://www.troyhunt.com/2014/09/everything-you-need-to-know-about.html\">this article by Troy Hunt</a>, which explains everything they need to know about the bug. After filing the report, create a full back up of your site in case the server is attacked before it&#8217;s patched.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 01 Oct 2014 01:41:16 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:49;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"WPTavern: A New Project by Nick Haskins, WP Status Page\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=31609\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"http://wptavern.com/a-new-project-by-nick-haskins-wp-status-page\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3570:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/09/WPStatusPageFeaturedImage.png\" rel=\"prettyphoto[31609]\"><img class=\"size-full wp-image-31651\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/09/WPStatusPageFeaturedImage.png?resize=640%2C200\" alt=\"WP Status Page Featured Image\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/lrosa/560296859/\">Luigi Rosa has moved to Ipernity</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-sa/2.0/\">cc</a>\n<p>The creator of <a title=\"http://nickhaskins.com/2014/09/wp-status-page/\" href=\"http://nickhaskins.com/2014/09/wp-status-page/\">Aesop Story Engine</a>, Nick Haskins, wants to know if there is <a title=\"http://nickhaskins.com/2014/09/wp-status-page/\" href=\"http://nickhaskins.com/2014/09/wp-status-page/\">any interest in a WordPress plugin</a> that would provide a project status page. After browsing the WordPress plugin directory and coming up empty, Haskins is developing his own solution in the form of a plugin.</p>\n<p>He describes the plugin will have a similar setup to <a title=\"https://www.statuspage.io/\" href=\"https://www.statuspage.io/\">StatusPage.io</a>. &#8220;It would definitely have a mechanism to determine if a supplied URL and/or database is down or not. But the page would be more &#8220;alive&#8221; then a static <strong>coming soon page</strong> with the ability to send notifications (email/SMS) to users in addition to showing real-time status updates with a history of events,&#8221; Haskins told the Tavern.</p>\n<div>Haskins explains how the plugin would work. &#8220;You&#8217;d provide a subset of items like maybe a URL, database , API endpoint, and we&#8217;d ping that and return the status in a pretty way. I think the key making this really work would be to provide some level of automation as in, a developer could push a commit to Github or Bitbucket with a specific tag that would then automatically update a message status on the status page.</div>\n<div></div>\n<p>An example of a status page is the Amazon Web Services health dashboard. Haskins says his page will look similar but will have a better design.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/09/AmazonWebServicesStatusPage.png\" rel=\"prettyphoto[31609]\"><img class=\"size-full wp-image-31649\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/09/AmazonWebServicesStatusPage.png?resize=814%2C690\" alt=\"Amazon Web Services Status Page\" /></a>Amazon Web Services Status Page\n<p>One of the issues he brings up is where to host the plugin. It doesn&#8217;t make sense to host a status page on the same server as the project. Instead of forcing users to sign up for a cheap hosting account, Haskins may turn it into a hosted service. One option to consider is using <a title=\"https://www.openshift.com/\" href=\"https://www.openshift.com/\">OpenShift Online</a>. OpenShift has free accounts available and is Red Hat&#8217;s public cloud application development and hosting platform.</p>\n<p>If you&#8217;d like to know when the plugin is ready for testing, <a title=\"http://wpstatuspage.com/\" href=\"http://wpstatuspage.com/\">WP Status Page</a> has a splash page available where you can enter your email address to receive updates on the <em>project&#8217;s status</em>.</p>\n<p>Is this something you&#8217;d be interested in using? What other ideas or features would you like to see in a status page generation plugin? If you already use a service or have custom coded a solution to provide a status page for your project, please share it in the comments.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 30 Sep 2014 21:14:08 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";a:10:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Thu, 16 Oct 2014 19:43:13 GMT\";s:12:\"content-type\";s:8:\"text/xml\";s:14:\"content-length\";s:6:\"255654\";s:10:\"connection\";s:5:\"close\";s:4:\"vary\";s:15:\"Accept-Encoding\";s:13:\"last-modified\";s:29:\"Thu, 16 Oct 2014 19:30:17 GMT\";s:15:\"x-frame-options\";s:10:\"SAMEORIGIN\";s:4:\"x-nc\";s:11:\"HIT lax 250\";s:13:\"accept-ranges\";s:5:\"bytes\";}s:5:\"build\";s:14:\"20140526202405\";}','no'),(150903,'_site_transient_update_themes','O:8:\"stdClass\":4:{s:12:\"last_checked\";i:1414231108;s:7:\"checked\";a:5:{s:12:\"PricerrTheme\";s:5:\"2.0.8\";s:12:\"ProjectTheme\";s:5:\"1.4.0\";s:14:\"twentyfourteen\";s:3:\"1.2\";s:14:\"twentythirteen\";s:3:\"1.3\";s:12:\"twentytwelve\";s:3:\"1.5\";}s:8:\"response\";a:0:{}s:12:\"translations\";a:0:{}}','yes'),(145136,'_site_transient_timeout_browser_50c54d33e06cc624f76168787f95f678','1413463835','yes'),(145137,'_site_transient_browser_50c54d33e06cc624f76168787f95f678','a:9:{s:8:\"platform\";s:9:\"Macintosh\";s:4:\"name\";s:6:\"Chrome\";s:7:\"version\";s:13:\"37.0.2062.124\";s:10:\