within 100 and 10000 gated events, using 3.8 m beads\r\n\r\nSizing: Electronic Impedance w/ a measurement range 3 to 4 microns diameter with the standard 125 m flow cell\r\nOptics:\r\n\r\nExcitation: 365, 404, 435 arc excitation and a 488nm laser, Fluorescence detectors 3 photomultiplier tubes.','Beckman Coulter Cell Lab Quanta SC in Carlsbad','','publish','open','open','','beckman-coulter-cell-lab-quanta-sc','','','2014-10-18 13:51:34','2014-10-18 20:51:34','',0,'http://labfellows.com/?post_type=job&#038;p=340',0,'job','',0),(333,16,'2014-06-24 08:02:05','2014-06-24 15:02:05','[pricerr_theme_my_account_shopping]','My Reservations','','inherit','open','open','','10-revision-v1','','','2014-06-24 08:02:05','2014-06-24 15:02:05','',10,'http://labfellows.com/10-revision-v1/',0,'revision','',0),(571,16,'2014-09-23 15:43:51','2014-09-23 22:43:51','<center><img class=\"aligncenter wp-image-553 size-full\" src=\"http://labfellows.com/wp-content/uploads/2014/05/top_title.png\" alt=\"top_title\" width=\"502\" height=\"47\" /> <a href=\"https://www.eventbrite.com/e/lab-fellows-inaugural-bench-bash-tickets-13250176635\"><img class=\"aligncenter wp-image-555 size-full\" src=\"http://labfellows.com/wp-content/uploads/2014/05/calltoaction.png\" alt=\"calltoaction\" width=\"543\" height=\"354\" /></a> <a href=\"https://www.google.com/maps/place/2351+Faraday+Ave,+Carlsbad,+CA+92008/\"><img class=\"aligncenter wp-image-552 size-full\" src=\"http://labfellows.com/wp-content/uploads/2014/05/date_location_bench.png\" alt=\"date_location_bench\" width=\"552\" height=\"224\" /></a> <a href=\"http://twitter.com/labfellows\"><img class=\"aligncenter wp-image-554 size-full\" src=\"http://labfellows.com/wp-content/uploads/2014/05/bottom_badge.png\" alt=\"bottom_badge\" width=\"507\" height=\"120\" /></a></center>','Events','','inherit','open','open','','558-revision-v1','','','2014-09-23 15:43:51','2014-09-23 22:43:51','',558,'http://labfellows.com/558-revision-v1/',0,'revision','',0),(231,3