ion provided by such websites, and Company assumes no responsibility for unintended, objectionable, inaccurate, misleading, or unlawful content that may reside on those sites. Similarly, from time to time in connection with your use of the Website, you may have access to content items (including, but not limited to, websites) that are owned by third parties. You acknowledge and agree that Company makes no guarantees about, and assumes no responsibility for, the accuracy, currency, content, or quality of this third party content, and that, unless expressly provided otherwise, these Terms shall govern your use of any and all third party content.\n\n<b><span style=\"text-decoration: underline;\">Disclaimer of Warranties</span></b>\n\nYour use of the Website, its contents and any services or items obtained through the Website is at your own risk. The Website, its content and any services or items obtained through the Website are provided on an as is basis and as available basis, without any warranties of any kind, either express or implied. Neither the Company nor any person associated with the Company makes any warranty or representation with respect to the completeness, security, reliability, quality, accuracy, or availability of the Website. Without limiting the foregoing, neither the Company nor anyone associated with the Company represents or warrants that the Website, its content or any services obtained through the Website will be accurate, reliable, error-free or uninterrupted, that defects will be corrected, that our Website or the server that makes it available are free of viruses or other harmful components or that the website or any services or items obtained through the Website will meet your needs or expectations.\n\n<b><span style=\"text-decoration: underline;\">Arbitration</span></b>\n\nAll claims and disputes arising under or relating to these Terms are to be settled by binding arbitration in the State of Delaware or another location mutually agreeable to the parties. The arbitration shall be administered by the American Arbitration Association under its Commercial Arbitration Rules. Any decision or award as a result of any such arbitration proceeding shall be in writing and shall provide an explanation for all conclusions of law and fact and shall include the assessment of costs, expenses, and reasonable attorneys fees. Any such arbitration shall be conducted by an arbitrator and shall include a written record of the arbitration hearing. The parties reserve the right to object to any individual who shall be employed by or affiliated with a competing organization or entity. An award of arbitration may be confirmed in a court of competent jurisdiction.\n\n<b><span style=\"text-decoration: underline;\">Choice of Law</span></b>\n\nAll matter relating to the Website and these Terms and any dispute or claim arising therefrom or related thereto shall be governed by and construed in accordance with the internal laws of the State of Delaware without giving effect to any choice or conflict of law provision or rule (whether of the State of Delaware or any other jurisdiction).\n\nAny legal suit, action, or proceeding arising out of, or related to, these Terms or the Website shall be instituted exclusively in the federal courts of the United States or the courts of the State of Delaware. We retain the right to bring any suit, action or proceeding against you for breach of these Terms in your country of residence or any other relevant country. You waive any and all objections to the exercise of jurisdiction over you by such courts and to venue in such courts.\n\n<b><span style=\"text-decoration: underline;\">Severability; Waiver </span></b><b></b>\n\nIf, for whatever reason, a court of competent jurisdiction finds any term or condition in these Terms to be unenforceable, all other terms and conditions will remain unaffected and in full force and effect. No waiver of any breach of any provision of these Terms shall constitute a waiver of any prior, concurrent, or subsequent breach of the same or any other provisions hereof, and no waiver shall be effective unless made in writing and signed by an authorized representative of the waiving party.\n\n<b><span style=\"text-decoration: underline;\">Copyright</span></b><b></b>\n\nAll contents of Website or Services are: Copyright2014 Lab Fellows, Inc. Attn: Lab Fellows, Inc. United States Corporation Agents, Inc. 1521 Concord Pike, Suite 301 Wilmington, DE 19803. All rights reserved.\n\n<b><span style=\"text-decoration: underline;\">Contacting Lab Fellows</span></b>\n\nIf you have any questions about these Terms, please contact Lab Fellows Team.\n\n<address><b>Attn: Lab Fellows, Inc.</b></address><address><b></b><b>United States Corporation Agents, Inc.</b></address><address><b>1521 Concord Pike, Suite 301</b></address><address><b>Wilmington, DE 19803</b></address>','Terms of Use','','inherit','open','open','','86-autosave-v1','','','2014-04-29 10:29:20','2014-04-29 17:29:20','',86,'http://labfellows.com/86-autosave-v1/',0,'revision','',0),(90,16,'2014-03-17 22:32:49','2014-03-18 05:32:49','Test\r\n\r\n1\r\n\r\n2\r\n\r\n3\r\n\r\n4\r\n\r\n5\r\n\r\n&nbsp;\r\n\r\n67\r\n\r\n8\r\n\r\n&nbsp;','Terms of Service','','inherit','open','open','','86-revision-v1','','','2014-03-17 22:32:49','2014-03-18 05:32:49','',86,'http://labfellows.com/86-revision-v1/',0,'revision','',0),(91,16,'2014-03-18 16:08:34','2014-03-18 23:08:34','<p style=\"text-align: justify;\"><b>Last Updated Date:</b>3/18/2014</p>\n<p style=\"text-align: justify;\">Lab Fellows, Inc. (<b>Lab Fellows</b> or <b>we</b>) provides an online platform (the <b>Services</b>) through our website, accessible at www.labfellows.com (the <b>Site</b>). Please read carefully the following terms and conditions (<b>Terms</b>) and<a href=\"http://www.labfellows.com/privacy\">privacy policy</a>. These Terms govern your access to and use of the Site, Services and Collective Content (defined below), and constitute a binding legal agreement between you and Lab Fellows.</p>\n<p style=\"text-align: justify;\"><b>Key Content-related Terms</b></p>\n<p style=\"text-align: justify;\"><b>Content</b> means text, graphics, images, music, software, audio, video, information or other materials.</p>\n<p style=\"text-align: justify;\"><b>Lab FellowsContent</b> means Content that Lab Fellowsmakes available through the Site or Services, including any Content licensed from a third party, but excluding Member Content.</p>\n<p style=\"text-align: justify;\"><b>Member</b> means a person who completes Lab Fellows account registration process, as described under the Account Registration section below.</p>\n<p style=\"text-align: justify;\"><b>Member Content</b> means Content that a Member posts, uploads, publishes, submits or transmits to be made available through the Site or Services.</p>\n<p style=\"text-align: justify;\"><b>Collective Content</b> means, collectively, Lab FellowsContent and Member Content.\nCertain areas of the Site (and your access to or use of certain Services or Collective Content) may have different terms and conditions posted or may require you to agree with and accept additional terms and conditions. If there is a conflict between these Terms and terms and conditions posted for a specific area of the Site, Services or Collective Content, the latter terms and conditions will take precedence with respect to your use of or access to that area of the Site, Services or Collective Content, as applicable.</p>\n<p style=\"text-align: justify;\">YOU ACKNOWLEDGE AND AGREE THAT, BY ACCESSING OR USING THE SITE OR SERVICES, OR BY DOWNLOADING OR POSTING ANY CONTENT FROM OR ON THE SITE OR THROUGH THE SERVICES, YOU ARE INDICATING THAT YOU HAVE READ, AND THAT YOU UNDERSTAND AND AGREE TO BE BOUND BY, THESE TERMS, WHETHER OR NOT YOU HAVE REGISTERED ON OR THROUGH THE SITE. IF YOU DO NOT AGREE TO THESE TERMS, THEN YOU HAVE NO RIGHT TO ACCESS OR USE THE SITE, SERVICES OR COLLECTIVE CONTENT. If you accept or agree to these Terms on behalf of a company or other legal entity, you represent and warrant that you have the authority to bind that company or other legal entity to these Terms and, in such event, you and your will refer and apply to that company or other legal entity.</p>\n<p style=\"text-align: justify;\"><b>Modification</b></p>\n<p style=\"text-align: justify;\">Lab Fellowsreserves the right, at its sole discretion, to modify, discontinue or terminate the Site or Services or to modify these Terms, at any time and without prior notice. If we modify these Terms we will post the modification on the Site or provide you with notice of the modification. We will also update the Last Updated Date at the top of these Terms. By continuing to access or use the Site or Services after we have posted a modification on the Site or have provided you with notice of a modification, you are indicating that you agree to be bound by the modified Terms. If the modified Terms are not acceptable to you, your only recourse is to cease using the Site and Services.</p>\n<p style=\"text-align: justify;\"><b>Eligibility</b></p>\n<p style=\"text-align: justify;\">The Site and Services are intended solely for persons who are 18 or older. Any access to or use of the Site or Services by anyone under 18 is expressly prohibited. By accessing or using the Site or Services you represent and warrant that you are 18 or older.</p>\n<p style=\"text-align: justify;\"><b>UsingLab Fellows</b></p>\n<p style=\"text-align: justify;\">Via the Site and Services, Members can utilize the tools made available by Lab Fellowsas a resource for premium content and an online marketplace to host and reserve lab space and equipment and related services with other Members. Members may represent an organization, service provider, lab, company, or individual.</p>\n<p style=\"text-align: justify;\">Members can create profiles, host and reserve lab space and equipment, and offer related training, support, and outsourcing services, reference, or community feedback. All of the communication by or between Members should refrain from the use of profanity.</p>\n<p style=\"text-align: justify;\">You may never use another Members account without permission. When creating your account, you must provide accurate and complete information. You are responsible for the activity that occurs on your account, and you must keep your account password secure. We will not be liable for any losses caused by any unauthorized use of your account.</p>\n<p style=\"text-align: justify;\"><b>Account Registration</b></p>\n<p style=\"text-align: justify;\">In order to access certain features of the Site and Services and to post any Member Content on the Site or through the Services you must register to create an account (<b>Account</b>) and become a Member. You agree to provide accurate, current and complete information during the registration process and to update such information to keep it accurate, current and complete. Lab Fellowsreserves the right to suspend or terminate your Account if any information provided during the registration process or thereafter proves to be inaccurate, not current or incomplete. You are responsible for safeguarding your password. You agree that you will not disclose your password to any third party and that you will take sole responsibility for any activities or actions under your Account, whether or not you have authorized such activities or actions. You will immediately notify Lab Fellowsof any unauthorized use of your Account.</p>\n<p style=\"text-align: justify;\"><b>Account Information and Payment Terms</b></p>\n<p style=\"text-align: justify;\">Lab Fellowsmakes certain features of the Services available without charge. However, if you choose to utilize any paid features of the Services, you authorize Lab Fellowsor its third party payment processor to charge your method of payment in the amount of any paid features of the Services that you choose to utilize. More information related to paid features of the Services is accessible by contacting us at <a title=\"info@labfellows.com\" href=\"mailto:info@labfellows.com?subject=Connecting%20with%20Lab%20Fellows%20Team\">info@labfellows.com</a>. In connection with such paid features, when you register for an Account, you may be required to provide customary billing information such as name and billing address. You agree to pay the applicable fees and any taxes and other fees that may accrue in relation to your use of the Site and Services, if any. All fees are non-refundable and non-transferable except as expressly provided in these Terms. All fees and applicable taxes, if any, are payable in United States dollars.</p>\n<p style=\"text-align: justify;\"><b>Privacy</b></p>\n<p style=\"text-align: justify;\">See Lab Fellows<a href=\"http://www.labfellows.com/privacy\">privacy policy</a>for information and notices concerning Lab Fellows collection and use of your personal information.</p>\n<p style=\"text-align: justify;\"><b>Ownership</b></p>\n<p style=\"text-align: justify;\">The Site, Services and Collective Content are protected by copyright, trademark, and other laws of the United States and foreign countries. You acknowledge and agree that the Site, Services and Lab FellowsContent, including all associated intellectual property rights, are the exclusive property of Lab Fellows and its licensors. You will not remove, alter or obscure any copyright, trademark, service mark or other proprietary rights notices incorporated in or accompanying the Site, Services or Collective Content.</p>\n<p style=\"text-align: justify;\"><b>Licenses Granted by Lab Fellowsto Lab FellowsContent and Member Content</b></p>\n<p style=\"text-align: justify;\">Subject to your compliance with the terms and conditions of these Terms, Lab Fellowsgrants you a limited, non-exclusive, non-transferable license: (i) to view, download and print any Lab Fellows Content solely for your personal and non-commercial purposes; and (ii) a to view any Member Content of other Members to which you are permitted access solely for your internal purposes. You have no right to sublicense the license rights granted in this section.</p>\n<p style=\"text-align: justify;\">You will not use, copy, adapt, modify, prepare derivative works based upon, distribute, license, sell, transfer, publicly display, publicly perform, transmit, stream, broadcast or otherwise exploit the Site, Services or Collective Content, except as expressly permitted in these Terms. No licenses or rights are granted to you by implication or otherwise under any intellectual property rights owned or controlled by Lab Fellows or its licensors, except for the licenses and rights expressly granted in these Terms.</p>\n<p style=\"text-align: justify;\"><b>License granted by Member</b></p>\n<p style=\"text-align: justify;\">We may, in our sole discretion, permit Members to post, upload, publish, submit or transmit Member Content. By making available any Member Content on or through the Site or Services, you hereby grant to Lab Fellows a worldwide, irrevocable, perpetual, non-exclusive, transferable, royalty-free license, with the right to sublicense, to use, view, copy, adapt, transfer, publicly display, publicly perform, transmit, stream, broadcast and otherwise exploit such Member Content only on, through or by means of the Site or Services and only in the course of providing the Site and Services. Lab Fellows does not claim any ownership rights in any Member Content and nothing in these Terms will be deemed to restrict any rights that you may have to use and exploit any Member Content.</p>\n<p style=\"text-align: justify;\">You acknowledge and agree that you are solely responsible for all Member Content that you make available through the Site or Services. Accordingly, you represent and warrant that: (i) you either are the sole and exclusive owner of all Member Content that you make available through the Site or Services