></address><address><b><i>1521 Concord Pike, Suite 301</i></b><i></i></address><address><b><i>Wilmington, DE 19803</i></b><i></i></address>&nbsp;\r\n\r\n&nbsp;','Terms of Service','','inherit','open','open','','86-revision-v1','','','2014-03-18 16:07:09','2014-03-18 23:07:09','',86,'http://labfellows.com/86-revision-v1/',0,'revision','',0),(97,16,'2014-03-18 16:07:32','2014-03-18 23:07:32','<p style=\"text-align: justify;\"><b>Last Updated Date:</b>3/18/2014</p>\r\n<p style=\"text-align: justify;\">Lab Fellows, Inc. (<b>Lab Fellows</b> or <b>we</b>) provides an online platform (the <b>Services</b>) through our website, accessible at www.labfellows.com (the <b>Site</b>). Please read carefully the following terms and conditions (<b>Terms</b>) and<a href=\"http://www.labfellows.com/privacy\">privacy policy</a>. These Terms govern your access to and use of the Site, Services and Collective Content (defined below), and constitute a binding legal agreement between you and Lab Fellows.</p>\r\n<p style=\"text-align: justify;\"><b>Key Content-related Terms</b></p>\r\n<p style=\"text-align: justify;\"><b>Content</b> means text, graphics, images, music, software, audio, video, information or other materials.</p>\r\n<p style=\"text-align: justify;\"><b>Lab FellowsContent</b> means Content that Lab Fellowsmakes available through the Site or Services, including any Content licensed from a third party, but excluding Member Content.</p>\r\n<p style=\"text-align: justify;\"><b>Member</b> means a person who completes Lab Fellows account registration process, as described under the Account Registration section below.</p>\r\n<p style=\"text-align: justify;\"><b>Member Content</b> means Content that a Member posts, uploads, publishes, submits or transmits to be made available through the Site or Services.</p>\r\n<p style=\"text-align: justify;\"><b>Collective Content</b> means, collectively, Lab FellowsContent and Member Content.\r\nCertain areas of the Site (and your access to or use of certain Services or Collective Content) may have different terms and conditions posted or may require you to agree with and accept additional terms and conditions. If there is a conflict between these Terms and terms and conditions posted for a specific area of the Site, Services or Collective Content, the latter terms and conditions will take precedence with respect to your use of or access to that area of the Site, Services or Collective Content, as applicable.</p>\r\n<p style=\"text-align: justify;\">YOU ACKNOWLEDGE AND AGREE THAT, BY ACCESSING OR USING THE SITE OR SERVICES, OR BY DOWNLOADING OR POSTING ANY CONTENT FROM OR ON THE SITE OR THROUGH THE SERVICES, YOU ARE INDICATING THAT YOU HAVE READ, AND THAT YOU UNDERSTAND AND AGREE TO BE BOUND BY, THESE TERMS, WHETHER OR NOT YOU HAVE REGISTERED ON OR THROUGH THE SITE. IF YOU DO NOT AGREE TO THESE TERMS, THEN YOU HAVE NO RIGHT TO ACCESS OR USE THE SITE, SERVICES OR COLLECTIVE CONTENT. If you accept or agree to these Terms on behalf of a company or other legal entity, you represent and warrant that you have the authority to bind that company or other legal entity to these Terms and, in such event, you and your will refer and apply to that company or other legal entity.</p>\r\n<p style=\"text-align: justify;\"><b>Modification</b></p>\r\n<p style=\"text-align: justify;\">Lab Fellowsreserves the right, at its sole discretion, to modify, discontinue or terminate the Site or Services or to modify these Terms, at any time and without prior notice. If we modify these Terms we will post the modification on the Site or provide you with notice of the modification. We will also update the Last Updated Date at the top of these Terms. By continuing to access or use the Site or Services after we have posted a modification on the Site or have provided you with notice of a modification, you are indicating that you agree to be bound by the modified Terms. If the modified Terms are not acceptable to you, your only recourse is to cease using the Site and Services.</p>\r\n<p style=\"text-align: justify;\"><b>Eligibility</b></p>\r\n<p style=\"text-align: justify;\">The Site and Services are intended solely for persons who are 18 or older. Any access to or use of the Site or Services by anyone under 18 is expressly prohibited. By accessing or using the Site or Services you represent and warrant that you are 18 or older.</p>\r\n<p style=\"text-align: justify;\"><b>UsingLab Fellows</b></p>\r\n<p style=\"text-align: justify;\">Via the Site and Services, Members can utilize the tools made available by Lab Fellowsas a resource for premium content and an online marketplace to host and reserve lab space and equipment and related services with other Members. Members may represent an organization, service provider, lab, company, or individual.</p>\r\n<p style=\"text-align: justify;\">Members can create profiles, host and reserve lab space and equipment, and offer related training, support, and outsourcing services, reference, or community feedback. All of the communication by or between Members should refrain from the use of profanity.</p>\r\n<p style=\"text-align: justify;\">You may never use another Members account without permission. When creating your account, you must provide accurate and complete information. You are responsible for the activity that occurs on your account, and you must keep your account password secure. We will not be liable for any losses caused by any unauthorized use of your account.</p>\r\n<p style=\"text-align: justify;\"><b>Account Registration</b></p>\r\n<p style=\"text-align: justify;\">In order to access certain features of the Site and Services and to post any Member Content on the Site or through the Services you must register to create an account (<b>Account</b>) and become a Member. You agree to provide accurate, current and complete information during the registration process and to update such information to keep it accurate, current and complete. Lab Fellowsreserves