stify;\"><b>Ownership</b></p>\r\n<p style=\"text-align: justify;\">The Site, Services and Collective Content are protected by copyright, trademark, and other laws of the United States and foreign countries. You acknowledge and agree that the Site, Services and Lab FellowsContent, including all associated intellectual property rights, are the exclusive property of Lab Fellows and its licensors. You will not remove, alter or obscure any copyright, trademark, service mark or other proprietary rights notices incorporated in or accompanying the Site, Services or Collective Content.</p>\r\n<p style=\"text-align: justify;\"><b>Licenses Granted by Lab Fellowsto Lab FellowsContent and Member Content</b></p>\r\n<p style=\"text-align: justify;\">Subject to your compliance with the terms and conditions of these Terms, Lab Fellowsgrants you a limited, non-exclusive, non-transferable license: (i) to view, download and print any Lab Fellows Content solely for your personal and non-commercial purposes; and (ii) a to view any Member Content of other Members to which you are permitted access solely for your internal purposes. You have no right to sublicense the license rights granted in this section.</p>\r\n<p style=\"text-align: justify;\">You will not use, copy, adapt, modify, prepare derivative works based upon, distribute, license, sell, transfer, publicly display, publicly perform, transmit, stream, broadcast or otherwise exploit the Site, Services or Collective Content, except as expressly permitted in these Terms. No licenses or rights are granted to you by implication or otherwise under any intellectual property rights owned or controlled by Lab Fellows or its licensors, except for the licenses and rights expressly granted in these Terms.</p>\r\n<p style=\"text-align: justify;\"><b>License granted by Member</b></p>\r\n<p style=\"text-align: justify;\">We may, in our sole discretion, permit Members to post, upload, publish, submit or transmit Member Content. By making available any Member Content on or through the Site or Services, you hereby grant to Lab Fellows a worldwide, irrevocable, perpetual, non-exclusive, transferable, royalty-free license, with the right to sublicense, to use, view, copy, adapt, transfer, publicly display, publicly perform, transmit, stream, broadcast and otherwise exploit such Member Content only on, through or by means of the Site or Services and only in the course of providing the Site and Services. Lab Fellows does not claim any ownership rights in any Member Content and nothing in these Terms will be deemed to restrict any rights that you may have to use and exploit any Member Content.</p>\r\n<p style=\"text-align: justify;\">You acknowledge and agree that you are solely responsible for all Member Content that you make available through the Site or Services. Accordingly, you represent and warrant that: (i) you either are the sole and exclusive owner of all Member Content that you make available through the Site or Services or you have all rights, licenses, consents and releases that are necessary to grant to Lab Fellows and to the rights in such Member Content, as contemplated under these Terms; and (ii) neither the Member Content nor your posting, uploading, publication, submission or transmittal of the Member Content or Lab Fellows use of the Member Content (or any portion thereof) on, through or by means of the Site or Services will infringe, misappropriate or violate a third partys patent, copyright, trademark, trade secret, moral rights or other intellectual property rights, or rights of publicity or privacy, or result in the violation of any applicable law or regulation.</p>\r\n<p style=\"text-align: justify;\"><b>Feedback</b></p>\r\n<p style=\"text-align: justify;\">We welcome and encourage you to provide feedback, comments and suggestions for improvements to the Site or Services (<b>Feedback</b>). You may submit Feedback by emailing us at<a title=\"info@labfellows.com\" href=\"mailto:info@labfellows.com?subject=Connecting%20with%20Lab%20Fellows%20Team\">info@labfellows.com</a>. You acknowledge and agree that if you submit any Feedback to us, you hereby grant to us a non-exclusive, worldwide, perpetual, irrevocable, fully-paid, royalty-free, sub-licensable and transferable license under any and all intellectual property rights that you own or control to use, copy, modify, create derivative works based upon and otherwise exploit the Feedback for any purpose.</p>\r\n<p style=\"text-align: justify;\"><b>General Prohibitions</b></p>\r\n<p style=\"text-align: justify;\">You agree not to do any of the following:</p>\r\n\r\n<ul style=\"text-align: justify;\">\r\n	<li>Post, upload, publish, submit or transmit any Content that: (i) infringes, misappropriates or violates a third partys patent, copyright, trademark, trade secret, moral rights or other intellectual property rights, or rights of publicity or privacy; (ii) violates, or encourages any conduct that would violate, any applicable law or regulation or would give rise to civil liability; (iii) is fraudulent, false, misleading or deceptive; (iv) is defamatory, obscene, pornographic, vulgar or offensive; (v) promotes discrimination, bigotry, racism, hatred, harassment or harm against any individual or group; (vi) is violent or threatening or promotes violence or actions that are threatening to any person or entity; or (vii) promotes illegal or harmful activities or substances;</li>\r\n	<li>Use, display, mirror or frame the Site, or any individual element within the Site or Services, Lab Fellows name, any Lab Fellows trademark, logo or other proprietary information, or the layout and design of any page or form contained on a page, without Lab Fellows express written consent;</li>\r\n	<li>Access, tamper with, or use non-public areas of the Site, Lab Fellows computer systems, or the technical delivery systems of Lab Fellows providers;</li>\r\n	<li>Attempt to probe, scan, or test the vulnerability of any Lab Fellows system or network or breach any security or authentication measures;</li>\r\n	<li>Avoid, bypass, remove, deactivate, impair, descramble or otherwise circumvent any technological measure implemented by Lab Fellows or any of Lab Fellows providers or any other third party (including another user) to protect the Site, Services or Collective Content;</li>\r\n	<li>Attempt to access or search the Site, Services or Collective Content or download Collective Content from the Site or Services through the use of any engine, software, tool, agent, device or mechanism (including spiders, robots, crawlers, data mining tools or the like) other than the software and/or search agents provided by Lab Fellows or other generally available third party web browsers;</li>\r\n	<li>Send any unsolicited or unauthorized advertising, promotional materials, email, junk mail, spam, chain letters or other form of solicitation;</li>\r\n	<li>Use any meta tags or other hidden text or metadata utilizing a Lab Fellows trademark, logo URL or product name without Lab Fellows express written consent;</li>\r\n	<li>Forge any TCP/IP packet header or any part of the header information in any email or newsgroup posting, or in any way use the Site, Services or Collective Content to send altered, deceptive or false source-identifying information;</li>\r\n	<li>Attempt to decipher, decompile, disassemble or reverse engineer any of the software used to provide the Site, Services or Collective Content;</li>\r\n	<li>Interfere with, or attempt to interfere with, the access of any user, host or network, including, without limitation, sending a virus, overloading, flooding, spamming, or mail-bombing the Site or Services;</li>\r\n	<li>Collect or store any personally identifiable information from the Site or Services from other users of the Site or Services without their express permission;</li>\r\n	<li>Impersonate or misrepresent your affiliation with any person or entity;</li>\r\n	<li>Violate any applicable law or regulation;</li>\r\n	<li>Use the identity of any third party; or</li>\r\n	<li>Encourage or enable any other individual to do any of the foregoing.</li>\r\n</ul>\r\n<p style=\"text-align: justify;\">Lab Fellows will have the right to investigate violations of any of the above to the fullest extent of the law. Lab Fellows may involve and cooperate with law enforcement authorities in prosecuting users who violate these Terms. You acknowledge that Lab Fellows has no obligation to monitor your access to or use of the Site, Services or Collective Content or to review or edit any Collective Content, but has the right to do so for the purpose of operating the Site and Services, to ensure your compliance with these Terms, or to comply with applicable law or the order or requirement of a court, administrative agency or other governmental body. Lab Fellows reserves the right, at any time and without prior notice, to remove or disable access to any Collective Content that Lab Fellows, at its sole discretion, considers to be in violation of these Terms or otherwise harmful to the Site or Services.</p>\r\n<p style=\"text-align: justify;\"><b>Copyright Policy</b></p>\r\n<p style=\"text-align: justify;\">Lab Fellows respects copyright law and expects its users to do the same. It is Lab Fellows policy to terminate in appropriate circumstances Members or other account holders who repeatedly infringe or are believed to be repeatedly infringing the rights of copyright holders.</p>\r\n<p style=\"text-align: justify;\"><b>Links</b></p>\r\n<p style=\"text-align: justify;\">The Site or Services may contain links to third-party websites or resources. You acknowledge and agree that Lab Fellows is not responsible or liable for: (i) the availability or accuracy of such websites or resources; or (ii) the content, products, or services on or available from such websites or resources. Links to such websites or resources do not imply any endorsement by Lab Fellows of such websites or resources or the content, products, or services available from such websites or resources. You acknowledge sole responsibility for and assume all risk arising from your use of any such websites or resources or the Content, products, or services on or available from such websites or resources.</p>\r\n<p style=\"text-align: justify;\"><b>Termination and Account Cancellation</b></p>\r\n<p style=\"text-align: justify;\">If you breach any of these Terms, Lab Fellows will have the right to suspend or disable your Account or terminate these Terms, at its sole discretion and without prior notice to you. Lab Fellows reserves the right to revoke your access to and use of the Site, Services and Collective Content at any time, with or without cause. In the event Lab Fellows terminates these Terms for your breach, you will remain liable for all amounts due hereunder. You may cancel your Account at any time by sending an email to<a title=\"info@labfellows.com\" href=\"mailto:info@labfellows.com?subject=Cancellation%20Request\">info@labfellows.com</a>.</p>\r\n<p style=\"text-align: justify;\"><b>Disclaimers</b></p>\r\n<p style=\"text-align: justify;\">THE SITE, SERVICES AND COLLECTIVE CONTENT ARE PROVIDED AS IS, WITHOUT WARRANTY OF ANY KIND, EITHER EXPRESS OR IMPLIED. WITHOUT LIMITING THE FOREGOING, LAB FELLOWS EXPLICITLY DISCLAIMS ANY WARRANTIES OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE, QUIET ENJOYMENT OR NON-INFRINGEMENT, AND ANY WARRANTIES ARISING OUT OF COURSE OF DEALING OR USAGE OF TRADE. LAB FELLOWS MAKES NO WARRANTY THAT THE SITE, SERVICES OR COLLECTIVE CONTENT WILL MEET YOUR REQUIREMENTS OR BE AVAILABLE ON AN UNINTERRUPTED, SECURE, OR ERROR-FREE BASIS. LAB FELLOWS MAKES NO WARRANTY REGARDING THE QUALITY OF ANY PRODUCTS, SERVICES OR COLLECTIVE CONTENT PURCHASED OR OBTAINED THROUGH THE SITE OR SERVICES OR THE ACCURACY, TIMELINESS, TRUTHFULNESS, COMPLETENESS OR RELIABILITY OF ANY CONTENT OBTAINED THROUGH THE SITE OR SERVICES. LAB FELLOWS DISCLAIMS ANY AND ALL LIABILITY RELATED TO INTERACTIONS WITH OR ACTIONS OF ANY NEUTRALS. NO ADVICE OR INFORMATION, WHETHER ORAL OR WRITTEN, OBTAINED FROM LAB FELLOWS OR THROUGH THE SITE, SERVICES OR COLLECTIVE CONTENT, WILL CREATE ANY WARRANTY NOT EXPRESSLY MADE HEREIN. YOU ARE SOLELY RESPONSIBLE FOR ALL OF YOUR COMMUNICATIONS AND INTERACTIONS WITH OTHER USERS OF THE SITE AND SERVICES AND WITH OTHER PERSONS WITH WHOM YOU COMMUNICATE OR INTERACT AS A RESULT OF YOUR USE OF THE SITE OR SERVICES. YOU UNDERSTAND THAT LAB FELLOWS DOES NOT SCREEN OR INQUIRE INTO THE BACKGROUND OF ANY USERS OF THE SITE OR SERVICES, NOR DOES LAB FELLOWS MAKE ANY ATTEMPT TO VERIFY THE STATEMENTS OF USERS OF THE SITE OR SERVICES. LAB FELLOWS MAKES NO REPRESENTATIONS OR WARRANTIES AS TO THE CONDUCT OF USERS OF THE SITE OR SERVICES OR THEIR COMPATIBILITY WITH ANY CURRENT OR FUTURE USERS OF THE SITE OR SERVICES. YOU AGREE TO TAKE REASONABLE PRECAUTIONS IN ALL COMMUNICATIONS AND INTERACTIONS WITH OTHER USERS OF THE SITE AND SERVICES AND WITH OTHER PERSONS WITH WHOM YOU COMMUNICATE OR INTERACT AS A RESULT OF YOUR USE OF THE SITE OR SERVICES, PARTICULARLY IF YOU DECIDE TO MEET OFFLINE OR IN PERSON.</p>\r\n<p style=\"text-align: justify;\"><b>Indemnity</b></p>\r\n<p style=\"text-align: justify;\">You agree to defend, indemnify, and hold Lab Fellows, its officers, directors, employees and agents, harmless from and against any claims, liabilities, damages, losses, and expenses, including, without limitation, reasonable legal and accounting fees, arising out of or in any way connected with your access to or use of the Site, Services or Collective Content, or your violation of these Terms.</p>\r\n<p style=\"text-align: justify;\"><b>Limitation of Liability</b></p>\r\n<p style=\"text-align: justify;\">YOU ACKNOWLEDGE AND AGREE THAT, TO THE MAXIMUM EXTENT PERMITTED BY LAW, THE ENTIRE RISK ARISING OUT OF YOUR ACCESS TO AND USE OF THE SITE, SERVICES AND COLLECTIVE CONTENT REMAINS WITH YOU. NEITHER Lab Fellows NOR ANY OTHER person or entity involved in c