e names and any other proprietary designations of Lab Fellows used herein are trademarks or registered trademarks of Lab Fellows. Any other trademarks, service marks, logos, trade names and any other proprietary designations are the trademarks or registered trademarks of their respective parties.</p>\r\n<p style=\"text-align: justify;\"><b>Controlling Law and Jurisdiction</b></p>\r\n<p style=\"text-align: justify;\">These Terms and any action related thereto will be governed by the laws of the State of Delaware without regard to its conflict of laws provisions. The exclusive jurisdiction and venue of any action to prevent the actual or threatened infringement, misappropriation or violation of a partys copyrights, trademarks, trade secrets, patents or other intellectual property rights will be the state and federal courts located in the United States District Court of the District of Delaware and each of the parties hereto waives any objection to jurisdiction and venue in such courts.</p>\r\n<p style=\"text-align: justify;\"><b>Entire Agreement</b></p>\r\n<p style=\"text-align: justify;\">These Terms constitute the entire and exclusive understanding and agreement between Lab Fellows and you regarding the Site, Services and Collective Content, and these Terms supersede and replace any and all prior oral or written understandings or agreements between Lab Fellows and you regarding the Site, Services and Collective Content.</p>\r\n<p style=\"text-align: justify;\"><b>Assignment</b></p>\r\n<p style=\"text-align: justify;\">You may not assign or transfer these Terms, by operation of law or otherwise, without Lab Fellows prior written consent. Any attempt by you to assign or transfer these Terms, without such consent, will be null and of no effect. Lab Fellows may assign or transfer these Terms, at its sole discretion, without restriction. Subject to the foregoing, these Terms will bind and inure to the benefit of the parties, their successors and permitted assigns.</p>\r\n<p style=\"text-align: justify;\"><b>Notices</b></p>\r\n<p style=\"text-align: justify;\">Except as explicitly stated otherwise, all notices required from you under these Terms must be<a title=\"info@labfellows.com\" href=\"mailto:info@labfellows.com?subject=Copyright\">sent here</a>or to any other address(es) specified by Lab Fellows from time-to-time, in its sole discretion. Legal notices shall be served to Lab Fellows\' registered agent in the State of Delaware. Lab Fellows shall provide you with notices about changes to the Lab Fellows Services or these Terms, including the Privacy Policy, by posting them on the Site or by sending an email to the email address you provide to Lab Fellows during the registration process. Legal notices shall also be provided to you at such email address. Email notices shall be deemed given 24 hours after the email is sent, unless the sending party is notified that the email address is invalid.</p>\r\n<p style=\"text-align: justify;\">Alternatively, we may give you legal notice by mail to the address provided during the PayPal verification process. In such case, notice shall be deemed given three days after the date of mailing.</p>\r\n<p style=\"text-align: justify;\"><b>Dispute Resolution</b></p>\r\n<p style=\"text-align: justify;\">You and Lab Fellows agree that<i>any dispute, claim or controversy arising out of or relating to these Terms or the breach, termination, enforcement, interpretation or validity thereof or the use of the Site or Services (collectively, <b>Disputes</b>) will be settled by binding arbitration, except that each party retains the right to bring an individual action in small claims court and the right to seek</i>injunctive or other equitable relief in a court of competent jurisdiction to prevent the actual or threatened infringement, misappropriation or violation of a partys copyrights, trademarks, trade secrets, patents or other intellectual property rights.<b><i>You acknowledge and agree that you and Lab Fellows</i>are each waiving the right to a trial by jury or to participate as a plaintiff or class member in any purported class action or representative proceeding.</b>Further, unless both you and Lab Fellows otherwise agree in writing, the arbitrator may not consolidate more than one persons claims, and may not otherwise preside over any form of any class or representative proceeding. If this specific paragraph is held unenforceable, then the entirety of this Dispute Resolution section will be deemed void. Except as provided in the preceding sentence, this Dispute Resolution section will survive any termination of these Terms.</p>\r\n<p style=\"text-align: justify;\">Changes. Notwithstanding the provisions of the Modification section above, if Lab Fellows changes this Dispute Resolution section after the date you first accepted these Terms (or accepted any subsequent changes to these Terms), you may reject any such change by sending us written notice (including by email to<a title=\"info@labfellows.com\" href=\"mailto:info@labfellows.com?subject=Connecting%20with%20Lab%20Fellows%20Team\">info@labfellows.com</a>) within 30 days of the date such change became effective, as indicated in the Last Updated Date above or in the date of Lab Fellows email to you notifying you of such change. By rejecting any change, you are agreeing that you will arbitrate any Dispute between you and Lab Fellows in accordance with the provisions of this Dispute Resolution section as of the date you first accepted these Terms (or accepted any subsequent changes to these Terms).</p>\r\n<p style=\"text-align: justify;\"><b>General</b></p>\r\n<p style=\"text-align: justify;\">The failure of Lab Fellows to enforce any right or provision of these Terms will not constitute a waiver of future enforcement of that right or provision. The waiver of any such right or provision will be effective only if in writing and signed by a duly authorized representative of Lab Fellows. Except as expressly set for