Members should refrain from the use of profanity.</p>\r\n<p style=\"text-align: justify;\">You may never use another Members account without permission. When creating your account, you must provide accurate and complete information. You are responsible for the activity that occurs on your account, and you must keep your account password secure. We will not be liable for any losses caused by any unauthorized use of your account.</p>\r\n<p style=\"text-align: justify;\"><b>Account Registration</b></p>\r\n<p style=\"text-align: justify;\">In order to access certain features of the Site and Services and to post any Member Content on the Site or through the Services you must register to create an account (<b>Account</b>) and become a Member. You agree to provide accurate, current and complete information during the registration process and to update such information to keep it accurate, current and complete. Lab Fellowsreserves the right to suspend or terminate your Account if any information provided during the registration process or thereafter proves to be inaccurate, not current or incomplete. You are responsible for safeguarding your password. You agree that you will not disclose your password to any third party and that you will take sole responsibility for any activities or actions under your Account, whether or not you have authorized such activities or actions. You will immediately notify Lab Fellowsof any unauthorized use of your Account.</p>\r\n<p style=\"text-align: justify;\"><b>Account Information and Payment Terms</b></p>\r\n<p style=\"text-align: justify;\">Lab Fellowsmakes certain features of the Services available without charge. However, if you choose to utilize any paid features of the Services, you authorize Lab Fellowsor its third party payment processor to charge your method of payment in the amount of any paid features of the Services that you choose to utilize. More information related to paid features of the Services is accessible by contacting 