ng the PayPal verification process. In such case, notice shall be deemed given three days after the date of mailing.</p>\r\n<p style=\"text-align: justify;\"><b>Dispute Resolution</b></p>\r\n<p style=\"text-align: justify;\">You and Lab Fellows agree that<i>any dispute, claim or controversy arising out of or relating to these Terms or the breach, termination, enforcement, interpretation or validity thereof or the use of the Site or Services (collectively, <b>Disputes</b>) will be settled by binding arbitration, except that each party retains the right to bring an individual action in small claims court and the right to seek</i>injunctive or other equitable relief in a court of competent jurisdiction to prevent the actual or threatened infringement, misappropriation or violation of a partys copyrights, trademarks, trade secrets, patents or other intellectual property rights.<b><i>You acknowledge and agree that you and Lab Fellows</i>are each waiving the right to a trial by jury or to participate as a plaintiff or class member in any purported class action or representative proceeding.</b>Further, unless both you and Lab Fellows otherwise agree in writing, the arbitrator may not consolidate more than one persons claims, and may not otherwise preside over any form of any class or representative proceeding. If this specific paragraph is held unenforceable, then the entirety of this Dispute Resolution section will be deemed void. Except as provided in the preceding sentence, this Dispute Resolution section will survive any termination of these Terms.</p>\r\n<p style=\"text-align: justify;\">Changes. Notwithstanding the provisions of the Modification section above, if Lab Fellows changes this Dispute Resolution section after the date you first accepted these Terms (or accepted any subsequent changes to these Terms), you may reject any such change by sending us written notice (including by email to<a title=\"info@labfellows.com\" href=\"mailto:info@labfellows.com?subject=Connecting%20with%20Lab%20Fellows%20Team\">info@labfellows.com</a>) within 30 days of the date such change became effective, as indicated in the Last Updated Date above or in the date of Lab Fellows email to you notifying you of such change. By rejecting any change, you are agreeing that you will arbitrate any Dispute between you and Lab Fellows in accordance with the provisions of this Dispute Resolution section as of the date you first accepted these Terms (or accepted any subsequent changes to these Terms).</p>\r\n<p style=\"text-align: justify;\"><b>General</b></p>\r\n<p style=\"text-align: justify;\">The failure of Lab Fellows to enforce any right or provision of these Terms will not constitute a waiver of future enforcement of that right or provision. The waiver of any such right or provision will be effective only if in writing and signed by a duly authorized representative of Lab Fellows. Except as expressly set forth in these Terms, the exercise by either party of any of its remedies under these Terms will be without prejudice to its other remedies under these Terms or otherwise. If for any reason a court of competent jurisdiction finds any provision of these Terms invalid or unenforceable, that provision will be enforced to the maximum extent permissible and the other provisions of these Terms will remain in full force and effect.</p>\r\n<p style=\"text-align: justify;\"><b>Contacting Lab Fellows</b></p>\r\n<p style=\"text-align: justify;\">If you have any questions about these Terms, please contact <a title=\"info@labfellows.com\" href=\"mailto:info@labfellows.com?subject=Connecting%20with%20Lab%20Fellows%20Team\">Lab Fellows Team</a>.</p>\r\n\r\n<address><b><i>Attn: Lab Fellows, Inc.</i></b></address><address><b><i>United States Corporation Agents, Inc.</i></b><i></i></address><address><b><i>1521 Concord Pike, Suite 301</i></b><i></i></address><address><b><i>Wilmington, DE 19803</i></b><i></i></address>\r\n<p style=\"text-align: justify;\"></p>','Terms of Service','','inherit','open','open','','86-revision-v1','','','2014-03-18 16:23:42','2014-03-18 23:23:42','',86,'http://labfellows.com/86-revision-v1/',0,'revision','',0),(99,16,'2014-03-18 16:24:59','2014-03-18 23:24:59','<h3><b>Lab Fellows Privacy Policy [</b>Updated April 23, 2014]</h3>\r\n<h3>Introduction</h3>\r\nLab Fellows, Inc. (Company or We) respects your privacy and is committed to protecting it through our compliance with this policy.\r\n\r\nThis policy describes the types of information we may collect from you or that you may provide when you visit the website <b><span style=\"text-decoration: underline;\">labfellows.com</span></b> (our Website) and our practices for collecting, using, maintaining, protecting, and disclosing that information.\r\n\r\nThis policy applies to information we collect:\r\n<ul>\r\n	<li>on this Website;</li>\r\n	<li>in e-mail, text, and any other electronic messages between you and this Website;</li>\r\n	<li>Through mobile and desktop applications you download from this Website, which provide dedicated non-browser-based interaction between you and this Website; and</li>\r\n	<li>when you interact with our advertising and applications on third-party websites and services, if those applications or advertising include links to this policy.</li>\r\n</ul>\r\nIt does not apply to information collected by:\r\n<ul>\r\n	<li>us offline or through any other means, including on any other website operated by Company or any third party; or</li>\r\n	<li>any third party, including through any application or content (including advertising) that may link to or be accessible from the Website.</li>\r\n</ul>\r\nPlease read this policy carefully to understand our policies and practices regarding your information and how we will treat it. If you do not agree with our policies and practices, your choice is not to use our Website. By accessing or using this Website, you agree to this privacy policy. This policy may change from time to time. Your continued use of this Website after we make changes is deemed to be acceptance of those changes, so please check the policy periodically for updates.\r\n<h3>Reasons the Company Collects Personal Information</h3>\r\nWe collect your personal information because it helps us deliver a superior level of customer service. It enables us to give you convenient access to our products and services and focus on categories of greatest interest to you. In addition, your personal information helps us keep you posted on the latest product announcements, special offers, and events that you might like to hear about.\r\n<h3>Childrens Privacy</h3>\r\nOur Website is not intended for children under 13 years of age. No one under age 13 may provide any personal information to the Website. We do not knowingly collect personal information from children under 13. If you are under 13, do not use or provide any information on this website or on or through any of its features/register on the Website, make any purchases through the Website or provide any information about yourself to us, including your name, address, telephone number, e-mail address or any screen name or user name you may use. If we learn we have collected or received personal information from a child under 13 without verification of parental consent, we will delete that information. If you believe we might have any information from or about a child under 13, please contact us at<b> </b><a href=\"mailto:info@labfellows.com\">info@labfellows.com</a>.\r\n<h3>Information We Collect</h3>\r\nIf you choose to contact us through our Website, we may collect information:\r\n<ul>\r\n	<li>that is personally identifiable information such as name, e-mail, address, and telephone number; and;</li>\r\n	<li>that is about you but individually does not identify you such as comments you leave or the types of services you are interested in receiving from us.</li>\r\n</ul>\r\n<h3>How We Collect Your Information</h3>\r\nWe collect this information:\r\n<ul>\r\n	<li>Directly from you when you provide it to us.</li>\r\n	<li>Automatically as you navigate through the site. Information collected automatically may include usage details, IP addresses and information collected through cookies, and web beacons</li>\r\n	<li>From third parties (e.g. PayPal).</li>\r\n</ul>\r\n<h3>Information You Provide To Us</h3>\r\nThe information we collect on or through our Website may include:\r\n<ul>\r\n	<li>Information you provide by filling in forms on our Website. This includes information provided at the time of registering for our programs or when requesting further services.</li>\r\n	<li>Records and copies of your correspondence (including e-mail addresses) if you contact us.</li>\r\n	<li>Your responses to surveys that we might ask you to complete for research purposes.</li>\r\n	<li>Details of transactions you carryout through our Website and of the fulfillment of your orders. You may be required to provide financial information before placing an order through our Website.</li>\r\n	<li>Your search queries on the Website.</li>\r\n</ul>\r\nYou also may provide information to be published or displayed (hereinafter, \"posted\") on public areas of the Website, or transmitted to other users of the Website or third parties (collectively, \"User Contributions\"). Your User Contributions are posted on and transmitted to others at your own risk. Although [we limit access to certain pages/you may set certain privacy settings for such information by logging into your account profile], please be aware that no security measures are perfect or impenetrable. Additionally, we cannot control the actions of other users of the Website with whom you may choose to share your User Contributions. Therefore, we cannot and do not guarantee that your User Contributions will not be viewed by unauthorized persons.\r\n<h3>Information We Collect through Automatic Data Collection Technologies</h3>\r\nAs you navigate through and interact with our Website, we may use automatic data collection technologies to collect certain information about your equipment, browsing actions and patterns, including:\r\n<ul>\r\n	<li>Details of your visits to our Website, including traffic data, location data, logs and other communication data and the resources that you access and use on the Website</li>\r\n	<li>Information about your computer and internet connection, including your IP address, operating system and browser type.</li>\r\n</ul>\r\nThe information we collect automatically is statistical data and it may include personal information, but we may maintain it or associate it with personal information we collect in other ways or receive from third parties. It helps us to improve our Website and to deliver a better and more personalized service, including by enabling us to:\r\n<ul>\r\n	<li>Estimate our audience size and usage patterns.</li>\r\n	<li>Store information about your preferences, allowing us to customize our Website according to your individual interests.</li>\r\n	<li>Speed up your searches.</li>\r\n	<li>Recognize you when you return to our Website.</li>\r\n</ul>\r\nThe technologies we use for this automatic data collection may include:\r\n<ul>\r\n	<li>Cookies (or browser cookies). A cookie is a small file placed on the hard drive of your computer. You may refuse to accept browser cookies by activating the appropriate setting on your browser. However, if you select this setting you may be unable to access certain parts of our Website. Unless you have adjusted your browser setting so that it will refuse cookies, our system will issue cookies when you direct your browser to our Website.</li>\r\n	<li>Flash Cookies. Certain features of our Website may use local stored objects (or Flash cookies) to collect and store information about your preferences and navigation to, from and on our Website. Flash cookies are not managed by the same browser settings as are used for browser cookies. For information about managing your privacy and security settings for Flash cookies, see Choices about How We Use and Disclose Your Information.</li>\r\n	<li>Web Beacons. Pages of our the Website [and our e-mails] may contain small electronic files known as web beacons (also referred to as clear gifs. pixel tags and single-pixel gifs) that permit the Company, for example, to count users who have visited those pages or [opened an e-mail] and for other related website statistics (for example, recording the popularity of certain website content and verifying system and server integrity).</li>\r\n</ul>\r\n<h3>Third-party Use of Cookies and Other Tracking Technologies</h3>\r\nSome content or applications, including advertisements, on the Website are served by third-parties, including advertisers, ad networks and servers, content providers and application providers. These third parties may use cookies alone or in conjunction with web beacons or other tracking technologies to collect information about you when you use our website. The information they collect may be associated with your personal information or they may collect information, including personal information, about your online activities over time and across different websites and other online services. They may use this information to provide you with interest-based (behavioral) advertising or other targeted content.\r\n\r\nWe do not control these third parties\' tracking technologies or how they may be used. If you have any questions about an advertisement or other targeted content, you should contact the responsible provider directly.\r\n<h3>How We Use Information</h3>\r\nWe use collected information to make available and to improve our high standard of reliable services. We use such information to:\r\n<ul>\r\n	<li>present our Website and its contents to you;</li>\r\n	<li>respond to inquiries or service requests and monitor such responses;</li>\r\n	<li>provide information about and market our products or services;</li>\r\n	<li>to fulfill any other purpose for which you provide it;</li>\r\n	<li>to carry out our obligations and enforce our rights arising from any contracts entered between you and us, including for billing and collection;</li>\r\n	<li>to notify you about changes to our Website or any products or services we offer or provide through it;</li>\r\n	<li>resolve problems;</li>\r\n	<li>manage the Site and assess usage of the Services; and</li>\r\n	<li>for any other purpose with your consent.</li>\r\n</ul>\r\n<b>Disclosure of Information</b>\r\n\r\nWe may disclose personal information that we collect or you provide as described in this policy:\r\n<ul>\r\n	<li>to our subsidiaries and affiliates;</li>\r\n	<li>to contractors, service providers and other third parties we use to support our business (and who are bound by contractual obligations to keep personal information confidential and use it only for purposes for which we disclose it to them);</li>\r\n	<li>to fulfill the purpose for which you provide it;</li>\r\n	<li>for any other purpose disclosed by us when you provided the information; and</li>\r\n	<li>with your consent.</li>\r\n</ul>\r\nWe may also disclose your personal information:\r\n<ul>\r\n	<li>To comply with a subpoena, warrant, court order, or other comparable legal process, including subpoenas from private parties in a civil action. If the subpoena seeks information about an identified user or limited group of users, well make reasonable business efforts to contact the user(s) before providing information to the party that requests it. We cannot guarantee that we will be able to contact the user(s) in all cases, whether because of a time limit, court order, inability to effectively contact a user, or for any other reason. In addition to the foregoing, we disclose information that we, in good faith, believe is appropriate to cooperate in investigations of fraud or other illegal activity, or to conduct investigations of violations of our Terms of Use. For example, this means that if we conduct a fraud investigation and conclude that one side has engaged in deceptive practices, we can give that person or entitys contact information to victims who request it; and</li>\r\n	<li>If we believe disclosure is necessary or appropriate to protect the rights, property, or safety of Lab Fellow, Inc., our customers or others. This includes exchanging information with other companies and organizations for the purposes of fraud protection and credit risk reduction.</li>\r\n</ul>\r\n<b>Choice and Opt-Out</b>\r\n\r\nWe strive to provide you with choices regarding the personal information you provide to us. We have created mechanisms to provide you with the following control over your information:\r\n\r\nTracking Technologies and Advertising. You can set your browser to refuse all or some browser cookies, or to alert you when cookies are being sent. To learn how you can manage your Flash cookie settings, visit the Flash player settings page on Adobes website. If you disable or refuse cookies, please note that some parts of this site may then be inaccessible or not function properly.\r\n\r\n<b>Disclosure of your Information for Third-Party Advertising</b>. If you do not want us to share your personal information with unaffiliated or non-agent third parties for promotional purposes, you can opt-out by sending us an e-mail stating your request to<b> </b><a href=\"mailto:info@labfellows.com\">info@labfellows.com</a>\r\n\r\n<b>Promotional Offers from the Company</b>. If you do not wish to have your e-mail address/contact information used by the Company to promote our own or third parties products or services, you can opt-out by sending us an e-mail stating your request to <a href=\"mailto:info@labfellows.com\">info@labfellows.com</a>.\r\n\r\nIf we have sent you a promotional e-mail, you may send us a return e-mail asking to be omitted from future e-mail distributions. This opt-out does not apply to information provided to the Company as a result of a product purchase, warranty registration, product service experience, or other transactions.\r\n\r\n<strong>Targeted Advertising.</strong> We do not control third parties collection or use of your information to serve interest-based advertising. However, these third parties may provide you with ways to choose not to have your information collected or used in this way. You can opt out of receiving targeted ads from members of the Network Advertising Initiative (NAI) on the NAIs website.\r\n<h3>Accessing and Correcting Your Information</h3>\r\nYou can review and change your personal information by logging into the Website and visiting your account profile page.\r\n\r\nYou may also send us an e-mail at <a href=\"mailto:info@labfellows.com\">info@labfellows.com</a> to request access to, correct or delete any personal information that you have provided to us. We cannot delete your personal information except by also deleting your user account. We may not accommodate a request to change information if we believe the change would violate any law or legal requirement or cause the information to be incorrect.\r\n\r\nIf you delete your User Contributions from the Website, copies of your User Contributions may remain viewable in cached and archived pages, or might have been copied or stored by other Website users. Proper access and use of information provided on the Website, including User Contributions, is governed by our terms of use.\r\n<h3>How We Protect and Store Personal Information</h3>\r\nWe store and process your personal information using Rackspace. We protect your information using physical, technical and administrative security measures to reduce risks of loss, misuse, unauthorized access, disclosure, or alteration. Some of the safeguards we use are firewalls and physical access controls to our center.\r\n<h3>Links and Redirection to Third Party Sites</h3>\r\nThird Party Sites are not under the control of the Company, and the Company is not responsible for such Third Party Sites. The inclusion or access to Third Party Sites does not imply an endorsement thereof by the Company, or of the provider of such content or services, or of any third party web site.\r\n\r\nPlease be aware that when you enter a Third Party Site, any information you provide, including financial information, is subject to the terms of use and privacy policy of that Third Party Site.\r\n<h3>Data Security</h3>\r\nWe have implemented measures designed to secure your personal information from accidental loss and from unauthorized access, use, alteration and disclosure. All information you provide to us is stored on our secure servers behind firewalls. Any payment transactions will be encrypted using SSL technology.\r\n\r\nThe safety and security of your information also depends on you. Where we have given you or where you have chosen a password for access to certain parts of our Website, you are responsible for keeping this password confidential. We ask you not to share your password with anyone. We urge you to be careful about giving out information in public areas of the Website like message boards. The information you share in public areas may be viewed by any user of the Website.\r\n\r\nUnfortunately, the transmission of information via the internet is not completely secure. Although we do our best to protect your personal information, we cannot guarantee the security of your personal information transmitted to our Website. Any transmission of personal information is at your own risk. We are not responsible for circumvention of any privacy settings or security measures contained on the Website.\r\n<h3>Effective Date; Policy Changes</h3>\r\nIt is our policy to post any changes we make to our privacy policy on this page. If we make material changes to how we treat our users personal information, we will notify you through a notice on the Website home page. You are responsible for periodically visiting our Website and this privacy policy to check for any changes.\r\n<h3>Governing Law; Notice to California Residents</h3>\r\nCalifornia Civil Code Section 1798.83 permits customers who are California residents and who have provided the Company with personal information (as that term is defined in Section 1798.83) to request certain information about the disclosure of that information to third parties for their direct marketing purposes. If you are a California resident with questions regarding this, please contact us via email at <a href=\"mailto:info@labfellows.com\">info@labfellows.com</a> or by mail at:\r\n\r\n<address><b>Attn: Lab Fellows, Inc.</b></address><address><b>United States Corporation Agents, Inc.</b></address><address><b>1521 Concord Pike, Suite 301</b></address><address><b>Wilmington, DE 19803</b></address>\r\n<h3>Contact Us</h3>\r\nIf you have questions regarding this policy, you may contact us at <a href=\"mailto:info@labfellows.com\">info@labfellows.com</a> or send legal documents to our registered agent at:\r\n\r\n<address><b>Attn: Lab Fellows, Inc.</b></address><address><b>United States Corporation Agents, Inc.</b></address><address><b>1521 Concord Pike, Suite 301</b></address><address><b>Wilmington, DE 19803</b></address>Please also visit our Terms of Use establishing the use, disclaimers, and limitations of liability governing the use of our Site.\r\n<h3>Consent</h3>\r\n<h3>By using our Website, you consent to our privacy policy.</h3>','Privacy Policy','','publish','open','open','','privacy-policy','','','2014-04-23 16:57:10','2014-04-23 23:57:10','',0,'http://labfellows.com/?page_id=99',0,'page','',0),(102,16,'2014-03-18 16:29:35','2014-03-18 23:29:35','<p style=\"text-align: justify;\"><b>Last Updated Date:</b>3/18/2014</p>\r\n<p style=\"text-align: justify;\">Lab Fellows, Inc. (Lab Fellows, our, us or we) provides this Privacy Policy to inform you of our policies and procedures regarding the collection, use and disclosure of personal information we receive from users of our Lab Fellows offering, which we make available (i) on our website, accessible at www.labfellows.com (this Site); and (ii) via our online platforms, which are accessible through the Site (together with the Site, the Service). This Privacy Policy applies only to information that you provide to us through the Service. This Privacy Policy may be updated from time to time. We will notify you of any material changes by posting the new Privacy Policy via the Service. You are advised to consult this policy regularly for any changes. Unless otherwise defined in this Privacy Policy, terms used in this Privacy Policy have the same meanings as in our Lab Fellows Terms of Service, accessible at <a title=\"Terms of Service\" href=\"http://www.labfellows.com/terms-of-service\">http://www.labfellows.com/terms-of-service</a>.\r\nAs used in this policy, the terms using and processing information include using cookies on a computer, subjecting the information to statistical or other analysis and using or handling information in any way, including, but not limited to collecting, storing, evaluating, modifying, deleting, using, combining, disclosing and transferring information within our organization or among our affiliates within the United States or internationally.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Information Collection and Use</h3>\r\n<p style=\"text-align: justify;\">Our primary goals in collecting information are to provide and improve our Service, features and content, to administer your use of the Service and to enable users to enjoy and easily navigate the Service.\r\nPersonally Identifiable Information.\r\nWhen you register with us through the Service to become a Member or when you engage in other activities via the Service, we will ask you for personally identifiable information. This refers to information about you that can be used to contact or identify you (<strong>Personal Information</strong>). Personal Information includes, but is not limited to, your name, phone number, credit card or other billing information, email address and home and business postal addresses. We use your Personal Information mainly to provide the Service and administer your inquiries.\r\nWe also collect the other information that you provide as part of registration and your use of the Service (e.g., without limitation, information related to disputes you submit via the Service, information related to your transactions on the Service, zip code (on its own) and individual preferences) (<strong>Non-Identifying Information</strong>).\r\nWe use your Personal Information (in some cases, in conjunction with your Non-Identifying Information) mainly to provide the Service, complete your transactions, and administer your inquiries.\r\nCertain Non-Identifying Information would be considered a part of your Personal Information if it were combined with other identifiers (for example, combining your zip code with your street address) in a way that enables you to be identified. But the same pieces of information are considered Non-Identifying Information when they are taken alone or combined only with other non-identifying information (for example, your viewing preferences). We may combine your Personal Information with Non-Identifying Information and aggregate it with information collected from other Lab Fellows Users (defined below) to attempt to provide you with a better experience, to improve the quality and value of the Service and to analyze and understand how our Site and Service are used. We may also use the combined information without aggregating it to serve you specifically, for instance to deliver a product to you according to your preferences or restrictions.\r\nWe may also use your Personal Information to contact you with Lab Fellows newsletters, marketing or promotional materials and other information that may be of interest to you. If you decide at any time that you no longer wish to receive such communications from us, please follow the unsubscribe instructions provided in any of the communications or via the unsubscribe option. (See <strong>Changing or Deleting Information</strong>, below.)\r\n<span style=\"text-decoration: underline;\">Log Data</span>. When you visit the Service, whether as a registered Member or a non-registered user just browsing (any of these, a <strong>Lab Fellows User</strong>), our servers automatically record information that your browser sends whenever you visit a website (<strong>Log Data</strong>). This Log Data may include information such as your computers Internet Protocol (<strong>IP</strong>) address, browser type or the webpage you were visiting before you came to our Service, pages of our Service that you visit, the time spent on those pages, information you search for on our Service, access times and dates, and other statistics. We use this information to monitor and analyze use of the Site and the Service and for the Services technical administration, to increase our Services functionality and user-friendliness, and to better tailor it to our visitors needs. We also use this information to verify that visitors to the Service meet the criteria required to process their requests. We do not treat Log Data as Personal Information, though we may associate Log Data with Personal Information and aggregate, analyze and evaluate such Log Data for the same purposes as stated above regarding other Non-Identifying Information.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Cookies</h3>\r\n<p style=\"text-align: justify;\">Like many websites, we use cookies to collect information. A cookie is a small data file that we transfer to your computers hard disk for record-keeping purposes. We use cookies for two purposes. First, we utilize persistent cookies to save your login information for future logins to the Service. Second, we utilize session ID cookies to enable certain features of the Service, to better understand how you interact with the Service and to monitor aggregate usage by Lab Fellows Users and web traffic routing on the Service. Unlike persistent cookies, session cookies are deleted from your computer when you log off from the Service and then close your browser. You can instruct your browser, by changing its options, to stop accepting cookies or to prompt you before accepting a cookie from the websites you visit. If you do not accept cookies, however, you may not be able to use all portions of the Site or all functionality of the Service.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Phishing</h3>\r\n<p style=\"text-align: justify;\">Identity theft and the practice currently known as phishing are of great concern to Lab Fellows. Safeguarding information to help protect you from identity theft is a top priority. We do not and will not, at any time, request your credit card information, your login information, or national identification numbers in a non-secure or unsolicited e-mail or telephone communication. For more information about phishing, visit the Federal Trade Commissions website.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Information Sharing and Disclosure</h3>\r\n<p style=\"text-align: justify;\"><span style=\"text-decoration: underline;\">Disputants</span>. If you choose to provide information related to a Dispute via the Service, which may include your Personal Information, we will share information related to the Dispute with the other party to the Dispute in accordance with the selections you make via the Service. Please consider carefully the types of information you choose to share with third parties via the Service.\r\n<span style=\"text-decoration: underline;\">Aggregate Information and Non-Identifying Information</span>. We may share aggregated information that does not include Personal Information and we may otherwise disclose Non-Identifying Information and Log Data with third parties for industry analysis, demographic profiling and other purposes. Any aggregated information shared in these contexts will not contain your Personal Information.\r\n<span style=\"text-decoration: underline;\">Service Providers</span>. We may employ third party companies and individuals to facilitate our Service, to provide the Service on our behalf, to perform Service-related services (e.g., without limitation, maintenance services, database management, web analytics, payment processors, third party dispute resolution professionals (e.g. arbitrators and mediators) and improvement of the Services features) or to assist us in analyzing how our Site and Service are used. These third parties have access to your Personal Information only to perform these tasks on our behalf and are obligated not to disclose or use it for any other purpose.\r\n<span style=\"text-decoration: underline;\">Compliance with Laws and Law Enforcement</span>. Lab Fellows cooperates with government and law enforcement officials and private parties to enforce and comply with the law. We will disclose any information about you to government or law enforcement officials or private parties as we, in our sole discretion, believe necessary or appropriate to respond to claims and legal process (including but not limited to subpoenas), to protect the property and rights of Lab Fellows or a third party, to protect the safety of the public or any person, or to prevent or stop activity we may consider to be, or to pose a risk of being, illegal, unethical or legally actionable activity.\r\n<span style=\"text-decoration: underline;\">Business Transfers</span>. Lab Fellows may sell, transfer or otherwise share some or all of its assets, including your Personal Information, in connection with a merger, acquisition, reorganization or sale of assets or in the event of bankruptcy.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Changing or Deleting Your Information</h3>\r\n<p style=\"text-align: justify;\">All Members may review, update, correct or delete the Personal Information in their registration profile by contacting us. If you completely delete all such information, then your Account may become deactivated. If you would like us to delete your Account in our system, please contact us at <a href=\"mailto:info@labfellows.com?subject=Cancellation%20Request\">info@labfellows.com</a> with a request that we delete your Personal Information from our database. We will use commercially reasonable efforts to honor your request. We may retain an archived copy of your records as required by law or for legitimate business purposes.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Security</h3>\r\n<p style=\"text-align: justify;\">Lab Fellows is very concerned with safeguarding your information. We employ reasonable physical, technological, and administrative security measures and attempt to ensure they are applicable under the circumstances. Any sensitive, personal information (e.g., credit card number, secret security question, etc.) will be encrypted with Secure Socket Layer (SSL). While we strive to ensure the safety and security of your information, we also advise our users to stay alert under different security threats from the internet.\r\nWe will make any legally required disclosures of any breach of the security, confidentiality, or integrity of your unencrypted electronically stored personal data (as defined in applicable state statutes on security breach notification) to you via email or conspicuous posting on the Site in the most expedient time possible and without unreasonable delay, insofar as consistent with (i) the legitimate needs of law enforcement or (ii) any measures necessary to determine the scope of the breach and restore the reasonable integrity of the data system.</p>\r\n\r\n<h3 style=\"text-align: justify;\">International Transfer</h3>\r\n<p style=\"text-align: justify;\">Your information may be transferred to  and maintained on  computers located outside of your state, province, country or other governmental jurisdiction where the privacy laws may not be as protective as those in your jurisdiction. If you are located outside the United States and choose to provide information to us, Lab Fellows transfers Personal Information to the United States and processes it there. Your consent to this Privacy Policy followed by your submission of such information represents your agreement to that transfer.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Links to Other Services</h3>\r\n<p style=\"text-align: justify;\">Our Service contains links to other websites. If you choose click on a third party link, you will be directed to that third partys website. The fact that we link to a website is not an endorsement, authorization or representation of our affiliation with that third party, nor is it an endorsement of their privacy or information security policies or practices. We do not exercise control over third party websites. These other websites may place their own cookies or other files on your computer, collect data or solicit personal information from you. Other websites follow different rules regarding the use or disclosure of the personal information you submit to them. We encourage you to read the privacy policies or statements of the other websites you visit.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Our Policy Toward Children</h3>\r\n<p style=\"text-align: justify;\">The Service is not directed to persons under 18. We do not knowingly collect personally identifiable information from children under 13. If a parent or guardian becomes aware that his or her child has provided us with Personal Information without their consent, he or she should contact us at <a title=\"info@labfellows.com\" href=\"mailto:info@labfellows.com?subject=Remove%20Personal%20Information\">info@labfellows.com</a>. If we become aware that a child under 13 has provided us with Personal Information, we will delete such information from our files.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Contacting Us</h3>\r\n<p style=\"text-align: justify;\">If you have any questions about this Privacy Policy, please contact us at <a title=\"info@labfellows.com\" href=\"mailto:info@labfellows.com?subject=Connecting%20with%20Lab%20Fellows%20Team\">Lab Fellows Team</a> or send legal documents to our registered agent at:</p>\r\n\r\n<address><b><i>Attn: Lab Fellows, Inc.</i></b></address><address><b><i>United States Corporation Agents, Inc.</i></b><i></i></address><address><b><i>1521 Concord Pike, Suite 301</i></b><i></i></address><address><b><i>Wilmington, DE 19803</i></b><i></i></address>','Privacy Policy','','inherit','open','open','','99-revision-v1','','','2014-03-18 16:29:35','2014-03-18 23:29:35','',99,'http://labfellows.com/99-revision-v1/',0,'revision','',0),(100,16,'2014-03-18 16:24:59','2014-03-18 23:24:59','<p style=\"text-align: justify;\"><b>Last Updated Date:</b>3/18/2014</p>\r\n<p style=\"text-align: justify;\">Lab Fellows, Inc. (Lab Fellows, our, us or we) provides this Privacy Policy to inform you of our policies and procedures regarding the collection, use and disclosure of personal information we receive from users of our Lab Fellows offering, which we make available (i) on our website, accessible at www.labfellows.com (this Site); and (ii) via our online platforms, which are accessible through the Site (together with the Site, the Service). This Privacy Policy applies only to information that you provide to us through the Service. This Privacy Policy may be updated from time to time. We will notify you of any material changes by posting the new Privacy Policy via the Service. You are advised to consult this policy regularly for any changes. Unless otherwise defined in this Privacy Policy, terms used in this Privacy Policy have the same meanings as in our Lab Fellows Terms of Service, accessible at <a title=\"Terms of Service\" href=\"http://www.labfellows.com/terms-of-service\">http://www.labfellows.com/terms-of-service</a>.\r\nAs used in this policy, the terms using and processing information include using cookies on a computer, subjecting the information to statistical or other analysis and using or handling information in any way, including, but not limited to collecting, storing, evaluating, modifying, deleting, using, combining, disclosing and transferring information within our organization or among our affiliates within the United States or internationally.</p>\r\n<p style=\"text-align: justify;\"></p>\r\n\r\n<h3 style=\"text-align: justify;\">Information Collection and Use</h3>\r\n<p style=\"text-align: justify;\"></p>\r\n<p style=\"text-align: justify;\">Our primary goals in collecting information are to provide and improve our Service, features and content, to administer your use of the Service and to enable users to enjoy and easily navigate the Service.\r\nPersonally Identifiable Information.\r\nWhen you register with us through the Service to become a Member or when you engage in other activities via the Service, we will ask you for personally identifiable information. This refers to information about you that can be used to contact or identify you (<strong>Personal Information</strong>). Personal Information includes, but is not limited to, your name, phone number, credit card or other billing information, email address and home and business postal addresses. We use your Personal Information mainly to provide the Service and administer your inquiries.\r\nWe also collect the other information that you provide as part of registration and your use of the Service (e.g., without limitation, information related to disputes you submit via the Service, information related to your transactions on the Service, zip code (on its own) and individual preferences) (<strong>Non-Identifying Information</strong>).\r\nWe use your Personal Information (in some cases, in conjunction with your Non-Identifying Information) mainly to provide the Service, complete your transactions, and administer your inquiries.\r\nCertain Non-Identifying Information would be considered a part of your Personal Information if it were combined with other identifiers (for example, combining your zip code with your street address) in a way that enables you to be identified. But the same pieces of information are considered Non-Identifying Information when they are taken alone or combined only with other non-identifying information (for example, your viewing preferences). We may combine your Personal Information with Non-Identifying Information and aggregate it with information collected from other Lab Fellows Users (defined below) to attempt to provide you with a better experience, to improve the quality and value of the Service and to analyze and understand how our Site and Service are used. We may also use the combined information without aggregating it to serve you specifically, for instance to deliver a product to you according to your preferences or restrictions.\r\nWe may also use your Personal Information to contact you with Lab Fellows newsletters, marketing or promotional materials and other information that may be of interest to you. If you decide at any time that you no longer wish to receive such communications from us, please follow the unsubscribe instructions provided in any of the communications or via the unsubscribe option. (See <strong>Changing or Deleting Information</strong>, below.)\r\n<span style=\"text-decoration: underline;\">Log Data</span>. When you visit the Service, whether as a registered Member or a non-registered user just browsing (any of these, a <strong>Lab Fellows User</strong>), our servers automatically record information that your browser sends whenever you visit a website (<strong>Log Data</strong>). This Log Data may include information such as your computers Internet Protocol (<strong>IP</strong>) address, browser type or the webpage you were visiting before you came to our Service, pages of our Service that you visit, the time spent on those pages, information you search for on our Service, access times and dates, and other statistics. We use this information to monitor and analyze use of the Site and the Service and for the Services technical administration, to increase our Services functionality and user-friendliness, and to better tailor it to our visitors needs. We also use this information to verify that visitors to the Service meet the criteria required to process their requests. We do not treat Log Data as Personal Information, though we may associate Log Data with Personal Information and aggregate, analyze and evaluate such Log Data for the same purposes as stated above regarding other Non-Identifying Information.</p>\r\n<p style=\"text-align: justify;\"></p>\r\n\r\n<h3 style=\"text-align: justify;\">Cookies</h3>\r\n<p style=\"text-align: justify;\"></p>\r\n<p style=\"text-align: justify;\">Like many websites, we use cookies to collect information. A cookie is a small data file that we transfer to your computers hard disk for record-keeping purposes. We use cookies for two purposes. First, we utilize persistent cookies to save your login information for future logins to the Service. Second, we utilize session ID cookies to enable certain features of the Service, to better understand how you interact with the Service and to monitor aggregate usage by Lab Fellows Users and web traffic routing on the Service. Unlike persistent cookies, session cookies are deleted from your computer when you log off from the Service and then close your browser. You can instruct your browser, by changing its options, to stop accepting cookies or to prompt you before accepting a cookie from the websites you visit. If you do not accept cookies, however, you may not be able to use all portions of the Site or all functionality of the Service.</p>\r\n<p style=\"text-align: justify;\"></p>\r\n\r\n<h3 style=\"text-align: justify;\">Phishing</h3>\r\n<p style=\"text-align: justify;\"></p>\r\n<p style=\"text-align: justify;\">Identity theft and the practice currently known as phishing are of great concern to Lab Fellows. Safeguarding information to help protect you from identity theft is a top priority. We do not and will not, at any time, request your credit card information, your login information, or national identification numbers in a non-secure or unsolicited e-mail or telephone communication. For more information about phishing, visit the Federal Trade Commissions website.</p>\r\n<p style=\"text-align: justify;\"></p>\r\n\r\n<h3 style=\"text-align: justify;\">Information Sharing and Disclosure</h3>\r\n<p style=\"text-align: justify;\"></p>\r\n<p style=\"text-align: justify;\"><span style=\"text-decoration: underline;\">Disputants</span>. If you choose to provide information related to a Dispute via the Service, which may include your Personal Information, we will share information related to the Dispute with the other party to the Dispute in accordance with the selections you make via the Service. Please consider carefully the types of information you choose to share with third parties via the Service.\r\n<span style=\"text-decoration: underline;\">Aggregate Information and Non-Identifying Information</span>. We may share aggregated information that does not include Personal Information and we may otherwise disclose Non-Identifying Information and Log Data with third parties for industry analysis, demographic profiling and other purposes. Any aggregated information shared in these contexts will not contain your Personal Information.\r\n<span style=\"text-decoration: underline;\">Service Providers</span>. We may employ third party companies and individuals to facilitate our Service, to provide the Service on our behalf, to perform Service-related services (e.g., without limitation, maintenance services, database management, web analytics, payment processors, third party dispute resolution professionals (e.g. arbitrators and mediators) and improvement of the Services features) or to assist us in analyzing how our Site and Service are used. These third parties have access to your Personal Information only to perform these tasks on our behalf and are obligated not to disclose or use it for any other purpose.\r\n<span style=\"text-decoration: underline;\">Compliance with Laws and Law Enforcement</span>. Lab Fellows cooperates with government and law enforcement officials and private parties to enforce and comply with the law. We will disclose any information about you to government or law enforcement officials or private parties as we, in our sole discretion, believe necessary or appropriate to respond to claims and legal process (including but not limited to subpoenas), to protect the property and rights of Lab Fellows or a third party, to protect the safety of the public or any person, or to prevent or stop activity we may consider to be, or to pose a risk of being, illegal, unethical or legally actionable activity.\r\n<span style=\"text-decoration: underline;\">Business Transfers</span>. Lab Fellows may sell, transfer or otherwise share some or all of its assets, including your Personal Information, in connection with a merger, acquisition, reorganization or sale of assets or in the event of bankruptcy.</p>\r\n<p style=\"text-align: justify;\"></p>\r\n\r\n<h3 style=\"text-align: justify;\">Changing or Deleting Your Information</h3>\r\n<p style=\"text-align: justify;\"></p>\r\n<p style=\"text-align: justify;\">All Members may review, update, correct or delete the Personal Information in their registration profile by contacting us. If you completely delete all such information, then your Account may become deactivated. If you would like us to delete your Account in our system, please contact us at <a href=\"mailto:info@labfellows.com?subject=Cancellation%20Request\">info@labfellows.com</a> with a request that we delete your Personal Information from our database. We will use commercially reasonable efforts to honor your request. We may retain an archived copy of your records as required by law or for legitimate business purposes.</p>\r\n<p style=\"text-align: justify;\"></p>\r\n\r\n<h3 style=\"text-align: justify;\">Security</h3>\r\n<p style=\"text-align: justify;\"></p>\r\n<p style=\"text-align: justify;\">Lab Fellows is very concerned with safeguarding your information. We employ reasonable physical, technological, and administrative security measures and attempt to ensure they are applicable under the circumstances. Any sensitive, personal information (e.g., credit card number, secret security question, etc.) will be encrypted with Secure Socket Layer (SSL). While we strive to ensure the safety and security of your information, we also advise our users to stay alert under different security threats from the internet.\r\nWe will make any legally required disclosures of any breach of the security, confidentiality, or integrity of your unencrypted electronically stored personal data (as defined in applicable state statutes on security breach notification) to you via email or conspicuous posting on the Site in the most expedient time possible and without unreasonable delay, insofar as consistent with (i) the legitimate needs of law enforcement or (ii) any measures necessary to determine the scope of the breach and restore the reasonable integrity of the data system.</p>\r\n<p style=\"text-align: justify;\"></p>\r\n\r\n<h3 style=\"text-align: justify;\">International Transfer</h3>\r\n<p style=\"text-align: justify;\"></p>\r\n<p style=\"text-align: justify;\">Your information may be transferred to  and maintained on  computers located outside of your state, province, country or other governmental jurisdiction where the privacy laws may not be as protective as those in your jurisdiction. If you are located outside the United States and choose to provide information to us, Lab Fellows transfers Personal Information to the United States and processes it there. Your consent to this Privacy Policy followed by your submission of such information represents your agreement to that transfer.</p>\r\n<p style=\"text-align: justify;\"></p>\r\n\r\n<h3 style=\"text-align: justify;\">Links to Other Services</h3>\r\n<p style=\"text-align: justify;\"></p>\r\n<p style=\"text-align: justify;\">Our Service contains links to other websites. If you choose click on a third party link, you will be directed to that third partys website. The fact that we link to a website is not an endorsement, authorization or representation of our affiliation with that third party, nor is it an endorsement of their privacy or information security policies or practices. We do not exercise control over third party websites. These other websites may place their own cookies or other files on your computer, collect data or solicit personal information from you. Other websites follow different rules regarding the use or disclosure of the personal information you submit to them. We encourage you to read the privacy policies or statements of the other websites you visit.</p>\r\n<p style=\"text-align: justify;\"></p>\r\n\r\n<h3 style=\"text-align: justify;\">Our Policy Toward Children</h3>\r\n<p style=\"text-align: justify;\"></p>\r\n<p style=\"text-align: justify;\">The Service is not directed to persons under 18. We do not knowingly collect personally identifiable information from children under 13. If a parent or guardian becomes aware that his or her child has provided us with Personal Information without their consent, he or she should contact us at <a title=\"info@labfellows.com\" href=\"mailto:info@labfellows.com?subject=Remove%20Personal%20Information\">info@labfellows.com</a>. If we become aware that a child under 13 has provided us with Personal Information, we will delete such information from our files.</p>\r\n<p style=\"text-align: justify;\"></p>\r\n\r\n<h3 style=\"text-align: justify;\">Contacting Us</h3>\r\n<p style=\"text-align: justify;\"></p>\r\n<p style=\"text-align: justify;\">If you have any questions about this Privacy Policy, please contact us at <a title=\"info@labfellows.com\" href=\"mailto:info@labfellows.com?subject=Connecting%20with%20Lab%20Fellows%20Team\">Lab Fellows Team</a> or send legal documents to our registered agent at:</p>\r\n\r\n<address><b><i>Attn: Lab Fellows, Inc.</i></b></address><address><b><i>United States Corporation Agents, Inc.</i></b><i></i></address><address><b><i>1521 Concord Pike, Suite 301</i></b><i></i></address><address><b><i>Wilmington, DE 19803</i></b><i></i></address>\r\n<p style=\"text-align: justify;\"></p>\r\n<p style=\"text-align: justify;\"></p>','Privacy Policy','','inherit','open','open','','99-revision-v1','','','2014-03-18 16:24:59','2014-03-18 23:24:59','',99,'http://labfellows.com/99-revision-v1/',0,'revision','',0),(103,16,'2014-03-18 20:03:24','2014-03-19 03:03:24','<p style=\"text-align: justify;\"><b>Last Updated Date:</b>3/18/2014</p>\r\n<p style=\"text-align: justify;\">Lab Fellows, Inc. (Lab Fellows, our, us or we) provides this Privacy Policy to inform you of our policies and procedures regarding the collection, use and disclosure of personal information we receive from users of our Lab Fellows offering, which we make available (i) on our website, accessible at www.labfellows.com (this Site); and (ii) via our online platforms, which are accessible through the Site (together with the Site, the Service). This Privacy Policy applies only to information that you provide to us through the Service. This Privacy Policy may be updated from time to time. We will notify you of any material changes by posting the new Privacy Policy via the Service. You are advised to consult this policy regularly for any changes. Unless otherwise defined in this Privacy Policy, terms used in this Privacy Policy have the same meanings as in our Lab Fellows Terms of Service, accessible at <a title=\"Terms of Service\" href=\"http://www.labfellows.com/terms-of-service\">http://www.labfellows.com/terms-of-service</a>.\r\nAs used in this policy, the terms using and processing information include using cookies on a computer, subjecting the information to statistical or other analysis and using or handli