 same pieces of information are considered Non-Identifying Information when they are taken alone or combined only with other non-identifying information (for example, your viewing preferences). We may combine your Personal Information with Non-Identifying Information and aggregate it with information collected from other Lab Fellows Users (defined below) to attempt to provide you with a better experience, to improve the quality and value of the Service and to analyze and understand how our Site and Service are used. We may also use the combined information without aggregating it to serve you specifically, for instance to deliver a product to you according to your preferences or restrictions.\r\nWe may also use your Personal Information to contact you with Lab Fellows newsletters, marketing or promotional materials and other information that may be of interest to you. If you decide at any time that you no longer wish to receive such communications from us, please follow the unsubscribe instructions provided in any of the communications or via the unsubscribe option. (See <strong>Changing or Deleting Information</strong>, below.)\r\n<span style=\"text-decoration: underline;\">Log Data</span>. When you visit the Service, whether as a registered Member or a non-registered user just browsing (any of these, a <strong>Lab Fellows User</strong>), our servers automatically record information that your browser sends whenever you visit a website (<strong>Log Data</strong>). This Log Data may include information such as your computers Internet Protocol (<strong>IP</strong>) address, browser type or the webpage you were visiting before you came to our Service, pages of our Service that you visit, the time spent on those pages, information you search for on our Service, access times and dates, and other statistics. We use this information to monitor and analyze use of the Site and the Service and for the Services technical administration, to increase our Services functionality and user-friendliness, and to better tailor it to our visitors needs. We also use this information to verify that visitors to the Service meet the criteria required to process their requests. We do not treat Log Data as Personal Information, though we may associate Log Data with Personal Information and aggregate, analyze and evaluate such Log Data for the same purposes as stated above regarding other Non-Identifying Information.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Cookies</h3>\r\n<p style=\"text-align: justify;\">Like many websites, we use cookies to collect information. A cookie is a small data file that we transfer to your computers hard disk for record-keeping purposes. We use cookies for two purposes. First, we utilize persistent cookies to save your login information for future logins to the Service. Second, we utilize session ID cookies to enable certain features of the Service, to better understand how you interact with the Service and to monitor aggregate usage by Lab Fellows Users and web traffic routing on the Service. Unlike persistent cookies, session cookies are deleted from your computer when you log off from the Service and then close your browser. You can instruct your browser, by changing its options, to stop accepting cookies or to prompt you before accepting a cookie from the websites you visit. If you do not accept cookies, however, you may not be able to use all portions of the Site or all functionality of the Service.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Phishing</h3>\r\n<p style=\"text-align: justify;\">Identity theft and the practice currently known as phishing are of great concern to Lab Fellows. Safeguarding information to help protect you from identity theft is a top priority. We do not and will not, at any time, request your credit card information, your login information, or national identification numbers in a non-secure or unsolicited e-mail or telephone communication. For more information about phishing, visit the Federal Trade Commissions website.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Information Sharing and Disclosure</h3>\r\n<p style=\"text-align: justify;\"><span style=\"text-decoration: underline;\">Disputants</span>. If you choose to provide information related to a Dispute via the Service, which may include your Personal Information, we will share information related to the Dispute with the other party to the Dispute in accordance with the selections you make via the Service. Please consider carefully the types of information you choose to share with third parties via the Service.\r\n<span style=\"text-decoration: underline;\">Aggregate Information and Non-Identifying Information</span>. We may share aggregated information that does not include Personal Information and we may otherwise disclose Non-Identifying Information and Log Data with third parties for industry analysis, demographic profiling and other purposes. Any aggregated information shared in these contexts will not contain your Personal Information.\r\n<span style=\"text-decoration: underline;\">Service Providers</span>. We may employ third party companies and individuals to facilitate our Service, to provide the Service on our behalf, to perform Service-related services (e.g., without limitation, maintenance services, database management, web analytics, payment processors, third party dispute resolution professionals (e.g. arbitrators and mediators) and improvement of the Services features) or to assist us in analyzing how our Site and Service are used. These third parties have access to your Personal Information only to perform these tasks on our behalf and are obligated not to disclose or use it for any other purpose.\r\n<span style=\"text-decoration: underline;\">Compliance with Laws and Law Enforcement</span>. Lab Fellows cooperates with government and law enforcement officials and private parties to enforce and comply with the law. We will disclose any information about you to government or law enforcement officials or private parties as we, in our sole discretion, believe necessary or appropriate to respond to claims and legal process (including but not limited to subpoenas), to protect the property and rights of Lab Fellows or a third party, to protect the safety of the public or any person, or to prevent or stop activity we may consider to be, or to pose a risk of being, illegal, unethical or legally actionable activity.\r\n<span style=\"text-decoration: underline;\">Business Transfers</span>. Lab Fellows may sell, transfer or otherwise share some or all of its assets, including your Personal Information, in connection with a merger, acquisition, reorganization or sale of assets or in the event of bankruptcy.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Changing or Deleting Your Information</h3>\r\n<p style=\"text-align: justify;\">All Members may review, update, correct or delete the Personal Information in their registration profile by contacting us. If you completely delete all such information, then your Account may become deactivated. If you would like us to delete your Account in our system, please contact us at <a href=\"mailto:info@labfellows.com?subject=Cancellation%20Request\">info@labfellows.com</a> with a request that we delete your Personal Information from our database. We will use commercially reasonable efforts to honor your request. We may retain an archived copy of your records as required by law or for legitimate business purposes.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Security</h3>\r\n<p style=\"text-align: justify;\">Lab Fellows is very concerned with safeguarding your information. We employ reasonable physical, technological, and administrative security measures and attempt to ensure they are applicable under the circumstances. Any sensitive, personal information (e.g., credit card number, secret security question, etc.) will be encrypted with Secure Socket Layer (SSL). While we strive to ensure the safety and security of your information, we also advise our users to stay alert under different security threats from the internet.\r\nWe will make any legally required disclosures of any breach of the security, confidentiality, or integrity of your unencrypted electronically stored personal data (as defined in applicable state statutes on security breach notification) to you via email or conspicuous posting on the Site in the most expedient time possible and without unreasonable delay, insofar as consistent with (i) the legitimate needs of law enforcement or (ii) any measures necessary to determine the scope of the breach and restore the reasonable integrity of the data system.</p>\r\n\r\n<h3 style=\"text-align: justify;\">International Transfer</h3>\r\n<p style=\"text-align: justify;\">Your information may be transferred to  and maintained on  computers located outside of your state, province, country or other governmental jurisdiction where the privacy laws may not be as protective as those in your jurisdiction. If you are located outside the United States and choose to provide information to us, Lab Fellows transfers Personal Information to the United States and processes it there. Your consent to this Privacy Policy followed by your submission of such information represents your agreement to that transfer.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Links to Other Services</h3>\r\n<p style=\"text-align: justify;\">Our Service contains links to other websites. If you choose click on a third party link, you will be directed to that third partys website. The fact that we link to a website is not an endorsement, authorization or representation of our affiliation with that third party, nor is it an endorsement of their privacy or information security policies or practices. We do not exercise control over third party websites. These other websites may place their own cookies or other files on your computer, collect data or solicit personal information from you. Other websites follow different rules regarding the use or disclosure of the personal information you submit to them. We encourage you to read the privacy policies or statements of the other websites you visit.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Our Policy Toward Children</h3>\r\n<p style=\"text-align: justify;\">The Service is not directed to persons under 18. We do not knowingly collect personally identifiable information from children under 13. If a parent or guardian becomes aware that his or her child has provided us with Personal Information without their consent, he or she should contact us at <a title=\"info@labfellows.com\" href=\"mailto:info@labfellows.com?subject=Remove%20Personal%20Information\">info@labfellows.com</a>. If we become aware that a child under 13 has provided us with Personal Information, we will delete such information from our files.</p>\r\n\r\n<h3 style=\"text-align: justify;\">Contacting Us</h3>\r\n<p style=\"text-align: justify;\">If you have any questions about this Privacy Policy, please contact us at <a title=\"info@labfellows.com\" href=\"mailto:info@labfellows.com?subject=Connecting%20with%20Lab%20Fellows%20Team\">Lab Fellows Team</a> or send legal documents to our registered agent at:</p>\r\n\r\n<address><b><i>Attn: Lab Fellows, Inc.</i></b></address><address><b><i>United States Corporation Agents, Inc.</i></b><i></i></address><address><b><i>1521 Concord Pike, Suite 301</i></b><i></i></address><address><b><i>Wilmington, DE 19803</i></b><i></i></address><address></address>','Privacy Policy','','inherit','open','open','','99-revision-v1','','','2014-03-18 20:03:24','2014-03-19 03:03:24','',99,'http://labfellows.com/99-revision-v1/',0,'revision','',0),(618,53,'2014-10-09 06:15:04','2014-10-09 13:15:04','','Uploaded image HiScan-1.jpg','','inherit','open','open','','uploaded-image-hiscan-1-jpg','','','2014-10-09 06:15:04','2014-10-09 13:15:04','',616,'',0,'attachment','image/jpeg',0),(404,69,'2014-08-14 16:05:38','2014-08-14 23:05:38','Avidity NanoMedicines is located at 10975 N Torrey Pines Road, Suite 150, La Jolla, CA 92037.<br />\r\n<br />\r\nWe are excited to be in our new space and are looking to host a small start-up company to share our entrepreneurial environment and provide a critical mass of activity in the lab. We are able to host up to 10 people with a combination of wet lab (Chemistry and Biology) and office space. We would entertain a licensing agreement for use of our lab, certain equipment and offices with terms up to 12 months.<br />\r\n<br />\r\nIf you or someone you know is looking to launch a new idea, please contact us. We look forward to cultivating a creative environment and share our new space with someone with vision as big as our own.','Lab space in La Jolla on the Mesa','','publish','open','open','','lab-space-in-la-jolla-available-on-the-mesa','','','2014-09-02 08:15:34','2014-09-02 15:15:34','',0,'http://labfellows.com/?post_type=job&#038;p=404',0,'job','',0),(431,69,'2014-08-18 08:25:42','2014-08-18 15:25:42','','Uploaded image lab.png','','inherit','open','open','','uploaded-image-lab-png','','','2014-08-18 08:25:42','2014-08-18 15:25:42','',404,'',0,'attachment','image/png',0),(435,16,'2014-08-19 07:42:07','2014-08-19 14:42:07','<a href=\"http://labfellows.com/wp-content/uploads/2014/05/whyus.png\"><img class=\"aligncenter size-large wp-image-434\" src=\"http://labfellows.com/wp-content/uploads/2014/05/whyus-1024x722.png\" alt=\"whyus\" width=\"1024\" height=\"722\" /></a>','How It Works','','inherit','open','open','','121-revision-v1','','','2014-08-19 07:42:07','2014-08-19 14:42:07','',121,'http://labfellows.com/121-revision-v1/',0,'revision','',0),(347,16,'2014-07-12 19:43:57','2014-07-13 02:43:57','<a href=\"http://labfellows.com/wp-content/uploads/2014/04/whyus.png\"><img class=\"alignnone wp-image-345 size-large\" src=\"http://labfellows.com/wp-content/uploads/2014/04/whyus-e1405219419108-1024x603.png\" alt=\"whyus\" width=\"1024\" height=\"603\" /></a>','How It Works','','inherit','open','open','','121-revision-v1','','','2014-07-12 19:43:57','2014-07-13 02:43:57','',121,'http://labfellows.com/121-revision-v1/',0,'revision','',0),(229,39,'2014-05-26 22:02:19','2014-05-27 05:02:19','The 16-capillary 3130xl Genetic Analyzer and the upgradable 4-capillary 3130 Genetic Analyzer give you all the benefits of the industry-leading Applied Biosystems fluorescence-based capillary electrophoresis (CE) system.\r\n\r\nThe 3130 and 3130xl instruments leverage the same technology, reagents, and software interface that make our larger production-scale instruments so successfulan important consideration for labs wishing to standardize on a common platform. Both systems offer industry-leading performance, plus sophisticated automation capabilities that make the most of your time and increase your labs productivity.\r\n\r\nThe 3130xl Genetic Analyzer is the latest generation of 16-capillary electrophoresis instruments for the medium throughput laboratories.\r\n\r\nThe system offers industry-leading performance, plus sophisticated automation capabilities allowing researchers to save time, reduce costs and increase productivity. System features include:\r\n\r\nMinimal setup, simple operation: Right from the beginning, just attach the polymer bottle to the instrument and go. You dont have to be an expert to get expert results.\r\nContinuous, unattended 24-hour operation: With fully automated polymer delivery, sample injection, separation, detection, and data analysis.\r\nLong-term reliability: Robust engineering and extremely low maintenance requirements make the 3130 Series Systems the platforms of choice for high usage and multiple-user environments.\r\nOne polymer, one array for both sequencing and fragment analysis applicationsSeamlessly switch between sequencing and fragment analysis runs, even in the same plate.\r\nMaximum flexibility: Multiple array and polymer configurations allow you to optimize performance for your particular application.\r\n\r\nWorkstation software available during reservation.\r\n\r\nMinimum 3-hours reservation. Contact for multi-day discount.','ABI 3130xl Prism Genetic Analyzer','','publish','open','open','','abi-3130xl-prism-genetic-analyzer','','','2014-07-22 07:56:31','2014-07-22 14:56:31','',0,'http://labfellows.com/?post_type=job&#038;p=229',0,'job','',0),(225,39,'2014-05-26 15:49:48','2014-05-26 22:49:48','','Uploaded image Benches2.jpg','','inherit','open','open','','uploaded-image-benches2-jpg','','','2014-05-26 15:49:48','2014-05-26 22:49:48','',224,'',0,'attachment','image/jpeg',0),(226,39,'2014-05-26 15:49:48','2014-05-26 22:49:48','','Uploaded image Benches4.jpg','','inherit','open','open','','uploaded-image-benches4-jpg','','','2014-05-26 15:49:48','2014-05-26 22:49:48','',224,'',0,'attachment','image/jpeg',0),(121,16,'2014-04-01 20:49:20','2014-04-02 03:49:20','<a href=\"http://labfellows.com/wp-content/uploads/2014/05/whyus.png\"><img class=\"aligncenter size-large wp-image-434\" src=\"http://labfellows.com/wp-content/uploads/2014/05/whyus-1024x722.png\" alt=\"whyus\" width=\"1024\" height=\"722\" /></a>','How It Works','','publish','open','open','','how-it-works','','','2014-08-19 07:42:07','2014-08-19 14:42:07','',0,'http://labfellows.com/?page_id=121',0,'page','',0),(122,16,'2014-04-01 20:49:20','2014-04-02 03:49:20','<img alt=\"\" src=\"webkit-fake-url://82042036-ADA3-4A92-A0B4-4A906A69723B/image.tiff\" />','How It Works','','inherit','open','open','','121-revision-v1','','','2014-04-01 20:49:20','2014-04-02 03:49:20','',121,'http://labfellows.com/121-revision-v1/',0,'revision','',0),(123,16,'2014-04-01 20:50:21','2014-04-02 03:50:21','<img alt=\"\" src=\"webkit-fake-url://82042036-ADA3-4A92-A0B4-4A906A69723B/image.tiff\" width=\"1368\" height=\"1445\" />','How It Works','','inherit','open','open','','121-autosave-v1','','','2014-04-01 20:50:21','2014-04-02 03:50:21','',121,'http://labfellows.com/121-autosave-v1/',0,'revision','',0),(124,16,'2014-04-01 20:50:25','2