ebsite, which provide dedicated non-browser-based interaction between you and this Website; and</li>\r\n	<li>when you interact with our advertising and applications on third-party websites and services, if those applications or advertising include links to this policy.</li>\r\n</ul>\r\nIt does not apply to information collected by:\r\n<ul>\r\n	<li>us offline or through any other means, including on any other website operated by Company or any third party; or</li>\r\n	<li>any third party, including through any application or content (including advertising) that may link to or be accessible from the Website.</li>\r\n</ul>\r\nPlease read this policy carefully to understand our policies and practices regarding your information and how we will treat it. If you do not agree with our policies and practices, your choice is not to use our Website. By accessing or using this Website, you agree to this privacy policy. This policy may change from time to time. Your continued use of this Website after we make changes is deemed to be acceptance of those changes, so please check the policy periodically for updates.\r\n<h3>Reasons the Company Collects Personal Information</h3>\r\nWe collect your personal information because it helps us deliver a superior level of customer service. It enables us to give you convenient access to our products and services and focus on categories of greatest interest to you. In addition, your personal information helps us keep you posted on the latest product announcements, special offers, and events that you might like to hear about.\r\n<h3>Childrens Privacy</h3>\r\nOur Website is not intended for children under 13 years of age. No one under age 13 may provide any personal information to the Website. We do not knowingly collect personal information from children under 13. If you are under 13, do not use or provide any information on this website or on or through any of its features/register on the Website, make any purchases through the Website or provide any information about yourself to us, including your name, address, telephone number, e-mail address or any screen name or user name you may use. If we learn we have collected or received personal information from a child under 13 without verification of parental consent, we will delete that information. If you believe we might have any information from or about a child under 13, please contact us at<b> </b><a href=\"mailto:info@labfellows.com\">info@labfellows.com</a>.\r\n<h3>Information We Collect</h3>\r\nIf you choose to contact us through our Website, we may collect information:\r\n<ul>\r\n	<li>that is personally identifiable information such as name, e-mail, address, and telephone number; and;</li>\r\n	<li>that is about you but individually does not identify you such as comments you leave or the types of services you are interested in receiving from us.</li>\r\n</ul>\r\n<h3>How We Collect Your Information</h3>\r\nWe collect this information:\r\n<ul>\r\n	<li>Directly from you when you provide it to us.</li>\r\n	<li>Automatically as you navigate through the site. Information collected automatically may include usage details, IP addresses and information collected through cookies, and web beacons</li>\r\n	<li>From third parties (e.g. PayPal).</li>\r\n</ul>\r\n<h3>Information You Provide To Us</h3>\r\nThe information we collect on or through our Website may include:\r\n<ul>\r\n	<li>Information you provide by filling in forms on our Website. This includes information provided at the time of registering for our programs or when requesting further services.</li>\r\n	<li>Records and copies of your correspondence (including e-mail addresses) if you contact us.</li>\r\n	<li>Your responses to surveys that we might ask you to complete for research purposes.</li>\r\n	<li>Details of transactions you carryout through our Website and of the fulfillment of your orders. You may be required to provide financial information before placing an order through our Website.</li>\r\n	<li>Your search queries on the Website.</li>\r\n</ul>\r\nYou also may provide information to be published or displayed (hereinafter, \"posted\") on public areas of the Website, or transmitted to other users of the Website or third parties (collectively, \"User Contributions\"). Your User Contributions are posted on and transmitted to others at your own risk. Although [we limit access to certain pages/you may set certain privacy settings for such information by logging into your account profile], please be aware that no security measures are perfect or impenetrable. Additionally, we cannot control the actions of other users of the Website with whom you may choose to share your User Contributions. Therefore, we cannot and do not guarantee that your User Contributions will not be viewed by unauthorized persons.\r\n<h3>Information We Collect through Automatic Data Collection Technologies</h3>\r\nAs you navigate through and interact with our Website, we may use automatic data collection technologies to collect certain information about your equipment, browsing actions and patterns, including:\r\n<ul>\r\n	<li>Details of your visits to our Website, including traffic data, location data, logs and other communication data and the resources that you access and use on the Website</li>\r\n	<li>Information about your computer and internet connection, including your IP address, operating system and browser type.</li>\r\n</ul>\r\nThe information we collect automatically is statistical data and it may include personal information, but we may maintain it or associate it with personal information we collect in other ways or receive from third parties. It helps us to improve our Website and to deliver a better and more personalized service, including by enabling us to:\r\n<ul>\r\n	<li>Estimate our audience size and usage patterns.</li>\r\n	<li>Store information about your preferences, allowing us to customize our Website according to your individual interests.</li>\r\n	<li>Speed up your searches.</li>\r\n	<li>Recognize you when you return to our Website.</li>\r\n</ul>\r\nThe technologies we use for this automatic data collection may include:\r\n<ul>\r\n	<li>Cookies (or browser cookies). A cookie is a small file placed on the hard drive of your computer. You may refuse to accept browser cookies by activating the appropriate setting on your browser. However, if you select this setting you may be unable to access certain parts of our Website. Unless you have adjusted your browser setting so that it will refuse cookies, our system will issue cookies when you direct your browser to our Website.</li>\r\n	<li>Flash Cookies. Certain features of our Website may use local stored objects (or Flash cookies) to collect and store information about your preferences and navigation to, from and on our Website. Flash cookies are not managed by the same browser settings as are used for browser cookies. For information about managing your privacy and security settings for Flash cookies, see Choices about How We Use and Disclose Your Information.</li>\r\n	<li>Web Beacons. Pages of our the Website [and our e-mails] may contain small electronic files known as web beacons (also referred to as clear gifs. pixel tags and single-pixel gifs) that permit the Company, for example, to count users who have visited those pages or [opened an e-mail] and for other related website statistics (for example, recording the popularity of certain website content and verifying system and server integrity).</li>\r\n</ul>\r\n<h3>Third-party Use of Cookies and Other Tracking Technologies</h3>\r\nSome content or applications, including advertisements, on the Website are served by third-parties, including advertisers, ad networks and servers, content providers and application providers. These third parties may use cookies alone or in conjunction with web beacons or other tracking technologies to collect information about you when you use our website. The information they collect may be associated with your personal information or they may collect information, including personal information, about your online activities over time and across different websites and other online services. They may use this information to provide you with interest-based (behavioral) advertising or other targeted content.\r\n\r\nWe do not control these third parties\' tracking technologies or how they may be used. If you have any questions about an advertisement or other targeted content, you should contact the responsible provider directly.\r\n<h3>How We Use Information</h3>\r\nWe use collected information to make available and to improve our high standard of reliable services. We use such information to:\r\n<ul>\r\n	<li>present our Website and its contents to you;</li>\r\n	<li>respond to inquiries or service requests and monitor such responses;</li>\r\n	<li>provide information about and market our products or services;</li>\r\n	<li>to fulfill any other purpose for which you provide it;</li>\r\n	<li>to carry out our obligations and enforce our rights arising from any contracts entered between you and us, including for billing and collection;</li>\r\n	<li>to notify you about changes to our Website or any products or services we offer or provide through it;</li>\r\n	<li>resolve problems;</li>\r\n	<li>manage the Site and assess usage of the Services; and</li>\r\n	<li>for any other purpose with your consent.</li>\r\n</ul>\r\n<b>Disclosure of Information</b>\r\n\r\nWe may disclose personal information that we collect or you provide as described in this policy:\r\n<ul>\r\n	<li>to our subsidiaries and affiliates;</li>\r\n	<li>to contractors, service providers and other third parties we use to support our business (and who are bound by contractual obligations to keep personal information confidential and use it only for purposes for which we disclose it to them);</li>\r\n	<li>to fulfill the purpose for which you provide it;</li>\r\n	<li>for any other purpose disclosed by us when you provided the information; and</li>\r\n	<li>with your consent.</li>\r\n</ul>\r\nWe may also disclose your personal information:\r\n<ul>\r\n	<li>To comply with a subpoena, warrant, court order, or other comparable legal process, including subpoenas from private parties in a civil action. If the subpoena seeks information about an identified user or limited group of users, well make reasonable business efforts to contact the user(s) before providing information to the party that requests it. We cannot guarantee that we will be able to contact the user(s) in all cases, whether because of a time limit, court order, inability to effectively contact a user, or for any other reason. In addition to the foregoing, we disclose information that we, in good faith, believe is appropriate to cooperate in investigations of fraud or other illegal activity, or to conduct investigations of violations of our Terms of Use. For example, this means that if we conduct a fraud investigation and conclude that one side has engaged in deceptive practices, we can give that person or entitys contact information to victims who request it; and</li>\r\n	<li>If we believe disclosure is necessary or appropriate to protect the rights, property, or safety of Lab Fellow, Inc., our customers or others. This includes exchanging information with other companies and organizations for the purposes of fraud protection and credit risk reduction.</li>\r\n</ul>\r\n<b>Choice and Opt-Out</b>\r\n\r\nWe strive to provide you with choices regarding the personal information you provide to us. We have created mechanisms to provide you with the following control over your information:\r\n\r\nTracking Technologies and Advertising. You can set your browser to refuse all or some browser cookies, or to alert you when cookies are being sent. To learn how you can manage your Flash cookie settings, visit the Flash player settings page on Adobes website. If you disable or refuse cookies, please note that some parts of this site may then be inaccessible or not function properly.\r\n\r\n<b>Disclosure of your Information for Third-Party Advertising</b>. If you do not want us to share your personal information with unaffiliated or non-agent third parties for promotional purposes, you can opt-out by sending us an e-mail stating your request to<b> </b><a href=\"mailto:info@labfellows.com\">info@labfellows.com</a>\r\n\r\n<b>Promotional Offers from the Company</b>. If you do not wish to have your e-mail address/contact information used by the Company to promote our own or third parties products or services, you can opt-out by sending us an e-mail stating your request to <a href=\"mailto:info@labfellows.com\">info@labfellows.com</a>.\r\n\r\nIf we have sent you a promotional e-mail, you may send us a return e-mail asking to be omitted from future e-mail distributions. This opt-out does not apply to information provided to the Company as a result of a product purchase, warranty registration, product service experience, or other transactions.\r\n\r\n<strong>Targeted Advertising.</strong> We do not control third parties collection or use of your information to serve interest-based advertising. However, these third parties may provide you with ways to choose not to have your information collected or used in this way. You can opt out of receiving targeted ads from members of the Network Advertising Initiative (NAI) on the NAIs website.\r\n<h3>Accessing and Correcting Your Information</h3>\r\nYou can review and change your personal information by logging into the Website and visiting your account profile page.\r\n\r\nYou may also send us an e-mail at <a href=\"mailto:info@labfellows.com\">info@labfellows.com</a> to request access to, correct or delete any personal information that you have provided to us. We cannot delete your personal information except by also deleting your user account. We may not accommodate a request to change information if we believe the change would violate any law or legal requirement or cause the information to be incorrect.\r\n\r\nIf you delete your User Contributions from the Website, copies of your User Contributions may remain viewable in cached and archived pages, or might have been copied or stored by other Website users. Proper access and use of information provided on the Website, including User Contributions, is governed by our terms of use.\r\n<h3>How We Protect and Store Personal Information</h3>\r\nWe store and process your personal information using Rackspace. We protect your information using physical, technical and administrative security measures to reduce risks of loss, misuse, unauthorized access, disclosure, or alteration. Some of the safeguards we use are firewalls and physical access controls to our center.\r\n<h3>Links and Redirection to Third Party Sites</h3>\r\nThird Party Sites are not under the control of the Company, and the Company is not responsible for such Third Party Sites. The inclusion or access to Third Party Sites does not imply an endorsement thereof by the Company, or of the provider of such content or services, or of any third party web site.\r\n\r\nPlease be aware that when you enter a Third Party Site, any information you provide, including financial information, is subject to the terms of use and privacy policy of that Third Party Site.\r\n<h3>Data Security</h3>\r\nWe have implemented measures designed to secure your personal information from accidental loss and from unauthorized access, use, alteration and disclosure. All information you provide to us is stored on our secure servers behind firewalls. Any payment transactions will be encrypted using SSL technology.\r\n\r\nThe safety and security of your information also depends on you. Where we have given you or where you have chosen a password for access to certain parts of our Website, you are responsible for keeping this password confidential. We ask you not to share your password with anyone. We urge you to be careful about giving out information in public areas of the Website like message boards. The information you share in public areas may be viewed by any user of the Website.\r\n\r\nUnfortunately, the transmission of information via the internet is not completely secure. Although we do our best to protect your personal information, we cannot guarantee the security of your personal information transmitted to our Website. Any transmission of personal information is at your own risk. We are not responsible for circumvention of any privacy settings or security measures contained on the Website.\r\n<h3>Effective Date; Policy Changes</h3>\r\nIt is our policy to post any changes we make to our privacy policy on this page. If we make material changes to how we treat our users personal information, we will notify you through a notice on the Website home page. You are responsible for periodically visiting our Website and this privacy policy to check for any changes.\r\n<h3>Governing Law; Notice to California Residents</h3>\r\nCalifornia Civil Code Section 1798.83 permits customers who are California residents and who have provided the Company with personal information (as that term is defined in Section 1798.83) to request certain information about the disclosure of that information to third parties for their direct marketing purposes. If you are a California resident with questions regarding this, please contact us via email at <a href=\"mailto:info@labfellows.com\">info@labfellows.com</a> or by mail at:\r\n\r\n<address><b>Attn: Lab Fellows, Inc.</b></address><address><b>United States Corporation Agents, Inc.</b></address><address><b>1521 Concord Pike, Suite 301</b></address><address><b>Wilmington, DE 19803</b></address>\r\n<h3>Contact Us</h3>\r\nIf you have questions regarding this policy, you may contact us at <a href=\"mailto:info@labfellows.com\">info@labfellows.com</a> or send legal documents to our registered agent at:\r\n\r\n<address><b>Attn: Lab Fellows, Inc.</b></address><address><b>United States Corporation Agents, Inc.</b></address><address><b>1521 Concord Pike, Suite 301</b></address><address><b>Wilmington, DE 19803</b></address>Please also visit our Terms of Use establishing the use, disclaimers, and limitations of liability governing the use of our Site.\r\n<h3>Consent</h3>\r\n<h3>By using our Website, you consent to our privacy policy.</h3>','Privacy Policy','','inherit','open','open','','99-revision-v1','','','2014-04-23 16:56:04','2014-04-23 23:56:04','',99,'http://labfellows.com/99-revision-v1/',0,'revision','',0),(204,16,'2014-04-23 20:34:40','2014-04-24 03:34:40','[pricerr_theme_search_jobs]','Search Jobs','','inherit','open','open','','44-revision-v1','','','2014-04-23 20:34:40','2014-04-24 03:34:40','',44,'http://labfellows.com/44-revision-v1/',0,'revision','',0),(203,16,'2014-04-23 20:34:00','2014-04-24 03:34:00','[pricerr_theme_search_jobs]','Search Listings','','inherit','open','open','','44-revision-v1','','','2014-04-23 20:34:00','2014-04-24 03:34:00','',44,'http://labfellows.com/44-revision-v1/',0,'revision','',0),(205,16,'2014-04-23 20:35:04','2014-04-24 03:35:04','[pricerr_theme_search_jobs]','Search Listings','','inherit','open','open','','44-revision-v1','','','2014-04-23 20:35:04','2014-04-24 03:35:04','',44,'http://labfellows.com/44-revision-v1/',0,'revision','',0),(206,16,'2014-04-23 20:36:39','2014-04-24 03:36:39','[project_theme_all_projects]','All Equipment Listed','','inherit','open','open','','41-revision-v1','','','2014-04-23 20:36:39','2014-04-24 03:36:39','',41,'http://labfellows.com/41-revision-v1/',0,'revision','',0),(334,16,'2014-06-24 08:03:58','2014-06-24 15:03:58','[pricerr_theme_my_account_shopping]','My Posts','','inherit','open','open','','10-autosave-v1','','','2014-06-24 08:03:58','2014-06-24 15:03:58','',10,'http://labfellows.com/10-autosave-v1/',0,'revision','',0),(224,39,'2014-05-26 15:49:49','2014-05-26 22:49:49','2,000 sqft Biotech Startup Incubator w/ Wet lab benches starting at @$300/montheach.<br />\r\n<br