 Agilent HP 1000 , HP1000 ) Series HPLC System is configured for choice of detector, pump, autosampler.\r\n\r\nDetectors:\r\n\r\nAgilent 1100 Series (G1315A / G1315B) DAD (Diode Array Detector)\r\nAgilent 1100 Series (G1314A) VWD (Variable Wavelength Detector)\r\nAgilent 1100 Series (G1365D) MWD (Multiple Wavelength Detector)\r\nAgilent 1100 Series (G1321A) FLD (Fluorescence Detector)\r\nAgilent 1100 Series (G1362A) RID (Refractive Index Detector)\r\n\r\nPumps\r\n\r\nAgilent 1100 Series (G1312A / G1312B) Binary Pump\r\nAgilent 1100 Series G1311A Quaternary Pump (Quat Pump)\r\nAgilent 1100 Series G1310A Iso Pump (Isocratic Pump)\r\nAgilent 1100 Series G1376A Capillary Pump\r\n\r\nAutosamplers / ALS:\r\n\r\nAgilent 1100 Series G1313A Standard Autosampler\r\nAgilent 1100 Series G1329A Autosampler\r\nAgilent 1100 Series Preparative G2260A Autosampler (Prep ALS)\r\n\r\nALS Therm:\r\n\r\nAgilent 1100 Series (G1330A / G1330B) ALS Therm Sample Chiller\r\n\r\nMSD (with APCI or ESI):\r\n\r\nAgilent 6110 Series Quadrupole MSD\r\nAgilent 6130 Series Quadrupole MSD\r\nAgilent 1200 Series 6340 Ion Trap MSD\r\nAgilent 1100 Series G1956B MSD SL\r\nAgilent 1100 Series G1946D MSD\r\nAgilent G2417 6300 Ion Trap MSD\r\nAgilent 1100 Series G2445 Ion Trap MSD\r\n\r\nSoftware: ChemStation software with PC\r\n\r\nInstallation and Training options available.\r\n\r\nConsumables: available separately PLEASE NOTE: Price and picture of the system will vary depending on the detector combination, autosampler and pump choice, and/or addition of consumables.\r\n\r\nPlease email/call us with specifications of your desired GC and we will try to accommodate.\r\n\r\nMinimum 3-hours reservation. Contact for multi-day discount.','Agilent/HP 1100 Series HPLC System','','publish','open','open','','agilenthp-1100-series-hplc-system','','','2014-07-22 07:39:14','2014-07-22 14:39:14','',0,'http://labfellows.com/?post_type=job&#038;p=245',0,'job','',0),(246,39,'2014-05-26 22:56:57','2014-05-27 05:56:57','','Up