\nThe Agilent 6890N is a state-of-the-art gas chromatograph that provides superior performance for all applications. The key to its performance is the use of advanced electronic pneumatic control (EPC) modules and high performance temperature control. Each EPC unit is optimized for its intended use with a specific inlet and detector option.\r\n\r\nMinimum 3-hours reservation. Contact for multi-day discount.','Agilent 5973N CI/EI Mass Selective Detector, 6890N Network GC System, CTC Analytics Leap Technologies Combi PAL','','publish','open','open','','agilent-5973n-ciei-mass-selective-detector-6890n-network-gc-system-ctc-analytics-leap-technologies-combi-pal','','','2014-07-22 07:33:07','2014-07-22 14:33:07','',0,'http://labfellows.com/?post_type=job&#038;p=252',0,'job','',0),(253,39,'2014-05-26 23:10:03','2014-05-27 06:10:03','','Uploaded image agilent-5973n-ciei-mass-selective-detector-6890n-network-gc-system-ctc-analytics-leap-technologies-combi-pal-img_2537wa-300x225.jpg','','inherit','open','open','','uploaded-image-agilent-5973n-ciei-mass-selective-detector-6890n-network-gc-system-ctc-analytics-leap-technologies-combi-pal-img_2537wa-300x225-jpg','','','2014-05-26 23:10:03','2014-05-27 06:10:03','',252,'',0,'attachment','image/jpeg',0),(254,39,'2014-05-26 23:10:03','2014-05-27 06:10:03','','Uploaded image agilent-5973n-ciei-mass-selective-detector-6890n-network-gc-system-ctc-analytics-leap-technologies-combi-pal-img_2542wa-300x225.jpg','','inherit','open','open','','uploaded-image-agilent-5973n-ciei-mass-selective-detector-6890n-network-gc-system-ctc-analytics-leap-technologies-combi-pal-img_2542wa-300x225-jpg','','','2014-05-26 23:10:03','2014-05-27 06:10:03','',252,'',0,'attachment','image/jpeg',0),(255,39,'2014-05-26 23:10:03','2014-05-27 06:10:03','','Uploaded image agilent-5973n-ciei-mass-selective-detector-6890n-network-gc-system-ctc-analytics-leap-technologies-combi-pal-img_2544wa-300x225.jpg','','inherit','open','open','','uploaded-image-agilent-5973n-ciei-mass-selective-detector-6890n-network-gc-system-ctc-analytics-leap-technologies-combi-pal-img_2544wa-300x225-jpg','','','2014-05-26 23:10:03','2014-05-27 06:10:03','',252,'',0,'attachment','image/jpeg',0),(256,39,'2014-05-26 23:10:03','2014-05-27 06:10:03','','Uploaded image agilent-5973n-ciei-mass-selective-detector-6890n-network-gc-system-ctc-analytics-leap-technologies-combi-pal-img_2546wa-300x225.jpg','','inherit','open','open','','uploaded-image-agilent-5973n-ciei-mass-selective-detector-6890n-network-gc-system-ctc-analytics-leap-technologies-combi-pal-img_2546wa-300x225-jpg','','','2014-05-26 23:10:03','2014-05-27 06:10:03','',252,'',0,'attachment','image/jpeg',0),(257,39,'2014-05-26 23:10:03','2014-05-27 06:10:03','','Uploaded image agilent-5973n-ciei-mass-selective-detector-6890n-network-gc-system-ctc-analytics-leap-technologies-combi-pal-img_2547wa-300x225.jpg','','inherit','open','open','','uploaded-image-agilent-5973n-ciei-mass-selective-detector-6890n-network-gc-system-ctc-analytics-leap-technologies-combi-pal-img_2547wa-300x225-jpg','','','2014-05-26 23:10:03','2014-05-27 06:10:03','',252,'',0,'attachment','image/jpeg',0),(258,39,'2014-05-26 23:10:03','2014-05-27 06:10:03','','Uploaded image agilent-5973n-ciei-mass-selective-detector-6890n-network-gc-system-ctc-analytics-leap-technologies-combi-pal-img_2558wa-300x225.jpg','','inherit','open','open','','uploaded-image-agilent-5973n-ciei-mass-selective-detector-6890n-network-gc-system-ctc-analytics-leap-technologies-combi-pal-img_2558wa-300x225-jpg','','','2014-05-26 23:10:03','2014-05-27 06:10:03','',252,'',0,'attachment','image/jpeg',0),(259,39,'2014-05-26 23:10:03','2014-05-27 06:10:03','','Uploaded image agilent-5973n-ciei-mass-selective-detector-6890n-network-gc-system-ctc-analytics-leap-technologies-combi-pal-img_2540wa-300x225.jpg','','inherit','open','open','','uploaded-image-agilent-5973n-ciei-mass-selective-detector-6890n-network-gc-system-ctc-analytics-leap-technologies-combi-pal-img_2540wa-300x225-jpg','','','2014-05-26 23:10:03','2014-05-27 06:10:03','',252,'',0,'attachment','image/jpeg',0),(260,39,'2014-05-26 23:16:18','2014-05-27 06:16:18','The Agilent 6100 Series Quadrupole LC/MS (LC MS, LCMS, LC MSD, LC-MS) systems are the culmination of many generations of refinement in quadrupole LC/MS. They offer unrivaled performance combined with proven robustness and ease-of-use, and now feature a footprint barely half the size of previous models.\r\n\r\nAll four models of the Agilent 6100 Series integrate seamlessly with Agilent 1200 and 1100 Series LC modules.\r\n\r\nYou control all modules with the Agilent ChemStation data system, providing unprecedented levels of automation for reliable, unattended operation and enhanced productivity.\r\n\r\nThe 6100 Series systems provide the cornerstone for complete LC/MS solutions. They are suitable for applications as diverse as identity confirmation for combinatorial libraries of drug candidates through quantification of insecticides and herbicides in water samples.\r\n\r\nThis System is configurable with these ionization choices:\r\n\r\nElectrospray ionization (ESI) source to analyze large and small polar molecules.\r\nAtmospheric pressure chemical ionization (APCI) source to analyze a range of less polar and nonpolar molecules.\r\nMultimode source for simultaneous ESI and APCI ionization, providing maximum response coverage and higher throughput.\r\n\r\nRate may vary based on choice of ion source. System specifications include:\r\n\r\nMass range: m/z 101500\r\nMass accuracy:  0.13 u within the calibrated mass range in scan mode\r\nMass axis stability: Mass drift does not exceed the larger absolute value of  0.1 u or  100 ppm of measured mass over a 12 hour period at constant temperature  3 degrees centigrade\r\nScan Speed: 2500 u/s\r\nSIM sensitivity: ESI at 400 L/min or APCI at 1000 L/min  Selected ion monitoring of m/z 609.3  Positive ionization 10 pg reserpine, 100:1 RMS (20:1 peak-to-peak)\r\nScan sensitivity:  ESI at 400 L/min or APCI at 1000 L/min  Scan range m/z 100650  Scan speed 2500 u/s  Extracted ion at m/z 609.3  Positive ionization\r\n\r\nMinimum 3-hours reservation. Contact for multi-day discount.','Agilent 6110 Series Quadrupole LC/MS System','','publish','open','open','','agilent-6110-series-quadrupole-lcms-system','','','2014-07-22 07:15:51','2014-07-22 14:15:51','',0,'http://labfellows.com/?post_type=job&#038;p=260',0,'job','',0),(261,39,'2014-05-26 23:16:17','2014-05-27 06:16:17','','Uploaded image IMG_2373wa-300x225.jpg','','inherit','open','open','','uploaded-image-img_2373wa-300x225-jpg','','','2014-05-26 23:16:17','2014-05-27 06:16:17','',260,'',0,'attachment','image/jpeg',0),(262,39,'2014-05-26 23:16:17','2014-05-27 06:16:17','','Uploaded image IMG_2375wa-300x225.jpg','','inherit','open','open','','uploaded-image-img_2375wa-300x225-jpg','','','2014-05-26 23:16:17','2014-05-27 06:16:17','',260,'',0,'attachment','image/jpeg',0),(263,39,'2014-05-26 23:16:17','2014-05-27 06:16:17','','Uploaded image IMG_2376wa-300x225.jpg','','inherit','open','open','','uploaded-image-img_2376wa-300x225-jpg','','','2014-05-26 23:16:17','2014-05-27 06:16:17','',260,'',0,'attachment','image/jpeg',0),(264,39,'2014-05-26 23:16:17','2014-05-27 06:16:17','','Uploaded image IMG_2378wa-300x225.jpg','','inherit','open','open','','uploaded-image-img_2378wa-300x225-jpg','','','2014-05-26 23:16:17','2014-05-27 06:16:17','',260,'',0,'attachment','image/jpeg',0),(398,68,'2014-08-07 18:32:37','2014-08-08 01:32:37','','Uploaded image SorrentoMesa_sublease_space.jpg','','inherit','open','open','','uploaded-image-sorrentomesa_sublease_space-jpg','','','2014-08-07 18:32:37','2014-08-08 01:32:37','',0,'',0,'attachment','image/jpeg',0),(265,39,'2014-05-26 23:20:26','2014-05-27 06:20:26','VICTOR3 V ( Victor3V / Victor 3V / Victor 3 V ) Multilabel Counter ( Multilabel Plate Reader ) has fluorescence, luminescence, absorbance, UV absorbance, TRF and fluorescence polarization technologies, stackers and robotic loading system Both VICTOR3 V models (1420-040 and 1420-041) also include red sensitive PMT as standard. VICTOR3 is a multilabel, multitask plate reader for all light-emitting and light-absorbing detection technologies including: fluorescence (top and bottom), luminescence, absorbance, UV absorbance, time-resolved fluorometry, and fluorescence polarization. <br />\r\n<br />\r\nYou chose the detection technologies you need and upgrade as your needs change. A small bench top unit, VICTOR3 can operate as a stand-alone instrument or can integrate into a robotic system. VICTOR3 counting modes are always accessible. In the same protocol, even for the same well, you can freely use several different counting modes. System specifications include:<br />\r\n<br />\r\n    Fluorescence (340  850 nm): Dual ratio measurements, Top and bottom fluorescence<br />\r\n    Luminescence: Glow luminescence, Flash luminescence, Dual luminescence<br />\r\n    Photometry (340  800 nm)<br />\r\n    UV Photometry (260 nm/280 nm)<br />\r\n    Time-resolved Fluorometry (TRF): Dual window TRF, Dual emission measurements<br />\r\n    Fluorescence Polarization (400  850 nm)<br />\r\n<br />\r\n<br />\r\nMinimum 3-hours reservation.  Contact for multi-day discount.<br />\r\n','Perkin Elmer Victor3 V 1420 Multilabel Plate Counter','','publish','open','open','','perkin-elmer-victor3-v-1420-multilabel-plate-counter','','','2014-05-26 23:20:26','2014-05-27 06:20:26','',0,'http://labfellows.com/?post_type=job&#038;p=265',0,'job','',0),(266,39,'2014-05-26 23:20:25','2014-05-27 06:20:25','','Uploaded image perkin-elmer-victor3-v-1420-multilabel-plate-counter-img_2465wa-300x225.jpg','','inherit','open','open','','uploaded-image-perkin-elmer-victor3-v-1420-multilabel-plate-counter-img_2465wa-300x225-jpg','','','2014-05-26 23:20:25','2014-05-27 06:20:25','',265,'',0,'attachment','image/jpeg',0),(267,39,'2014-05-26 23:20:25','2014-05-27 06:20:25','','Uploaded image perkin-elmer-victor3-v-1420-mu