llimating optics. With its diode-array technology, the spectrophotometer is much faster than comparable conventional instrumentswith more precision, more sensitivity and more reproducible results. <br />\r\n<br />\r\nAccessories include special cell holders, peristaltic pumps, autosampler, a multicell transport, a Peltier temperature control accessory, and valve unit and valve-pump controller. The spectrophotometer can be either controlled from HP and non-HP personal computers equipped with Agilent <br />\r\n<br />\r\nChemStation software for UV-visible spectroscopy (personal computers used should be certified by UL1950), or from the dedicated handheld controller that comes with the Agilent 8453E UV-vis spectroscopy system. Instrument with Single Cell holder. Additional features include:<br />\r\n<br />\r\n    G1120A Multicell transport- includes a water thermostattable 8-position cuvette holder for standard 1 cm cuvettes. (+$950)<br />\r\n    Provisions for attaching a water bath (not supplied) with temperature-regulated circulating water.<br />\r\n<br />\r\n<br />\r\nMinimum 3-hours reservation.  Contact for multi-day discount.<br />\r\n<br />\r\n','Agilent 8453 UV-Visible Spectrophotometer','','publish','open','open','','agilent-8453-uv-visible-spectrophotometer','','','2014-05-26 23:27:17','2014-05-27 06:27:17','',0,'http://labfellows.com/?post_type=job&#038;p=272',0,'job','',0),(273,39,'2014-05-26 23:27:16','2014-05-27 06:27:16','','Uploaded image agilent-8453-spectrophotometer-300x225.jpg','','inherit','open','open','','uploaded-image-agilent-8453-spectrophotometer-300x225-jpg','','','2014-05-26 23:27:16','2014-05-27 06:27:16','',272,'',0,'attachment','image/jpeg',0),(274,39,'2014-05-26 23:27:16','2014-05-27 06:27:16','','Uploaded image img_3569-300x225.jpg','','inherit','open','open','','uploaded-image-img_3569-300x225-jpg','','','2014-05-26 23:27:16','2014-05-27 06:27:16','',272,'',0,'attachment','image/jpeg',0),(275,39,'2014-05-26 23:27:16','2014-05-27 06:2