g your company into the BioCube. From this point, we have the resources needed to build custom facilities within the BioCube complex to match your growing needs.<br />\r\n<br />\r\nThe BioCube consists of a reception/lobby, conference rooms, Scientific Lab, Core-Chem Lab, Business Center, Kitchen &amp; Break Room, Common Equipment Room Virus, Cell-Tissue Culture, Bacteria, Alcove, and Cold Rooms.<br />\r\n<br />\r\nWe have a combination of wet-lab space, which range anywhere from a 100 square foot bench space in our Concept Lab Program to anywhere between 750-1,300 square foot private lab suites. We have lab suites that are just labs, and we also have a combination of wet-lab spaces mixed with office space as well. The BioSquare also consists of just office specific space as well.<br />\r\n<br />\r\nOur incubator provides a great deal of instrumentation, partnerships, and the connections that are needed to help aid and excel the growth of companies over a long period of time.','1,500 sqft Wet Lab Space in San Jose','','publish','open','open','','1500-sqft-wet-lab-space-in-san-jose','','','2014-08-15 16:39:52','2014-08-15 23:39:52','',0,'http://labfellows.com/?post_type=job&#038;p=363',0,'job','',0),(319,16,'2014-05-28 05:38:31','2014-05-28 12:38:31','[pricerr_theme_pay_for_job_page]','Pay for Your Listing','','inherit','open','open','','14-revision-v1','','','2014-05-28 05:38:31','2014-05-28 12:38:31','',14,'http://labfellows.com/14-revision-v1/',0,'revision','',0),(320,16,'2014-05-28 05:39:39','2014-05-28 12:39:39','[pricerr_theme_post_new]','Post New Listing','','inherit','open','open','','5-revision-v1','','','2014-05-28 05:39:39','2014-05-28 12:39:39','',5,'http://labfellows.com/5-revision-v1/',0,'revision','',0),(321,16,'2014-05-28 05:40:24','2014-05-28 12:40:24','[pricerr_theme_post_new]','Host New Listing','','inherit','open','open','','5-revision-v1','','','2014-05-28 05:40:24','2014-05-28 12:40:24','',5,'http://labfellows.com/5-revision-v1/',0,'revision',''