,'2014-08-15 13:02:52','2014-08-15 20:02:52','',340,'',0,'attachment','image/jpeg',0),(629,82,'2014-10-10 12:15:34','2014-10-10 19:15:34','Stack includes:\r\n\r\nShimadzu Liquid Chromatography LC-10AT\r\nShimadzu Auto Injector 100-Slot HPLC AutoSampler SIL-10A\r\nShimadzu Column Oven CTO-10ASVP\r\nShimadzu Fraction Collector FRC-10A\r\n\r\nThe Shimadzu FRC 10A Fraction Collector collects both analytical and preparative fractions. -standard configuration has a 144 5mL vial capacity -for automated collection of thermally-labile fractions, Peltier temperature control keeps temperatures stable within a 4-70C range -choose from collection criteria such as volume, threshold, and peak purity -a precise peak division feature ensures high purity fractions -automatically adjusts for retention time shifts, so that only the peak of interest is collected -slope-override capability enables continued collection, even when the detector signal is off-scale.\r\n\r\nLove the idea of sharing idle time on this instrument. Book by $52/hour. For power users, I am offering a bundle of 35 hours as a \\\"month pass\\\" at $500.\r\n\r\nPrivate message me with any additional questions.\r\n\r\nBring your own columns/solvents! Waste disposal included free as long as you are not bringing anything in too crazy.\r\n\r\nCan provide training. Just book two extra hours.','HPLC - Shimadzu 10A Stack','','publish','open','open','','hplc-shimadzu-10a-stack','','','2014-10-18 13:50:56','2014-10-18 20:50:56','',0,'http://labfellows.com/?post_type=job&#038;p=629',0,'job','',0),(620,53,'2014-10-09 06:52:22','2014-10-09 13:52:22','','Uploaded image 57-300x300.jpg','','inherit','open','open','','uploaded-image-57-300x300-jpg','','','2014-10-09 06:52:22','2014-10-09 13:52:22','',0,'',0,'attachment','image/jpeg',0),(468,16,'2014-09-20 12:57:00','2014-09-20 19:57:00','','affil','','inherit','open','open','','affil','','','2014-09-20 12:57:00','2014-09-20 19:57:00','',0,'http://labfellows.com/wp-content/uploads/201