09 06:52:23','2014-10-09 13:52:23','',0,'',0,'attachment','image/png',0),(660,82,'2014-10-16 13:40:35','2014-10-16 20:40:35','','Uploaded image FPLC5.png','','inherit','open','open','','uploaded-image-fplc5-png','','','2014-10-16 13:40:35','2014-10-16 20:40:35','',651,'http://labfellows.com/?attachment_id=660',0,'attachment','image/png',0),(630,82,'2014-10-10 11:18:52','2014-10-10 18:18:52','','Uploaded image Chrom.JPG','','inherit','open','open','','uploaded-image-chrom-jpg','','','2014-10-10 11:18:52','2014-10-10 18:18:52','',629,'http://labfellows.com/?attachment_id=630',0,'attachment','image/jpeg',0),(631,82,'2014-10-10 11:18:53','2014-10-10 18:18:53','','Uploaded image oven.JPG','','inherit','open','open','','uploaded-image-oven-jpg','','','2014-10-10 11:18:53','2014-10-10 18:18:53','',629,'http://labfellows.com/?attachment_id=631',0,'attachment','image/jpeg',0),(632,82,'2014-10-10 11:18:54','2014-10-10 18:18:54','','Uploaded image auto.JPG','','inherit','open','open','','uploaded-image-auto-jpg','','','2014-10-10 11:18:54','2014-10-10 18:18:54','',629,'http://labfellows.com/?attachment_id=632',0,'attachment','image/jpeg',0),(663,16,'2014-10-18 12:49:45','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2014-10-18 12:49:45','0000-00-00 00:00:00','',0,'http://labfellows.com/?p=663',0,'post','',0),(635,82,'2014-10-10 12:09:11','2014-10-10 19:09:11','','Uploaded image Chrom.JPG','','inherit','open','open','','uploaded-image-chrom-jpg-2','','','2014-10-10 12:09:11','2014-10-10 19:09:11','',629,'http://labfellows.com/?attachment_id=635',0,'attachment','image/jpeg',0),(651,82,'2014-10-16 13:40:38','2014-10-16 20:40:38','Interchim PuriFlash 430 crushes biotage UPFP 200 ml/min 30 bar.<br />\r\n<br />\r\nIntelligent Modular Design<br />\r\n<br />\r\nThe modular design of puriFlash instruments provides a level of flexibility to meet changing purification requirements. Upgrade at any time to a higher pressure or higher flow pump, additional detector (ELSD, RI, MS) or additional collector.<br />\r\n<br />\r\nExternal fluid connections including check valves and pump seals provide easy access for the end user.<br />\r\n<br />\r\nTouch Screen Controller<br />\r\n<br />\r\nSolvent Level Monitoring<br />\r\n<br />\r\nLeak Detection<br />\r\n<br />\r\n4 USB Ports<br />\r\n<br />\r\nEthernet Ready<br />\r\n<br />\r\nFraction Collector:<br />\r\n<br />\r\n4 Racks, 176 x 18mm Tubes<br />\r\n<br />\r\nFull Size Keyboard<br />\r\n<br />\r\nSolvent Resistant<br />\r\n<br />\r\nHPLC Pump:<br />\r\n<br />\r\nTrue Quaternary Gradient<br />\r\n<br />\r\n200 ml/min, 435 PSI/30 bar<br />\r\n<br />\r\nUV Detector<br />\r\n<br />\r\nDual Wavelength DAD<br />\r\n<br />\r\n200  600 nm + Scanning<br />\r\n<br />\r\nSpectral View &amp; Purity Confirmation<br />\r\n<br />\r\nSample Loading<br />\r\n<br />\r\nDry Load &amp; Liquid Load<br />\r\n<br />\r\nHigh Volume, Through-Pump<br />\r\n<br />\r\nMultiple Injection Sequence<br />\r\n<br />\r\nIntegrated Column Holder<br />\r\n<br />\r\nPF430: Part No. PF430-18<br />\r\n<br />\r\nWhy are HPLC pumps better? Reliable Performance &amp; Low Maintenance<br />\r\n<br />\r\nHPLC pump design has evolved to a point where years of continuous service is the norm. The low dead volume pump achieves shallow, reproducible gradients without having to premix solvents. Annual maintenance is done in a matter of minutes by replacing the pump seals and check valves.<br />\r\n<br />\r\nOther flash systems rely upon syringe pumps or gear pumps which require routine service to maintain optimum performance. Shallow gradients require the end user to pre-mix solvents. Flow rates are inconsistent due to the periodic re-filling of the syringes throughout the run.<br />\r\n<br />\r\nThe syringe pumps &amp; gear pumps cannot withstand high pressures and are not suitable for use with UPFP Flash columns which provide 500% higher loading and use 70% less solvent.','FPLC Interchim Puriflash 430','','publish','open','open','','fplc-interchim-puriflash-430-crushes-biotage-upfp-200-mlmin-30-bar','','','2014-10-16 13:52:39','2014-10-16 20:52:39','',0,'http://labfellows.com/?post_type=job&#038;p=651',0,'job','',0),(659,82,'2014-10-16 13:40:34','2014-10-16 20:40:34','','Uploaded image FPLC3.jpg','','inherit','open','open','','uploaded-image-fplc3-jpg','','','2014-10-16 13:40:34','2014-10-16 20:40:34','',651,'http://labfellows.com/?attachment_id=659',0,'attachment','image/jpeg',0),(638,82,'2014-10-10 12:09:14','2014-10-10 19:09:14','','Uploaded image fraction.JPG','','inherit','open','open','','uploaded-image-fraction-jpg-2','','','2014-10-10 12:09:14','2014-10-10 19:09:14','',629,'http://labfellows.com/?attachment_id=638',0,'attachment','image/jpeg',0),(662,16,'2014-10-16 13:44:09','2014-10-16 20:44:09','Interchim PuriFlash 430 crushes biotage UPFP 200 ml/min 30 bar.\n\nIntelligent Modular Design\n\nThe modular design of puriFlash instruments provides a level of flexibility to meet changing purification requirements. Upgrade at any time to a higher pressure or higher flow pump, additional detector (ELSD, RI, MS) or additional collector.\n\nExternal fluid connections including check valves and pump seals provide easy access for the end user.\n\nTouch Screen Controller\n\nSolvent Level Monitoring\n\nLeak Detection\n\n4 USB Ports\n\nEthernet Ready\n\nFraction Collector:\n\n4 Racks, 176 x 18mm Tubes\n\nFull Size Keyboard\n\nSolvent Resistant\n\nHPLC Pump:\n\nTrue Quaternary Gradient\n\n200 ml/min, 435 PSI/30 bar\n\nUV Detector\n\nDual Wavelength DAD\n\n200  600 nm + Scanning\n\nSpectral View &amp; Purity Confirmation\n\nSample Loading\n\nDry Load &amp; Liquid Load\n\nHigh Volume, Through-Pump\n\nMultiple Injection Sequence\n\nIntegrated Column Holder\n\nPF430: Part No. PF430-18\n\nWhy are HPLC pumps better? Reliable Performance &amp; Low Maintenance\n\nHPLC pump design has evolved to a point where years of continuous service is the norm. The low dead volume pump achieves shallow, reproducible gradients without having to premix solvents. Annual maintenance is done in a matter of minutes by replacing the pump seals and check valves.\n\nOther flash systems rely upon syringe pumps or gear pumps which require routine service to maintain optimum performance. Shallow gradients require the end user to pre-mix solvents. Flow rates are inconsistent due to the periodic re-filling of the syringes throughout the run.\n\nThe syringe pumps &amp; gear pumps cannot withstand high pressures and are not suitable for use with UPFP Flash columns which provide 500% higher loading and use 70% less solvent.','FPLC - nterchim-puriflash-430/','','inherit','open','open','','651-autosave-v1','','','2014-10-16 13:44:09','2014-10-16 20:44:09','',651,'http://labfellows.com/651-autosave-v1/',0,'revision','',0),(552,16,'2014-09-23 14:52:45','2014-09-23 21:52:45','','date_location_bench','','inherit','open','open','','date_location_bench','','','2014-09-23 14:52:45','2014-09-23 21:52:45','',0,'http://labfellows.com/wp-content/uploads/2014/05/date_location_bench.png',0,'attachment','image/png',0),(553,16,'2014-09-23 14:52:46','2014-09-23 21:52:46','','top_title','','inherit','open','open','','top_title','','','2014-09-23 14:52:46','2014-09-23 21:52:46','',0,'http://labfellows.com/wp-content/uploads/2014/05/top_title.png',0,'attachment','image/png',0),(554,16,'2014-09-23 14:52:46','2014-09-23 21:52:46','','bottom_badge','','inherit','open','open','','bottom_badge','','','2014-09-23 14:52:46','2014-09-23 21:52:46','',0,'http://labfellows.com/wp-content/uploads/2014/05/bottom_badge.png',0,'attachment','image/png',0),(555,16,'2014-09-23 14:52:47','2014-09-23 21:52:47','','calltoaction','','inherit','open','open','','calltoaction','','','2014-09-23 14:52:47','2014-09-23 21:52:47','',0,'http://labfellows.com/wp-content/uploads/2014/05/calltoaction.png',0,'attachment','image/png',0),(558,16,'2014-09-23 15:35:29','2014-09-23 22:35:29','<a href=\"http://www.labfellows.com/events\"><img