'first_name','Prithwish'),(798,47,'last_name','Pal'),(799,47,'nickname','prithwish_pal'),(800,47,'description','Sales | Marketing | Strategy | Business Development | Product Management\r\n\r\nPrithwish combines an unique blend of scientific acumen, commercial experience, and business education to drive development, and marketing of innovative products and services. \r\n\r\nTechnical and domain knowledge covers a range of fields within the life sciences industry, including molecular diagnostics, and personalized medicine.  \r\n\r\n\r\n \r\nSkills: Marketing communication; business development; market intelligence; market analysis including value proposition and pricing; CRM (Salesforce.com) customization; demand forecasting; budgeting; quantitative decision making using regression analysis/linear programming; social media; proposal writing and submission, communication of scientific results, managing scientific projects and collaborations.   \r\n\r\nKnowledge: Molecular diagnostic assays (with focus on cancer), Next-generation sequencing (NGS), Biophysics (Electrophysiology), Biochemistry (protein engineering, and purification); Molecular Biology; Cell Biology (cell culture, cell-based assays); Fluorescence (confocal, live-cell imaging, FRET, LRET); High-throughput assays; Statistical and productivity software (MS Office, Prezi etc).'),(801,47,'rich_editing','true'),(802,47,'comment_shortcuts','false'),(803,47,'admin_color','fresh'),(804,47,'use_ssl','0'),(805,47,'show_admin_bar_front','true'),(806,47,'wp_capabilities','a:1:{s:13:\"administrator\";b:1;}'),(807,47,'wp_user_level','10'),(808,47,'LinkedIn','Gi5mEIXdAK'),(809,47,'wsl_user','LinkedIn'),(810,47,'wsl_user_gender',''),(811,47,'wsl_user_age',''),(812,47,'wsl_user_image','http://m.c.lnkd.licdn.com/mpr/mprx/0_9NypJi_KMGx3Y_HCqnU_J8nxMhUAt_MCqve_J8lTQQ73SFmGsturBhL7BDRaAkZmcBYG9Fi32ayA'),(813,47,'ip_reg','99.95.210.234'),(814,47,'last_user_login','1410777497'),(815,44,'credits','0'),(816,46,'credits','0'),(818,47,'credits','0'),(964,54,'last_name','Bethencourt'),(965,54,'nickname','ryan_bethencourt'),(966,54,'description','We are made of star stuff, as Carl Sagan once pondered, the elements which make up our bodies were forged in the furnaces of stars and propelled here by long forgotten supernova\'s. Life, evolved and found a way to take those atomic elements and create an almost infinite range of biological systems. \n\nMy mission is to help humanity harness the exponential power of the life sciences to provide affordable food, energy, water, novel materials and medicine for all.\n\nI\'m currently the Life Sciences prize creation lead at XPRIZE (www.xprize.org), the co-founder &amp; CEO of Berkeley Biolabs  (www.berkeleybiolabs.com) and an early stage advisor to multiple biotech companies. I passionately believe in the power of one individual to change the world for the better!\n\nContact me @ryanbethencourt\n\nPrimary Areas of focus: Biotech Innovation and Commercialization, Translational Clinical Development and Biotech Software/Hardware Development.\n\nStartups:\nRawflow (2002) - co-founded\nGenescient Pharmaceuticals (2009) - p/t COO\nHalpin Neurosciences (2011) - co-founded\nBerkeley Biolabs (2013) - co-founded\nH4Y Clinical Recruitment (2013) - Advisor\nGene and Cell Technologies (2013) - Advisor\nMetamed (2013) - Advisor\nBeyond Berlin (2014) - Co-development partner and Advisor\nValen (2014) - Co-development partner  and Advisor\nAlgas biotechnologies (2014) - Co-development partner  and Advisor\nBrain Buzz (2014) - Advisor\nThiel Foundation - 20 under 20 program - Mentor (Life Sciences)\n\nNon-Profits co-founded:\nSudo Room: community tech hackerspace founded in Downtown Oakland \nSciOpen Research (SRG): founded to advance promising new ALS therapeutics\nCounter Culture Labs: SF Bay Citizen science group\n Lifespan.io - aging research crowdfunding and advocacy'),(963,54,'first_name','Ryan'),(962,53,'credits','80'),(961,53,'last_user_login','1413355025'),(960,53,