,72,'nickname','mkh9'),(1382,72,'description',''),(1383,72,'rich_editing','true'),(1384,72,'comment_shortcuts','false'),(1385,72,'admin_color','fresh'),(1386,72,'use_ssl','0'),(1387,72,'show_admin_bar_front','true'),(1388,72,'wp_capabilities','a:1:{s:10:\"subscriber\";b:1;}'),(1389,72,'wp_user_level','0'),(1390,72,'ct_hash','54711d503ca4b106a82a2e92a437c888'),(1391,72,'default_password_nag','1'),(1392,72,'ip_reg','76.167.69.60'),(1393,72,'last_user_login','1408723414'),(1394,47,'wpseo_title',''),(1395,47,'wpseo_metadesc',''),(1396,47,'wpseo_metakey',''),(1397,47,'wpseo_excludeauthorsitemap',''),(1398,47,'_yoast_wpseo_profile_updated','1409012167'),(1399,47,'googleplus',''),(1400,47,'twitter',''),(1401,47,'facebook',''),(1402,47,'wp_dashboard_quick_press_last_post_id','664'),(1491,78,'description','I recognize that todays laboratories are looking for end-to-end solutions to their analytical challenges. My skill set combines a practical knowledge of laboratory operations, gained from working in the lab for many years, with in-depth product familiarity, a strong background in marketing strategy and communications, and an analytical science background. I am committed to excellent service and continuous improvement, with a proven history of responding proactively to the needs of internal and external customers. Defining products, including hardware, software, and consumables, includes not only being able to clearly communicate specifications, but being a product manager also requires balancing the needs of the business with the requirements of the customer. I am passionate about quality, service, and ensuring customer satisfaction. I enjoy writing, speaking with customers, solving problems, and learning about new technologies and innovative approaches to challenges.'),(1490,78,'nickname','trisa_robarge'),(1489,78,'last_name','Robarge'),(1488,78,'first_name','Trisa'),(1542,81,'description','Proficient structural biologist with experience with various biophysical methods (X-ray and electron crystallography, plasmon resonance, MS, LS, ITC, DSC, CD, labeled-based assay, etc).\n\nLeading role within a immunology project funded by a major NIH-NIAID contract grant, involving multiple teams (LIAI, UT).\n\nI am in charge of supervising and mentoring students/technicians and provide a panel of VACV antigens to the collaborative immunology teams, and provide the atomic structures of several Ag/Fab complexes.\n\nAdditionally, I characterize Ag/mAb affinities using plasmon resonance (Biacore), participate in troubleshooting and developing new research strategies, and make sure deadlines are met.\n\nI write progress reports and manuscripts destined to peer-reviewed publications.'),(1541,81,'last_name','Matho'),(1540,81,'first_name','Michael'),(1539,81,'nickname','Michael_Matho'),(1538,53,'session_tokens','a:1:{s:64:\"6a517be29ce0bf87cf683137533106daf49d1b6f30ebcd0269883a6424d657df\";i:1413553025;}'),(1536,72,'credits','0'),(1537,78,'credits','0'),(1535,80,'credits','0'),(1534,79,'credits','0'),(1472,53,'dismissed_wp_pointers','wp350_media,wp360_revisions,wp390_widgets'),(1471,53,'wp_dashboard_quick_press_last_post_id','617'),(1470,16,'metaboxhidden_post','a:11:{i:0;s:11:\"categorydiv\";i:1;s:16:\"tagsdiv-post_tag\";i:2;s:12:\"postimagediv\";i:3;s:12:\"revisionsdiv\";i:4;s:11:\"postexcerpt\";i:5;s:13:\"trackbacksdiv\";i:6;s:10:\"postcustom\";i:7;s:16:\"commentstatusdiv\";i:8;s:11:\"commentsdiv\";i:9;s:7:\"slugdiv\";i:10;s:9:\"authordiv\";}'),(1469,16,'closedpostboxes_post','a:0:{}'),(1492,78,'rich_editing','true'),(1493,78,'comment_shortcuts','false'),(1494,78,'admin_color','fresh'),(1495,78,'use_ssl','0'),(1496,78,'show_admin_bar_front','true'),(1497,78,'wp_capabilities','a:1:{s:10:\"subscriber\";b:1;}'),(1498,78,'wp_user_level','0'),(1499,78,'LinkedIn','hKrTSDH93I'),(1500,78,'wsl_user','LinkedIn'),(1501,78,'wsl_user_gender',''),(1502,78,'wsl_user_age',''),(1503,78,'wsl_user_image','https://media.licdn.com/mpr/mprx/0_5fq3TIYF-ysRIBAVbDkOTem6KjfR