e in various stages of drug discovery chemistry research, including target proposal, hit identification and expansion, hit to lead transition, lead optimization, clinical candidate declaration, &amp; scale-up synthesis to support development candidate profiling and IND enabling studies.\n\n	SAR study with break through in compound in vivo efficacy, selectivity, and ADMET profiles.\n	Patent due diligence and designing around blocking patents to achieve novel chemotypes.\n	Structure-based and computation-aided drug design (on five different projects).\n\n	Combinatorial synthesis and high throughput HPLC purification of compound libraries.\n	Scale-up synthesis (up to kilograms, route scouting &amp; optimization, process development &amp;  \n        finalization).\n\n	Polymer-based drug delivery system for cancer therapy. \n	Solid and liquid phase synthesis of peptides.\n\n	Total synthesis of natural products.\n	Novel synthesis of unnatural amino acids and peptides.\n	Developed methodology for heterocycles synthesis.\n\n	Authoring and co-authoring scientific publications.\n	Supervising research associates\n-       Knowledgeable contributor to interdisciplinary teams.'),(1586,83,'rich_editing','true'),(1587,83,'comment_shortcuts','false'),(1588,83,'admin_color','fresh'),(1589,83,'use_ssl','0'),(1590,83,'show_admin_bar_front','true'),(1591,83,'wp_capabilities','a:1:{s:10:\"subscriber\";b:1;}'),(1592,83,'wp_user_level','0'),(1593,83,'wsl_current_provider','LinkedIn'),(1594,83,'wsl_current_user_image','https://media.licdn.com/mpr/mprx/0_VoW0fTILUymioFXX4aJhfiEMUpV8okqX4Ig8fisMkJalzhikn2M1T_aBvtsYW_zHRdw3hkeN5KOf'),(1595,83,'session_tokens','a:2:{s:64:\"a129be07414caf406e35b0d69c2ef9e3b5a0bc38a861e110b69a88e02c08d003\";i:1414446324;s:64:\"b2ea845739fd10e37f5e833ac640dd4d41766576a3240c0e34ec3022b4430735\";i:1414458136;}'),(1596,83,'ip_reg','76.88.109.19'),(1597,83,'last_user_login','1413456647'),(1598,81,'credits','0'),(1599,83,'credits','0'),(1606,47,'wsl_current_user_image','https://media.licdn.com/mpr/mprx/0_9NypJi_KMGx3Y_HCqnU_J8nxMhUAt_MCqve_J8lTQQ73SFmGsturBhL7BDRaAkZmcBYG9Fi32ayA'),(1605,47,'wsl_current_provider','LinkedIn'),(1600,82,'personal_info','We are the Core Facility ran within Bio, Tech and Beyond biotech incubator in Carlsbad, CA (San Diego).\r\n\r\nOur Vision\r\nBio, Tech, and Beyond is an emerging economic biotech hub zone that is focused on facilitating business and science. There is currently no place like this in the San Diego area that provides low cost lab rental space, state of the art equipment, and opportunities for starting and growing businesses and interrelated educational opportunities.  \r\n\r\nNo crazy application process req'),(1601,82,'user_location','26'),(1602,82,'paypal_email','info@labfellows.com'),(1603,82,'user_full_name','Bio, Tech and Beyond'),(1604,82,'avatar','http://labfellows.com/wp-content/uploads/2014/10/BTBLogo.jpg'),(1607,47,'session_tokens','a:1:{s:64:\"da0c9aeb64bc5afc7efd9e7f457f3967a134d3e1c1022025aa25cddf337e5c3d\";i:1415396752;}');
